INSERT INTO "public"."gaode_residential_region" VALUES ('B023B00273', '330100', '120.123593,30.276641;120.123583,30.276983;120.123168,30.278122;120.122923,30.278302;120.122887,30.278347;120.122877,30.278409;120.122902,30.278441;120.122934,30.278457;120.123115,30.278457;120.123254,30.278471;120.123319,30.278501;120.12339,30.278552;120.123379,30.278724;120.12404,30.27875;120.124235,30.276666;120.123593,30.276641', '明珠公寓(万塘路)', '杭州市西湖区万塘路与古荡巷交叉口西50米', '杭州市', '', '15099.006463', '120.123717,30.277769', '商务住宅;住宅区;住宅小区', '0.4', '2', '60000平方米', '36844', '明珠公寓位于文三路上教三路和教四路之间,东方通信大厦西100米,总建筑面积35000平方米。拥有七幢多层公寓和两幢小高层高级公寓。采用围合空间、集中取景、过街楼等新颖的建筑手法,在前期楼宇优良品质的基础上更上台阶,成为明珠公寓名副其实的压轴之作。  明珠公寓采取封闭式、业主自治管理模式,由物业管理公司负责管理实施。公寓采用单元电子保安系统,户内监控系统加电子保安六,配合物业管理公司保安人员的全天候巡逻,多重保障确保业主的生活高枕无忧。开发商与物业管理公司制订了一整套完善的、切实可行的物业管理规定,以保障住户装修安全及日常生活的舒适。', '1999-12-31', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B00536', '330100', '120.143429,30.277475;120.143457,30.276984;120.1431,30.27673;120.142909,30.27682;120.142893,30.276894;120.142571,30.277135;120.142557,30.277433;120.143429,30.277475', '恒升花苑', '杭州市西湖区文三路133号', '杭州市', '0103000020E610000001000000080000001213D4F02D095E402575029A08473E4077D844662E095E40E883656CE8463E40B003E78C28095E4074D2FBC6D7463E407653CA6B25095E40F4E0EEACDD463E40F374AE2825095E4068757286E2463E40EA961DE21F095E40B493C151F2463E40373465A71F095E40C7D45DD905473E401213D4F02D095E402575029A08473E40', '4459.41368', '120.14304,30.277163', '商务住宅;住宅区;住宅小区', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B006D0', '330100', '120.158331,30.260494;120.158231,30.260831;120.158564,30.260905;120.158647,30.260569;120.158331,30.260494', '西子公寓(环城西路)', '杭州市下城区武林街道环城西路8号', '杭州市', '0103000020E610000001000000050000005ABC5818220A5E40E2CD1ABCAF423E40A88DEA74200A5E4071C806D2C5423E40AB949EE9250A5E40E65C8AABCA423E40F226BF45270A5E40F75965A6B4423E405ABC5818220A5E40E2CD1ABCAF423E40', '1055.834673', '120.158443,30.260701', '商务住宅;住宅区;住宅小区', '', 'None', '', '82989', '西子公寓该房可一览西湖美景,无任何遮挡物体和建筑,与西湖已是接触,路对面即是西湖六公园,不远处即有西湖有名的景点断桥残雪,以及杭州市青少年宫,往北过两个路口,即是浙江省政府所在,再过一个路口即是市中医院,一所甲级医院,往东,即是杭州著名的女装一条街,紧临之的又是杭州为繁华的延安路,往南的话即有望湖宾馆,凯越大酒店以及西湖名品街,可以说该房屋坐落的位置已是珍惜之至,,不仅与西湖,又与周围各城市的组成要素有那么一点点有效的距离,有美景,有宁静,又不失热闹。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B00A6D', '330100', '120.162252,30.248413;120.162301,30.248511;120.162971,30.248515;120.163001,30.247786;120.162767,30.247791;120.162375,30.2478;120.162302,30.247906;120.162275,30.248012;120.162252,30.248413', '湖滨公寓(开元路)', '杭州市上城区为柳营路10、12、16号', '杭州市', '', '4618.552013', '120.162634,30.248157', '商务住宅;住宅区;住宅小区', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0111F', '330100', '120.173202,30.281841;120.174414,30.281966;120.176214,30.282119;120.176225,30.281804;120.176214,30.281677;120.176191,30.281634;120.176157,30.281599;120.176061,30.281528;120.173497,30.281107;120.173395,30.281158;120.173355,30.281197;120.173202,30.281841', '光辉岁月公寓', '杭州市下城区文晖路139号(打铁关路与文晖路交叉口)', '杭州市', '', '17926.987157', '120.174675,30.281649', '商务住宅;住宅区;住宅小区', '0.4', '1.8', '150000平方米', '43015', '久信.光辉岁月城市阳光公寓由三栋东西走向的板式小高层和一栋多层组成,南北通透,阳光充足,小区人文景观与自然风景融为一体,70米楼间距,开畅的视野。  当城市变得高楼林立,当享受阳光逐渐变成一种奢侈,当住宅的日照率越来越被关注,久信·光辉岁月特立独行,创造性的推出70米超大楼间距,让每一个居住单元充分得到阳光的关怀。小高层采用板式设计,一梯二户或二梯二户,户户正南朝向,多数户型南向三开间,南北通透,日照充足。南向大阳台,低窗大开间,主卧凸窗,边套景观。开畅的视野让住户尽享阳光。  好的居住环境,让人身心愉悦。久信·光辉岁月独有三面环水的自然景观,加上南面开畅的视野空间,设计师强调户户开窗即景,四季步移景异。  和平小区临街300米沿街旺铺,位处城市中心商业区,商业气氛浓郁;周边住宅小区密集,和平小区、光辉岁月楼盘,金都华庭等近在咫尺,交通便利,拥有旺盛人气,充足客流!商铺采用中小面积框架式结构,便于自由分隔,面积从40-200平方米不等,无论是投资出租还是经商自用,都是不二的绝佳选择!  小区配套有幼儿园,与杭州著名的武林幼儿园合办,拥有先进完备的设施,雄厚的师资力量,先进的教育理念。小区预设ADSL LAN专线,与互联网亲密接触,24触摸世界资讯。享受健康的生活/小区内设置400米沿河慢跑道,设有多种锻炼设施,小区会所更让业主充分享受居家的休闲生活。  整个小区通过ISO9002认证的久信置业物管公司管理。享受安心的生活/小区拥有电视监控系统、保安巡更集成系统、紧急求救系统、红外线防盗报警系统等完善的安全配套设施。', '', '1.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B013E4', '330100', '120.151721,30.186284;120.150962,30.186396;120.150785,30.186453;120.150524,30.186893;120.150415,30.187108;120.150235,30.187257;120.14995,30.187418;120.149833,30.18751;120.149674,30.187604;120.14951,30.187679;120.149431,30.187711;120.149316,30.187731;120.149124,30.187791;120.149587,30.188751;120.152376,30.187963;120.152408,30.187898;120.151777,30.186296;120.151721,30.186284', '之江公寓', '杭州市滨江区东信大道1221号', '杭州市', '', '40122.868862', '120.150879,30.187579', '商务住宅;住宅区;住宅小区', '', 'None', '', '28004', '之江公寓位于西环路与滨盛路交叉口,由23幢多层建筑,3幢高层建筑组成,是成熟的社区,靠近滨江大道。之江公寓居住环境安静,交通方便快捷,生活配套一应俱全,方便居民的日常生活。生活安静,环境优美,生活氛围浓厚等优势为您创造了优良居住环境。让居家的日子变得方便、轻松、惬意,周边教育、娱乐等配套设施完善,环境优美。', '', '1.2元/月/平方米');
