INSERT INTO "public"."gaode_residential_region" VALUES ('B023B063Z9', '330100', '120.274715,30.175123;120.274587,30.175098;120.274149,30.175004;120.273943,30.174981;120.273339,30.174956;120.273322,30.175175;120.272825,30.175158;120.272788,30.175445;120.27277,30.175765;120.273935,30.175873;120.275054,30.175939;120.275085,30.175424;120.275042,30.175393;120.274969,30.175351;120.274887,30.17531;120.274865,30.175265;120.274826,30.175209;120.274715,30.175123', '红枫小区', '杭州市萧山区长途汽车北站以北,北干小学对面', '杭州市', '', '16031.133619', '120.273945,30.17547', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '红枫小区位于北干小学对面。', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0644G', '330100', '120.15307,30.283509;120.152774,30.2834;120.152595,30.283695;120.152455,30.283954;120.152078,30.284652;120.152287,30.284756;120.152458,30.284829;120.152601,30.284878;120.152773,30.284934;120.152958,30.285105;120.153149,30.28519;120.153801,30.285488;120.153869,30.285408;120.154506,30.284719;120.154308,30.284577;120.153378,30.284194;120.152951,30.284013;120.15299,30.283952;120.153229,30.283572;120.15307,30.283509', '红石·中央花苑', '杭州市拱墅区湖墅南路212号', '杭州市', '', '20518.970222', '120.153217,30.28456', '商务住宅;住宅区;住宅小区', '', '3.8', '140000平方米', '40674', '○空间与布局||红石.中央花园地块呈倒“L”形,沿湖墅南路长约300米,自北向南,建筑高度由高到低起伏变化,形成了丰富的城市空间形态。东北园区主要以高层为主,与沿湖墅南路部分建筑共同围合成中心花园,局部建筑底层架空,使园区空间视线更开阔、更富通透性。整个园区布局合理,空间感强,既与周边城市空间相通相融,又具有相当的独立性,闹中取静,优雅尊贵。br○建筑与功能||红石.中央花园为商住兼有的市中心综合性园区,其中湖墅南路南北两端设有商务写字楼,以中央大厦命名。沿湖墅南路一线设二层商业用房,构筑完整的的城市街景。园区功能分布明确,商务建筑与住宅建筑以适度变化的立面加以区分、整体风格现代时尚。br○交通与路径||红石.中央花园小区主入口设在东侧道路,与城市主干道保持适当距离。西侧湖墅南路设小区次入口。所有机动车进入小区后即可沿坡道至地下车库,小区地面原则上不设机动车停车位,做到人车分流,形成充分安全与自由的园区环境。沿湖墅南路、潮王路、小区会馆前设置地面临时停车位,可供访客使用。br○景观与会所||红石.中央花园旨在营造一个“优雅精致的市中心大型庭院”。中心花园人行道路以独具风格的石材铺设,另外设置人工水景、园艺小品,铺以绿地,植以大树,形成风格统一、层次丰富、静谧祥和的园区环境。园区北侧多层住宅底层设装修高雅、设施完备、面积为1300平方米的中心会所,会所与中心花园联成一体,构成完整的休闲生活空间。○都市||都市汇聚了财富与文明,它是人们向往居住的理想之地。当城市中心矗立起越来越多的大型写字楼、商业中心,而久居此处的人们被迫向远郊迁移,在市中心拥有一席之地似乎越来越成为一种奢望。红石.中央花园为回归都市提供了新的可能,亲近繁华,出入便捷,在市中心建造一个极富温馨感、有品位的家居环境,是我们开发思想的出发点。br○自然||理想的城市绝非冰冷的、机械的钢筋水泥的丛林,久在城市中漂泊的人们更期望与自然造物的亲密接触。在红石.中央花园的建设中,我们尽可能多地采用那些自然的材质,人们伸手触及之处是高档石材与时尚面砖,给人坚实与尊贵的感觉;放眼望去则是盛开的鲜花,潺潺的流水和郁葱的树木,令人温馨而愉悦。自然主义为家园带来真正的归宿感。br○品位||都市的建筑应该体现出一个城市的品位,石头所带来的永恒、诗意、尊贵和时尚,恰恰体现了杭州这座“最华贵城市”的特性。风景是外在的,只有心底的感受是最真实的。居住在红石.中央花园,石头的建筑与景致带给我们无尽的感触,足不出园区,就可体验到这座城市尊贵而时尚的品位。', '2004-03-01', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0644I', '330100', '120.152954,30.285131;120.152728,30.285481;120.153474,30.285838;120.153783,30.28551;120.152954,30.285131', '红石公寓', '杭州市下城区潮王路201号', '杭州市', '0103000020E61000000100000005000000B6F292FFC9095E4066136058FE483E40BE4BA94BC6095E401FA1664815493E4053B29C84D2095E403CF4DDAD2C493E4092EBA694D7095E4053AEF02E17493E40B6F292FFC9095E4066136058FE483E40', '3325.586617', '120.153239,30.285488', '商务住宅;住宅区;住宅小区', '', '3.6', '', '36238', '红石公寓建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '1.1元/月/平方米');
