INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0725A', '330100', '120.185256,30.271378;120.184575,30.27131;120.184513,30.271335;120.184479,30.271379;120.184439,30.271549;120.183844,30.271425;120.183838,30.271455;120.183808,30.271629;120.183826,30.271662;120.183963,30.271754;120.184004,30.271786;120.184017,30.271834;120.183982,30.272367;120.183956,30.272676;120.184486,30.272851;120.184847,30.272893;120.185375,30.272935;120.185994,30.273031;120.186213,30.27305;120.186383,30.272505;120.186122,30.272493;120.186148,30.271968;120.185367,30.271922;120.185333,30.271634;120.185316,30.271454;120.185256,30.271378', '中江花园', '杭州市下城区环城东路313号', '杭州市', '', '26562.882206', '120.185028,30.272235', '商务住宅;住宅区;住宅小区', '', 'None', '', '35531', '中江花园位于体育场路与环城东路交叉口,是市中心品质较好的楼盘之一,业主享有24热水供应和中央空调配置,由中凯房产开发建设,建造年份约2001年,总占地面积59亩,总建筑面积13万平方米。  中江花园位于护城河的对岸,环境优雅,内有水池、健身场地等,住宅楼底层有零星分布的便民店;小区周边配套设施齐全,购物、交通、求学非常方便;北面是农贸市场,居民日常生活便利;中江花园周围分布着裕达大厦、喜得宝集团以及海华大广场。', '', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B072DQ', '330100', '120.102171,30.280106;120.102401,30.279112;120.101756,30.279029;120.101169,30.278994;120.101075,30.278986;120.100834,30.278982;120.100594,30.278975;120.100373,30.278963;120.100278,30.27897;120.100093,30.280081;120.101647,30.280104;120.101776,30.280106;120.101956,30.28011;120.102141,30.280114;120.102171,30.280106', '中兴公寓', '杭州市西湖区古墩路300号', '杭州市', '', '20835.913568', '120.101221,30.279552', '商务住宅;住宅区;住宅小区', '', 'None', '', '34393', '中兴公寓由中兴房地产开发公司开发建设的,地处西湖区古墩路,东邻杭州高科技开发区,南望西湖两线风景区,距市中心3.5公里。小区占地面积28700平方米,总建筑面积53000平方米,绿化率达38%。中兴公寓由12幢多层住宅楼,1幢物业楼及1幢商铺楼组成,集居住、商贸于一体,是适用于工薪消费的居住小区。居住楼外形造型别致,尤其是二期开发的楼宇,采用斜坡屋顶,杜绝了渗漏问题。外墙以马赛克装饰,既美观大方又便于清洗。楼房间距严格按照国家1:1的标准,住户采光充分。小区中心公园与绿化带相印成趣,布局合理,给住户以新颖优美之感。小区物业管理以低价位收费,高质量服务,赢得了业主的赞誉。中兴公寓开工时间为1995年10月,期投入使用时间为1996年12月,全面竣工时间为2000年4月。', '', '0.6-1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B072DS', '330100', '120.205994,30.204738;120.204323,30.203902;120.204201,30.203956;120.203341,30.205414;120.202827,30.206149;120.202524,30.20666;120.202539,30.206792;120.202587,30.206909;120.20498,30.208118;120.205367,30.207498;120.205999,30.207315;120.206281,30.207191;120.206745,30.206811;120.206938,30.206509;120.206969,30.206487;120.207367,30.206662;120.20746,30.206497;120.207641,30.206185;120.207745,30.205978;120.207719,30.205884;120.207264,30.205533;120.206781,30.205165;120.205994,30.204738', '中兴花园', '杭州市滨江区长河街道江汉路1688号', '杭州市', '', '109487.951377', '120.204989,30.206055', '商务住宅;住宅区;住宅小区', '1:0.28', 'None', '40000平方米', '36200', '作为杭州滨江高档小区典范的滨江中兴花园,相当注重整个小区的环境设计。层层的叠水和雾森系统相互辉映,给人一种进入到秀水青山之间的美丽错觉。小区环境幽雅,稀有小区,让您居住的身心愉悦,有配套幼儿园、小学、超市。钱江边,3桥与4桥之间,一线江景房,环境优美,交通方便。中兴花园位于滨江江汉路,靠近滨江区政府西侧。交通便捷,购物方便,风景优美。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。环境优美,丽水成天的风景给予了回归家庭、回归私域的生活体验。', '2004-02-12', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B072E1', '330100', '120.124492,30.275211;120.124435,30.275763;120.124472,30.275784;120.12465,30.275793;120.124893,30.275827;120.125152,30.275881;120.125395,30.275924;120.12546,30.275915;120.125491,30.2759;120.125512,30.275867;120.125541,30.275802;120.125593,30.275367;120.124492,30.275211', '中兴文都苑', '杭州市西湖区万塘路68号', '杭州市', '', '5655.424419', '120.125012,30.275568', '商务住宅;住宅区;住宅小区', '', 'None', '', '31047', '中兴文都苑位于万塘路22号。共3幢。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.7元/月/平方米');
