INSERT INTO "public"."gaode_residential_region" VALUES ('B023B07G23', '330100', '120.152979,30.289157;120.15305,30.289024;120.153193,30.288752;120.152766,30.288617;120.152741,30.288155;120.152711,30.287395;120.152473,30.287271;120.152061,30.287074;120.151674,30.286914;120.151047,30.286697;120.150827,30.287203;120.150653,30.287652;120.150528,30.287983;120.151304,30.288214;120.151221,30.288514;120.151123,30.288716;120.15188,30.289048;120.15289,30.289365;120.152979,30.289157', '锦绣新村(枯树湾巷)', '杭州市拱墅区湖墅南路', '杭州市', '', '35358.252331', '120.15186,30.288023', '商务住宅;住宅区;住宅小区', '', '2.5', '', '33888', '锦绣新村开发商为杭州西湖城建开发有限公司 ,1970年竣工,属于比较老的小区,小区总户数1659,停车位350个。锦绣新村位于湖墅南路336号。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B07G4E', '330100', '120.156085,30.269678;120.155939,30.269897;120.155949,30.27003;120.156486,30.270039;120.15649,30.270118;120.156833,30.270102;120.156802,30.269666;120.156085,30.269678', '景湖苑(体育场路)', '杭州市下城区体育场路415号(体育场路与环城西路交叉口)', '杭州市', '0103000020E610000001000000080000005B99F04BFD095E4060730E9E09453E40F14A92E7FA095E40DC4944F817453E4003B68311FB095E405AF0A2AF20453E400A12DBDD030A5E4001A5A14621453E40AB09A2EE030A5E40990F087426453E40C07B478D090A5E408E95986725453E40A27C410B090A5E40D8D7BAD408453E405B99F04BFD095E4060730E9E09453E40', '2967.000913', '120.156422,30.269877', '商务住宅;住宅区;住宅小区', '', 'None', '', '36010', '景湖苑位于体育场路415号 体育场路与环城西路交叉口。交通便捷,购物方便,风景优美。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。环境优美,丽水成天的风景给予了回归家庭、回归私域的生活体验。', '', '1.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B07H0T', '330100', '120.130252,30.266007;120.130252,30.264612;120.130092,30.26455;120.128992,30.264888;120.127788,30.265321;120.128187,30.266263;120.130125,30.26612;120.130199,30.266077;120.130252,30.266007', '绿园', '杭州市西湖区玉古路159-161号求是路52号杭州黄龙体育中心旁', '杭州市', '', '27412.439088', '120.129192,30.265502', '商务住宅;住宅区;住宅小区', '', '3.15', '', '65386', '绿城·杭州绿园处于杭城市区内两山相拥的自然环境中,东邻宝石山麓,西望老和山麓,是绿城高层公寓作品。绿城·杭州绿园总占地面积约55亩,建筑布局呈梯形,作南北西的大围合,使园内空间化。南主楼为18层,两端退台为16层,北主楼为24层。厚重的石材和绿色中空相结合,整体建筑风格端庄典雅、稳重大气,与旁边大体量的黄龙体育中心气质吻合。同时,绿园的阳台和窗,以圆弧手法柔化建筑轮廓和立面,体现出凝重而不失优雅的风貌。绿城·杭州绿园被评为“2004年西湖杯工程质量奖”、“2005年钱江杯工程质量奖”。', '2000-12-18', '2.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B07J2B', '330100', '120.192328,30.234805;120.1934,30.233795;120.193034,30.233408;120.193098,30.233194;120.193699,30.232826;120.192577,30.231578;120.190856,30.229784;120.190743,30.229804;120.19027,30.229964;120.189539,30.230293;120.189947,30.231114;120.190037,30.231396;120.19004,30.231733;120.190033,30.23214;120.190068,30.232343;120.190114,30.23246;120.1902,30.232604;120.190368,30.232785;120.191115,30.233574;120.192243,30.234715;120.192328,30.234805', '望江家园东园', '杭州市上城区钱江路483号', '杭州市', '', '94273.824341', '120.191563,30.232221', '商务住宅;住宅区;住宅小区', '', 'None', '', '39285', '望江家园东园一个人气相当旺的小区近年来的成交数据成抛物线式的上升2005年的拆迁房小区环境在整个片区同等小区中是的 小区的楼间距大整体的绿化率高小区设施齐全周边的配套也是相当的成熟 边上就是物美杭州的物美超市 万泰城娱乐美食城(即将强势登陆出门口就是)周边有一大批成熟的生活配套让生活就是这么的方便近江 婺江地铁站点近在咫尺出行不是问题 近距钱塘江闲时面对漫步江边无不是一种超然未来的规划区发展潜力也是不可估量的', '', '0.35元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B07J5H', '330100', '120.099514,30.27437;120.099461,30.274781;120.099408,30.275192;120.099388,30.275434;120.099916,30.275476;120.100076,30.27445;120.099514,30.27437', '杭州文化新村', '杭州市西湖区文新街道文三西路297号', '杭州市', '0103000020E61000000100000007000000A0DFF76F5E065E40E700C11C3D463E408F8EAB915D065E40EB8F300C58463E407D3D5FB35C065E40EF1EA0FB72463E405A677C5F5C065E40DB34B6D782463E403716140665065E4039D55A9885463E4054C72AA567065E402063EE5A42463E40A0DFF76F5E065E40E700C11C3D463E40', '5304.647511', '120.099721,30.274927', '商务住宅;住宅区;住宅小区', '', 'None', '', '21927', '文化新村位于文三西路297号。 有餐饮、超市、医院、学校、健身娱乐设施、 能够充分满足您一站式购物需求。 小区的配套设施齐备,小区内设有幼儿园、小学、中学,超市就在家门。 大环境、大配套、交通便捷,吸引众多置业人青睐。南面是别墅,无遮挡,视野开阔,南面阳台、窗户,观景北高峰,一览无余。西、南面与绿城桂花园毗邻,包融。 沿文三西路(房屋内几乎感觉不到噪音),小区内停车很方便(免费停车)。', '', '');
