INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0827X', '330100', '120.166373,30.265812;120.166391,30.265666;120.16653,30.264969;120.16571,30.264882;120.165526,30.264854;120.165532,30.264782;120.165107,30.264722;120.165073,30.264859;120.165043,30.264996;120.164992,30.265068;120.164969,30.265097;120.164853,30.266059;120.165389,30.266133;120.166329,30.266242;120.166373,30.265812', '皇亲苑', '杭州市下城区百井坊巷93号', '杭州市', '', '17608.332793', '120.165672,30.265507', '商务住宅;住宅区;住宅小区', '', 'None', '', '44231', '皇亲苑社区是一个新旧结合的社区,南靠凤起路,北临百井坊巷,东起中山北路,西至延安路,占地面积12.1万平方米,小区有33幢居民楼,总户籍数2100户,总户籍人口约5500人。皇亲苑社区由原来的皇亲苑、余官巷和半个贯桥居委会合并构成。社区内设有1800平方米的健身公园,由国家体育总局、省、市、区体育局、天水街道等多家单位共同投资65万元建成,集健身、休闲、文化、娱乐为一体,有健身器材36件。社区内有近30家辖区单位及社区医疗服务站、图书室、电子阅览室、老年活动室等多家服务网点。现有配套办公用房和服务用房近600平米。', '', '');
