INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08TPZ', '330100', '120.222721,30.258207;120.222081,30.257477;120.221426,30.258018;120.220717,30.258633;120.219522,30.259734;120.221206,30.260821;120.221487,30.261045;120.222379,30.260295;120.222608,30.260098;120.223118,30.259637;120.223593,30.259215;120.222721,30.258207', '盛世钱塘', '杭州市江干区富春路899号', '杭州市', '', '65304.008406', '120.221644,30.259329', '商务住宅;住宅区;住宅小区', '1057个', '3', '235000平方米', '62652', '盛世钱塘地处“江河汇流之处,钱来运通之地”,东依古老运河、西临钱江新城、南望钱塘江景、北瞰主城繁华,360°度全景住宅,轻松拥有钱塘江壮美景致,千年古运河的优雅风情,是同时具备钱塘江、运河景观的住宅项目,是真正意义的江河景观CBD公寓,曾荣获国际花园社区(中国赛区)大奖。  盛世钱塘设计吸取了中国传统堪舆学的精髓,由七幢近百米高的板式、板点式高层围合而成,气势宏大,幢距开阔,视野宽广。建筑分别以北斗七星名字命名(玉衡阁、瑶光阁、开阳阁、天枢阁、天权阁、天璇阁、天玑阁)。  盛世钱塘中心花园约有3万平方米,底层采用架空层设计,使得园林景观与建筑物彼此和谐交融。小区内所有的电梯厅设计都是直接采光,另外在板点式建筑中还特别采用了观光电梯设计,让业主踏着美景直到家门。住宅设计南北通风,以明厅、明室、明厨、明卫即“四明”为特征,主力户型以150㎡左右的三室二厅、180㎡左右的四室二厅为主。其中玉衡阁设计的全装修Loft白领公寓户型更是独具匠心,层高4.8米的复式结构,将创造的激情从居住的空间展示着,让生活更加随心所欲。开发商精装修并附送分体式空调、热水器、整体厨柜、洁具、淋浴房。  盛世钱塘建筑是融入城市环境建筑,以高层住宅的形式兴起与城市发展的必然需要,宽敞的楼体间距可以让建筑之外的空间被用作绿化和其它配套,为业主寻求更多生存空间,为生活营造更好的环境。', '2005-07-29', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08TQE', '330100', '120.173383,30.26471;120.174368,30.264684;120.17434,30.265063;120.174321,30.265345;120.174277,30.265633;120.174496,30.265657;120.175165,30.26572;120.175311,30.265744;120.175394,30.265773;120.175457,30.265811;120.175626,30.265844;120.175886,30.265902;120.175692,30.267099;120.17563,30.267721;120.173967,30.267531;120.172957,30.267466;120.17308,30.266808;120.173383,30.26471', '十五家园社区', '杭州市下城区健康路163号', '杭州市', '', '54334.876271', '120.174339,30.266406', '商务住宅;住宅区;住宅小区', '', '1.83', '12300平方米', '36324', '十五家园建于1988年左右,南面为凤起路,西靠丝绸城,北靠体育场路,东靠东河和建国路,小区于2007年被市政府庭院整改过。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08TTA', '330100', '120.186773,30.268544;120.186283,30.268524;120.186265,30.268928;120.186684,30.268944;120.186736,30.268942;120.186757,30.268889;120.186772,30.268836;120.186773,30.268544', '天园阁', '杭州市下城区刀茅巷218号(刀茅巷杭州艮山中学旁边)', '杭州市', '0103000020E61000000100000008000000A7B1BD16F40B5E407A89B14CBF443E404033880FEC0B5E40EC3026FDBD443E40EDD808C4EB0B5E408BFA2477D8443E40EFAB72A1F20B5E4097749483D9443E40183F8D7BF30B5E4055850662D9443E4024D3A1D3F30B5E401041D5E8D5443E40BFF38B12F40B5E40CAFCA36FD2443E40A7B1BD16F40B5E407A89B14CBF443E40', '1814.27074', '120.186521,30.268735', '商务住宅;住宅区;住宅区', '', '1.5', '112000平方米', '25856', '交通方便,距离火车东站,延安路,环北市场都很方便也很近。周边设施齐备--市红会医院,好又多超市,农贸市场都非常的方便,而且幼儿园,小学,中学都很近。是你居家的选择地段。', '', '0.9元/月/平方米');
