INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08VZH', '330100', '120.10545,30.267842;120.105244,30.268532;120.104801,30.270223;120.105869,30.270415;120.106478,30.268406;120.10545,30.267842', '方易西鉴枫景', '杭州市西湖区竞舟路45-53号', '杭州市', '0103000020E610000001000000060000003F575BB1BF065E40C87E164B91443E406A865451BC065E40F2ED5D83BE443E40A3E5400FB5065E4084A0A3552D453E40412AC58EC6065E400C59DDEA39453E4095EF1989D0065E40D80C7041B6443E403F575BB1BF065E40C87E164B91443E40', '23294.054974', '120.105635,30.269203', '商务住宅;住宅区;住宅小区', '0.7', '2.6', '100000平方米', '39014', '方易·西鉴枫景地处天目山路和竟舟路交又口西北角,正对国家大学科技园,属泛浙大文化圈核心领地,南临沿山河,与老和山相望,有灵溪隧道穿行直通西湖和灵隐风景区,东近城市CBO——世贸、黄龙高尚商务区,西邻“城市之肺”——西溪湿地保护区,北有文三西路等繁华成熟的街区,这是城西核心区域的最优位置。  方易·西鉴枫景由7栋高层、小高层组成,总建筑面积约1O万平米,依托适宜人居的尺度空间,以科学、合理的规划设计、精致、典押的建筑细节,打造杭州独具国际风尚的风景社区。  简约建筑风格:方易.西鉴枫景的建筑秉承现代建筑简约的风格,通过弧面和线条的组合,演绎明快的节奏。大面积的通透设计和灵动的屋顶构件设计,则形成了视觉和心灵的感应。大量的架空层设计,增加了社区的交流空间。方易·西鉴枫景9幢建筑设计布局宽松,错落有致,层次分明,意韵流动,如同一首凝固的蓝调。  全景观户型设计:方易.西鉴枫景采用全景观户型设计,营造住户与环境间的随意交流。以100—150平方米为主的户型,客厅和主卧多直接面对景观,尤其是杭城罕见的270度椭圆型全景观房,可让你随时享受与环境的对话,另外,部分一楼住户独有的水景空间,更是增加了居家的艺术情调。在西鉴枫景,你不必主动地走进风景,你的眼前、身边就是艺术,就是风景。  西鉴枫景的景观设计特别邀请了日本景观大师小林治人先生进行创意设计。一主多副的连续布局和独特的建筑形体,让自然界的风、光、影最大限度地照顾到各个单位间的景观视角。建筑群随老和山和沿山河的韵律生长,如同水岸边伸展出的一片露台,把环境、建筑、人的活动、天空以及自然的光影等景观要素进行组织,在和谐中酝酿着生机,在时光的自由流转中尽享四季的交叠。  迎宾入口—轴线(道路、园路)—广场加以用自然的基本元素构筑的露台、地标、架空层、景观小品、景观游泳池等景观细节,形成社区的景观秩序。通过景观尺度的小型化、近人化创造出丰富多变的景观效果,让自然引领我们回家的路。', '2010-11-08', '2.4元/月/平方米');
