INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08X7M', '330100', '120.156096,30.305242;120.154447,30.305299;120.154434,30.306532;120.155256,30.306505;120.155438,30.306315;120.156095,30.306305;120.156096,30.305242', '大关东六苑', '杭州市拱墅区大关苑路56号', '杭州市', '0103000020E6100000010000000700000055C2137AFD095E409A5DF756244E3E40C87DAB75E2095E4063804413284E3E40FDD8243FE2095E406F2D93E1784E3E407FA0DCB6EF095E407C0F971C774E3E4090A339B2F2095E403546EBA86A4E3E406C04E275FD095E40ED9925016A4E3E4055C2137AFD095E409A5DF756244E3E40', '17367.875595', '120.155237,30.305852', '商务住宅;住宅区;住宅小区', '', '2', '22000平方米', '31754', '大关小区地处拱墅区,东临上塘河,南至石灰坝,西与上塘路接壤,北靠大关路,常住人口在8万人以上,是杭州规模比较大的成熟小区之一。  按照所处位置的不同,大关小区又可分为南苑、东苑和西苑。其中南苑共有南一到南十苑组成,东苑由东一苑至东十苑组成,西苑有西三至西八组成,每个苑大约有十幢左右的房子,总共住宅楼在200多幢。大关小区建设的跨越时间比较长,早建的西苑大多数房子和东苑的一部分组团建筑年代在1994年左右,后的大关东十苑和香吉公寓在2002年才终完工。  经过近十年的发展,大关小区已经从原来的城郊结合部成为城市的一个次中心。现在大关小区周边的配套相当完善,吃穿行都可方便的解决。位于大关东一苑旁边的大关小区公交车站是城北的枢纽站,有K3路、12路、K41路、57路、58路、K78路、K82路、K218路、K316路等十数条在此始发。除了大关小区车站,在大关西八苑的大关苑路上还有大关小区北车站,上塘路上的大关西六苑站。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B08X83', '330100', '120.15206,30.308008;120.151909,30.308015;120.151828,30.308032;120.151731,30.308066;120.151428,30.308232;120.150793,30.308664;120.151105,30.308863;120.15169,30.309223;120.152452,30.309694;120.15246,30.308011;120.15206,30.308008', '大关西八苑', '杭州市拱墅区大关苑西路与大苑路交叉口西北150米', '杭州市', '', '14787.055103', '120.151869,30.308715', '商务住宅;住宅区;住宅小区', '', '2.5', '', '29878', '大关西八苑的优点在于处于闹市地段,综合配套优质,出行比较方便,购物配套便利,但美中不足的是有一定噪声。  小区环境舒适,闹中取静,绿化率高,生活配套成熟,餐饮、超市、银行、学校、医院、公交站点近在咫尺,生活非常方便,多条主干道相拥环抱,出行便利,非常宜居。', '', '0.5-0.54元/月/平方米');
