INSERT INTO "public"."gaode_residential_region" VALUES ('B023B09IQE', '330100', '120.179742,30.273048;120.180541,30.273208;120.180616,30.273197;120.180863,30.271995;120.180525,30.271951;120.180537,30.271808;120.180582,30.271482;120.180625,30.270963;120.180625,30.270913;120.180583,30.270845;120.180528,30.270787;120.180462,30.270764;120.180244,30.270746;120.1802,30.270758;120.180063,30.271709;120.179808,30.27277;120.179742,30.273048', '宝善公寓', '杭州市下城区建国北路与莫衙营交叉口东北50米', '杭州市', '', '14563.940166', '120.180324,30.272143', '商务住宅;住宅区;住宅小区', '', '3.5', '45000平方米', '39325', '联华铭座-宝善公寓位于杭州市中心,城市主干道体育场路和建国北路的交叉口,周边配套设施齐全,医疗、交通、商贸、金融、教育一一涵盖,入住即可享受繁华、从容、便利的都市中心生活。项目总占地12000余方,由四幢楼宇组成,其中包括两幢高层住宅,一幢多层住宅,以及一幢高级商务楼。楼盘整体风格现代、简洁、大气,在建筑用材上,也力求完美,先进的EPS外墙保温系统,省内首家将高档铝木复合门窗运用高层公寓,用别墅的品质打造公寓。住宅主力户型128-145房,边套户型三房两厅两卫,约140平方米功能布局合理,全明化设计,空间通透,采光充裕。客厅4.5米开间,全落地玻璃,尽览室外完美风景。北面书房精致典雅,宽敞观景窗让您饱览无限风景。跃层式三房两厅两卫,约128平方米动静分区,干湿分离。人性化设计,引领现代设计潮流。户型阔绰,三房朝南,尽享城市中心生活气息。独创超豪华阳台设计,2.7米进深,5.6米挑高,10平方米空间赠送,自然风情渗透满屋。', '2008-05-31', '1元/月/平方米');
