INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4P0', '330100', '120.288394,30.355464;120.290532,30.3557;120.290599,30.355679;120.290652,30.355621;120.290661,30.355558;120.290639,30.35532;120.290459,30.354012;120.290406,30.353811;120.290347,30.353758;120.290245,30.353723;120.287538,30.353367;120.287378,30.353387;120.287297,30.353434;120.287262,30.353529;120.287313,30.353674;120.287997,30.354862;120.288394,30.355464', '东城丽景', '杭州市余杭区城隍中路165号', '杭州市', '', '50161.639466', '120.289122,30.354504', '商务住宅;住宅区;住宅小区', '0.5', 'None', '84000平方米', '20879', '东城丽景配套成熟、交通便利。', '2007-06-09', '0.9-1.65元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4WW', '330100', '120.334445,30.185831;120.334341,30.184847;120.334312,30.1848;120.334235,30.18478;120.332713,30.184981;120.332589,30.185102;120.332547,30.185168;120.332573,30.185985;120.333284,30.185899;120.333489,30.186888;120.333546,30.186965;120.33361,30.186978;120.334487,30.186845;120.334563,30.186802;120.33458,30.186724;120.334445,30.185831', '新和人家', '杭州市萧山区新街镇文轩路', '杭州市', '', '27630.944288', '120.333671,30.185782', '商务住宅;住宅区;住宅小区', '', '1.45', '60000平方米', '17043', '新和人家位于杭州萧山区新街镇,交通便捷,周边配套设施比较完善。新和人家总建筑面积约6万平方米,容积率1.45,绿化率达35%,由十六幢多层花园景观公寓和部分沿街商铺组成。小区在规划设计上强调空间的整体和谐,住宅户型精致实用,85m2~135m2十余款户型令您轻松实现筑家梦想,尽情享受温馨时光。  新和人家为纯多层花园景观社区。小区在外立面的设计现代简约、清新典雅,充分体现建筑的时尚美感,整体色系稳重、和谐,亲切。丰富的多层腰线和屋檐廓线设计,凹凸有致,与周边自然水系、园林景观融为一体,从而显得灵动、活泼、典雅,视觉美感强烈。  相比于高层、小高层等建筑形态,多层公寓建筑密度低,得房率高,强调与景观和谐性,综合性价比更高,居住成本更低,居住舒适性更优越。适宜的建筑尺度,充分体现了人与建筑之间的和谐关系,倡导公共空间的情感交流和亲情沟通,使每一次邻里相遇、每一次日常问候,都变得亲切温暖,居家生活将变得更为轻松愉悦。距离:浙江(中国)花木城:1KM。绕城高速东出口:1.5KM。机场高速:2.5KM。萧山区第三高级中学:4KM。萧山主城区:7KM。萧山国际机场:10KM。钱江六桥:10KM。钱江二桥:14.5KM。钱江三桥:15.5KM。', '2008-06-27', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A4Z7', '330100', '120.092728,30.322593;120.092311,30.322489;120.092152,30.322783;120.091339,30.324836;120.09351,30.325552;120.093456,30.324692;120.0937,30.324021;120.094189,30.323206;120.093483,30.32288;120.092728,30.322593', '都市水乡·水秀苑', '杭州市西湖区民意街45号', '杭州市', '', '45863.598454', '120.092744,30.323989', '商务住宅;住宅区;住宅小区', '', 'None', '', '25640', '都市水乡临近三墩镇,位于五里河畔、三墩路北、古墩路东。它东起丰庆路,南起留祥路,西至环镇东路、通济北路,北至余杭勾庄。都市水乡有餐饮、超市、医院、学校、健身娱乐设施、 能够充分满足您一站式购物需求。 小区地段好交通便利,周边配套成熟完善。 小区的配套设施齐备,小区内设有幼儿园、小学、中学,超市就在家门口。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A5EB', '330100', '120.082664,30.333918;120.080808,30.333078;120.079665,30.334695;120.079087,30.33539;120.079502,30.335674;120.080158,30.336051;120.080595,30.336141;120.081131,30.335594;120.082664,30.333918', '白马尊邸', '杭州市西湖区三墩镇金家渡河与厚仁路交叉口', '杭州市', '', '49076.526362', '120.080817,30.334631', '商务住宅;住宅区;住宅小区', '0.68', '1.9', '140000平方米', '35727', '白马尊邸地处西湖区北三墩核心区,北依金家渡河,西临厚仁路商业街,南临颐景园,东部与亲亲家园隔河相望,是大城西极为罕见的集排屋与高层于一身的高尚综合人文社区。  白马尊邸总建筑面积14万㎡,由原创四庭院城市排屋、景观小高层及高层组成。其中排屋主力户型面积约220-260㎡,公寓主力户型以86——130平米二房、三房为主。  白马尊邸北侧与东侧临河,构成独特双水岸人居。建筑采用简约、大气的现代建筑风格,精心规划具有“大面宽、短进深”特点的户型结构,并针对主流消费需求,严格控制户型面积。优美园林景观营造社区幽雅环境,成就高品质人文居所。', '2010-05-30', '1.2元/月/平方米');
