INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A92G', '330100', '120.232299,30.3501;120.234617,30.351033;120.235539,30.349165;120.233388,30.34823;120.233176,30.348304;120.232299,30.3501', '丁桥景园南苑', '杭州市江干区丁桥镇蕙兰雅路263号', '杭州市', '0103000020E610000001000000060000002FF99FFCDD0E5E4061545227A0593E407B8505F7030F5E4018D1764CDD593E40AF7B2B12130F5E4068E89FE062593E40D9D138D4EF0E5E40707CED9925593E40938D075BEC0E5E40E41071732A593E402FF99FFCDD0E5E4061545227A0593E40', '47993.55203', '120.23392,30.349616', '商务住宅;住宅区;住宅小区', '', 'None', '', '20884', '小区位于江干区蕙兰雅路与丁群路交叉口向东北170米,有多条公交线路通达,交通便利。小区建成于2008年,共16栋1395户,容积率2.18,绿化率40%,建筑面积196000平方米,占地面积90000平方米。附近有丁兰幼儿园、丁兰街道丁桥小学、丁桥小学、丁兰实验中学、杭州师大附属丁兰实验学校、丁兰商业中心、物美、丁桥医院、丁桥家苑社区卫生站、杭州惠雅口腔、余杭区乔司街道五星社区卫生服务站、丁桥镇社区卫生服务中心、邮政储蓄银行、上海银行(惠兰雅路)等配套设施,宜于居住。', '', '');
