INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A9DF', '330100', '120.2458,30.382494;120.244817,30.382268;120.244746,30.382298;120.244702,30.38234;120.243795,30.385992;120.245939,30.386448;120.246547,30.384316;120.246398,30.384146;120.246234,30.383938;120.246049,30.383663;120.245916,30.38332;120.245825,30.383035;120.245814,30.382784;120.245842,30.382549;120.2458,30.382494', '天泉苑', '杭州市余杭区天祥西路与欢西路交叉口', '杭州市', '', '67453.747904', '120.245196,30.384531', '商务住宅;住宅区;住宅小区', '', 'None', '', '9836', '广厦天都城天泉苑位于余杭星桥街道。居住环境安静,交通方便快捷,生活配套一应俱全,方便居民的日常生活。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。全面提升居住舒适度和生活品味的精品社区。  广厦天都城天泉苑配套成熟、交通便利。此小区为高档小区,小区绿化高,环境优雅,居住人群整体素质高,为附近一流小区。出行方便,紧邻规划中地铁三号线,距离公交车站步行2,有许多公交路线在此经过,通往杭州(k535;k371)临平(k762;k767)都有相应的直达车。快捷方便。小区配套完善:周边有大型购物超市,诸多酒店,娱乐场所。', '2006-12-31', '0.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A9DI', '330100', '120.188324,30.33377;120.188271,30.333433;120.187859,30.333531;120.187709,30.333578;120.187542,30.333681;120.1875,30.333866;120.187291,30.334098;120.186189,30.334267;120.186199,30.334733;120.186545,30.334913;120.186703,30.334996;120.186866,30.335077;120.18712,30.33528;120.187247,30.335684;120.187285,30.335857;120.187263,30.336059;120.188212,30.33617;120.188227,30.335795;120.188294,30.335165;120.188331,30.334243;120.188324,30.33377', '北景莲趣苑', '杭州市下城区回龙路162号', '杭州市', '', '31473.904547', '120.187542,30.334793', '商务住宅;住宅区;住宅小区', '', 'None', '', '24487', '北景园——浙江省目前在建规模最大经济适用房项目,位于下城区石桥镇,东起石桥路,西至上塘河,石祥路、宣杭铁路以北,规划杭玻路以南。用地面积45500平方米,规划总建筑面积10余万平方米,容积率2.3,绿化率32%,由13幢11层板式小高层组成。社区依托北景园项目,交通便捷、配套齐全,户型经济实用,是安居之首选。br历史销售价格为2600-3000元/平方米br安吉实验小学学区房', '', '0.8-0.9元/月/平方米');
