INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A9DR', '330100', '120.206359,30.34298;120.205705,30.342695;120.20445,30.342693;120.204415,30.343385;120.204282,30.344227;120.204304,30.345181;120.207052,30.34512;120.207,30.343426;120.206948,30.343281;120.206359,30.34298', '元都新景', '杭州市江干区石桥街道华悦路', '杭州市', '', '56130.143789', '120.205622,30.344007', '商务住宅;住宅区;住宅小区', '', '2.2', '160000平方米', '', '元都新景公寓位于杭州传统市中心下城区,石桥路和华丰路交接处东北面,下城都市经济园区内,与兴建中的浙江华悦酒店、怡和大厦、人才公寓(规划)等为邻,享受居住休闲娱乐于一体的产业城配套资源。  元都新景总建筑面积约16万平米,规划为上品小高层、高层。建筑采用简洁明快的现代风格,11-15层建筑南低北高布置,成扇形布局。  户型设计以90方精致小三房和舒适两房为主,结合部分大户型及跃层户型,满足不同的购房需要。    元都新景公寓位于杭州传统市中心下城区,石桥路和华丰路交接处东北面,下城都市经济园区内,与兴建中的浙江华悦酒店、怡和大厦、人才公寓(规划)等为邻,享受居住休闲娱乐于一体的产业城配套资源。  元都新景总建筑面积约16万平米,规划为上品小高层、高层。建筑采用简洁明快的现代风格,11-15层建筑南低北高布置,成扇形布局。  户型设计以90方精致小三房和舒适两房为主,结合部分大户型及跃层户型,满足不同的购房需要。', '2008-06-24', '1.20元/月/平方米');
