INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A9DT', '330100', '120.205082,30.33998;120.205091,30.33792;120.202837,30.337921;120.202813,30.339929;120.205082,30.33998', '润和·亿城嘉园', '杭州市下城区华丰路与华中路交叉口', '杭州市', '0103000020E61000000100000005000000E4BF4010200D5E40494BE5ED08573E400D6D0036200D5E4011AAD4EC81563E40CD5A0A48FB0C5E40B2A19BFD81563E40098D60E3FA0C5E4045F6419605573E40E4BF4010200D5E40494BE5ED08573E40', '41868.098202', '120.203961,30.338939', '商务住宅;住宅区;住宅小区', '736个(1：1.15)', '2', '100000平方米', '21941', '亿城嘉园总建筑面积近17万平方米,由6幢多层和18幢小高层组成,在户型设计上,小区精心营造90-150平方米的精致户型,充分保证各层次的多样性选择。其中,亿城嘉园西区总建筑面积近13万平方米,由6幢多层和11幢小高层组成,户型面积从90—150平方米不等,亿城嘉园东区(即亿城雅苑)总建筑面积3.4万平方米,由7幢小高层组成。', '2009-08-01', '1.08元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0A9PH', '330100', '120.093584,30.327871;120.093708,30.327784;120.093797,30.32737;120.093712,30.326964;120.09367,30.326756;120.093638,30.326654;120.093568,30.32659;120.093287,30.326554;120.093083,30.326483;120.093034,30.326397;120.092351,30.32607;120.092258,30.326076;120.092175,30.326114;120.091061,30.327002;120.091018,30.32711;120.091035,30.327154;120.091094,30.327185;120.093412,30.327908;120.093584,30.327871', '都市水乡水月苑', '杭州市拱墅区长阳路319号', '杭州市', '', '27615.950126', '120.092586,30.327011', '商务住宅;住宅区;住宅小区', '', '2.1', '260000平方米', '27664', '都市水乡临近三墩镇,位于五里河畔、三墩路北、古墩路东。它东起丰庆路,南起留祥路,西至环镇东路、通济北路,北至余杭勾庄。都市水乡有餐饮、超市、医院、学校、健身娱乐设施、 能够充分满足您一站式购物需求。 小区地段好交通便利,周边配套成熟完善。 小区的配套设施齐备,小区内设有幼儿园、小学、中学,超市就在家门口。', '', '0.5-0.8元/月/平方米');
