INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ABS9', '330100', '120.260494,30.169556;120.260398,30.169551;120.260381,30.16987;120.260385,30.169932;120.260227,30.170495;120.260778,30.170662;120.261335,30.17081;120.261475,30.170563;120.261678,30.170247;120.261877,30.169953;120.261976,30.169828;120.261389,30.169673;120.260722,30.169579;120.260494,30.169556', '圣和花园', '杭州市萧山区工人路', '杭州市', '', '12962.518254', '120.261019,30.170136', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '圣和花园位于城厢镇高田村。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0ABX5', '330100', '120.14228,30.170605;120.140463,30.169988;120.140032,30.171632;120.14071,30.171867;120.14047,30.172371;120.144205,30.173622;120.144948,30.171492;120.14228,30.170605', '浙新小区', '杭州市滨江区滨文路646号', '杭州市', '0103000020E61000000100000008000000FEB7921D1B095E40B988EFC4AC2B3E4013D38558FD085E4063B66455842B3E402F19C748F6085E4073F22213F02B3E40170E846401095E40FA42C879FF2B3E406C04E275FD085E4060C77F81202C3E40DCBA9BA73A095E40BADDCB7D722C3E40B8E7F9D346095E40908653E6E62B3E40FEB7921D1B095E40B988EFC4AC2B3E40', '91777.289692', '120.142455,30.171807', '商务住宅;住宅区;住宅小区', '', 'None', '', '25767', '小区位于滨江区滨文路646号,有多条公交线路通达,交通便利。小区建成于2000年,占地面积3428㎡,建筑面积12000㎡,共820户,绿化率10%。小区及周边教育、医疗、商业等设施配套成熟完善,可满足多样化需求。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC2H', '330100', '120.185395,30.200608;120.185357,30.201082;120.185172,30.201861;120.184901,30.202306;120.184573,30.202801;120.186141,30.203575;120.186314,30.203305;120.186882,30.202395;120.186972,30.202196;120.187155,30.200954;120.187095,30.200932;120.187034,30.200886;120.186975,30.200808;120.186912,30.200705;120.185395,30.200608', '锦绣江南', '杭州市滨江区咏渡巷59号', '杭州市', '', '43644.048508', '120.185992,30.201988', '商务住宅;住宅区;住宅小区', '', 'None', '', '32531', '锦绣江南落座于钱塘江畔,毗邻钱江四桥,作为直面一线钱江的楼盘,占尽地利之优,7栋高层建筑合理排布,让更多的户型可以尽情盛揽一线江景。在户型设计上,通透开敞的空间拥有270度景观视觉。  锦绣江南,在建筑设计上以人为本,匠心独运,整体风格统一和谐、大气优雅,把钱塘江的恢弘致远融入极富张力与想象力的现代建筑格局中,树立起城市崭新的地标性建筑群。  锦绣江南以人的居住感受为根本的出发点,营造出大栋距建筑格局,建筑排布点式和板式相结合,更大程度地采光纳风。小区的入口道路采用人车分流的设计,车位配比超过1:1。每栋建筑底部设置架空敞廊,为业主的沟通和交流提供自然休闲的空间,即使是在雨季,也可以在此避雨、赏景、谈笑。  锦绣江南每栋楼房的入口大堂整体和谐统一,局部细致入微,点睛家的优雅尊贵。大幅落地玻璃窗的采用,让视野游历在广阔之外。', '', '1.1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC2N', '330100', '120.165295,30.189559;120.165229,30.189438;120.165109,30.189244;120.164285,30.18898;120.164218,30.18915;120.164122,30.189479;120.164014,30.189867;120.163856,30.190427;120.163795,30.190553;120.163679,30.190678;120.163283,30.191094;120.162894,30.191455;120.162695,30.191684;120.162392,30.191797;120.162365,30.192106;120.16229,30.192682;120.164082,30.193283;120.164208,30.193308;120.16432,30.193259;120.164382,30.193122;120.164977,30.191074;120.165314,30.189737;120.165295,30.189559', '盛元慧谷', '杭州市滨江区火炬大道725号', '杭州市', '', '60810.806669', '120.163976,30.191371', '商务住宅;住宅区;住宅小区', '1300', '3.5', '252874平方米', '27738', '盛元慧谷由杭州盛元房地产开发有限公司投资并开发,位于杭州钱塘江南岸滨江区之江科技工业园25号地块内,东临火炬大道,南临滨盛路,西面接壤国信嘉园,北面接壤70米深的城市绿化带,并直临闻涛路与钱塘江,用地面积52341平米,土地使用性质为商住用地,容积率小于3.5,建筑密度小于20%,绿化率大于40%,日照间距大于1:1.17。建筑退红线分别为:东退火炬大道多层20米以上、高层30米以上,南退滨盛路多层20米以上、高层30米以上,西退用地红线8米以上,北退用地红线3米以上。', '2007-04-28', '1.5元/月/平方米');
