INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6Q', '330100', '120.131506,30.173952;120.131433,30.175971;120.133921,30.176011;120.133952,30.17518;120.133995,30.17486;120.134071,30.17469;120.134131,30.174673;120.134236,30.174038;120.133752,30.174007;120.133385,30.173984;120.132773,30.173979;120.131506,30.173952', '钱塘山水', '杭州市滨江区钱江一桥西南侧东信大道92号', '杭州市', '', '46958.813846', '120.132751,30.174968', '商务住宅;住宅区;住宅小区', '1:0.8', '2.5', '14.6平方米', '40624', '中海.钱塘山水位于滨江区,东临高新技术产业开发区,聚集了UT斯达康、东方通信、摩托罗拉等国内外知名企业,东南面是滨江高教园区,现浙江中医学院、中国美术学院、杭二中等九所学校已经入驻,西接闻涛路,规划有50米宽的绿化带。总建筑面积约15万平方米,环抱式开放布局,容积率2.5,建筑密度19.8%。中海.钱塘山水建筑由5幢高层、1幢两层楼单身公寓和8幢联排组成。', '2008-09-23', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6R', '330100', '120.14194,30.175934;120.141943,30.175721;120.141933,30.175325;120.141914,30.174551;120.141719,30.174487;120.141372,30.1744;120.141177,30.174367;120.141112,30.174381;120.139604,30.174022;120.139606,30.176099;120.141931,30.176098;120.14194,30.175934', '天鸿君邑小区', '杭州市滨江区东信大道与六和路交叉口西南150米', '杭州市', '', '38349.139238', '120.140714,30.175188', '商务住宅;住宅区;住宅小区', '892个', '2.5', '12平方米', '27593', '天鸿君邑居于东信大道旁,踞滨江居住核心,揽钱塘江景,望六和古风,是一方繁华中更享静谧的人间美境,也是杭州滨江区罕有的精装公寓住品。园区总建筑面积近16万平米,由精装修高层公寓,精装修服务式商务楼和休闲商业街恢弘筑就。  天鸿君邑由钱塘江大桥、复兴大桥快速对接大杭州繁华腹地,杭州高新公建中心、高教园区等大型商务配套环伺周围。天鸿君邑约15000平米的大型中央广场式花园,社区独配的休闲商业街,而入户花园作为天鸿.君邑户型特色之一,创造了公寓中的别墅级豪华配置。', '2008-09-20', '3.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0AC6Y', '330100', '120.168656,30.190724;120.165858,30.189592;120.165728,30.189599;120.165664,30.189689;120.165364,30.190661;120.164928,30.19221;120.1646,30.19341;120.16694,30.194172;120.167362,30.19336;120.168656,30.190724', '钱江水晶城', '杭州市滨江区滨盛路4402号', '杭州市', '', '101348.397189', '120.166493,30.191879', '商务住宅;住宅区;住宅小区', '1700', '2.5', '', '58068', '钱江水晶城是继钱江彩虹城后钱江南岸又一座大规模的一线江景高尚住宅园区;钱江水晶城由9幢高层住宅、沿江一线2幢超高层楼王级住宅,以及一条长达270米的商业街区组成,建筑容积率2.5,建筑密度不到18%。    景观设计围绕园区内南北两大景观内庭,以森林、河流、城堡、庄园和广场等自然人文意象,结合经典传承的新欧洲艺术,营造欧洲盛行的新奢华主义特色园林,并在园区内的各个围合空间,结合建筑的公共部位,通过造坡、树阵、水系、园雕和铺装的组合与艺术创意,形成各个组团的主题景观。    尽享滨江区完备教育、商业配套、高新区公建中心、高教园区等大型生活组团簇拥左右,更紧邻滨江区最为成熟的滨盛路生活圈。社区内精心设有尊贵VIP俱乐部、游泳池、欧式风情商业街等丰富多彩的生活配套,奢华品位浑然天成', '2012-08-31', '1.44元/月/平方米');
