INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BEVL', '330100', '120.143509,30.281007;120.143528,30.280433;120.143622,30.278955;120.143651,30.278126;120.144952,30.278131;120.144958,30.278228;120.144934,30.27836;120.14491,30.278622;120.144974,30.2787;120.144993,30.27886;120.144976,30.2793;120.144915,30.27994;120.144885,30.280036;120.144866,30.280739;120.144864,30.28078;120.144539,30.280743;120.144377,30.280778;120.144269,30.280875;120.144264,30.281051;120.143509,30.281007', '文锦苑', '杭州市西湖区文三路108号', '杭州市', '', '34095.056829', '120.14424,30.279532', '商务住宅;住宅区;住宅小区', '0.5', '3.2', '150000平方米', '74672', '文锦苑小区位于浙江省杭州市西湖区文三路108号,南靠西溪数码港和文三路、北邻学军小学、东接东部软件园、西临求智巷和省教育学院。小区占地约70余亩,建筑面积15万平方米,共有20幢住宅楼、两座商务楼和一个商场组成,容积率为3.20,周围绿化率近30%,有3000平方米的两个中心花园绿地,小区开发商为中大房地产集团有限公司。小区环境优美、典雅,拥有时尚住宅气息,外观简洁大方,给人温馨、和谐之美感。小区坐落在杭州传统的文教区和新兴的高新技术开发区中心位置,与文三路电子信息街区比邻。该区域文化底蕴深厚,人杰地灵;高新产业集聚,精英辈出。周边有武林幼儿园、省幼儿师范附属幼儿园、学军小学、文三路小学、文二路小学、学军中学、浙江大学西溪校区、浙江省新华书店、文华大酒店、杭州第二百货大楼,浦发银行文晖支行、中国工行高新支行,农行杭州城西支行、西溪卫生院、省新华医院等设施,交通便利、生活方便。小区内设有业主会馆、便利店、理发美容店、洗衣店等配套设施,招标聘请浙江耀江物业管理公司承担物业管理工作,小区于2003年12月通过民主选举成立了业主委员会,实行有效的自主服务和民主管理。小区地理位置优越,人文环境良好,是理想的创业、教育、生活和居住之地。概况:由20幢景观公寓和2幢临街写字楼组成,周边各级名校环伺,自然环境优美,文化氛围浓郁。中大·文锦苑“秉承以文化造就精英;”的宗旨,从建筑风格、园林景观到配套物管,均追求高雅、高素质的品位,成为杭州市“学院房产”的首创者。开盘半个月销售率逾80%,创造了杭城房地产波谷期的销售奇迹。交通:82,156,19,41,10,74,86,199,57,179,156,290,地铁建设中一号线站', '2000-03-31', '1.2元/月/平方米');
