INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BIXE', '330100', '120.179961,30.25905;120.179965,30.260986;120.180642,30.260973;120.180641,30.259079;120.179961,30.25905', '东河锦园', '杭州市下城区下城建国北路5-67号', '杭州市', '0103000020E610000001000000050000008D63247B840B5E405F07CE1951423E402D5BEB8B840B5E40BFB67EFACF423E402E9276A38F0B5E4096236420CF423E4045D4449F8F0B5E409414580053423E408D63247B840B5E405F07CE1951423E40', '11825.205447', '120.180301,30.260021', '商务住宅;住宅区;住宅小区', '', '2.55', '5240平方米', '42227', '东河锦园总共5幢,1997年开盘,主力户型147-168方,内部环境比较好,有健身器材,人工湖,小区东边沿建国北路,2幢、4幢位于小区中间,西边是东河。', '', '0.6-2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BJ6W', '330100', '120.198519,30.35118;120.198476,30.351136;120.197016,30.350256;120.196338,30.351068;120.196573,30.351313;120.196753,30.351552;120.197054,30.352041;120.197207,30.352355;120.197256,30.352383;120.197317,30.352383;120.198144,30.35212;120.198212,30.352097;120.198248,30.352045;120.19853,30.351225;120.198519,30.35118', '朗诗·田园绿郡', '杭州市拱墅区广济路南侧', '杭州市', '', '24473.738232', '120.197459,30.351349', '商务住宅;住宅区;住宅小区', '车位配比1:1左右', '1.8', '50000平方米', '30750', '朗诗田园绿郡地处杭州主城区北部,坐落于半山田园板块。项目北望半山,南临上塘河绿化景观带,距市中心武林门约10km,外围有石桥路、沈半路及上石高架与市区相连,北侧临近绕城高速,方便连通长三角各大城市。项目依托半山地区成熟配套,生活所需一应俱全。朗诗田园绿郡规建有高端公寓及排屋,整体承袭朗诗地产一直倡导的“节能、环保、健康、舒适、安全”的建筑理念。项目采用朗诗升级版科技系统,利用核心节能技术,实现室内环境的舒适宜人.', '2012-09-25', '2.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BKBM', '330100', '120.155901,30.158555;120.154546,30.157727;120.153072,30.16048;120.154323,30.161285;120.155901,30.158555', '金盛曼城', '杭州市滨江区东冠路655号(浦沿路与东冠路交汇处)', '杭州市', '0103000020E610000001000000050000007A1A3048FA095E40069E7B0F97283E4091EEE714E4095E403AB2F2CB60283E40BB7B80EECB095E407EA99F3715293E405281936DE0095E40DA5548F949293E407A1A3048FA095E40069E7B0F97283E40', '43850.785908', '120.15447,30.159497', '商务住宅;住宅区;住宅小区', '地下498个，地上104', '2.1', '13平方米', '31209', '曼城位于滨江区浦沿路和东冠路交叉口,紧邻规划中的地铁6号线地铁口,总建筑面积约13万平方米,总户数约900户,主力户型面积约90平方米,整个小区由高层、小高层合理排布组成。近邻杭二中、浦沿中学、浦沿小学、公交车总站(规划中)、商业金融中心和文化娱乐中心(规划中)以及滨江高教园、高科技产业园。  曼城景观分三大主题:浪漫风情、风尘雅趣、和谐共生趣。整体规划结合基地原有特征,把11栋建筑单体采取错落布局手法增加空间的开阔感、采光的丰富性,化解了一般小区通透不足、呆板有余的弊端。在建筑设计上,曼城采用“薄板短板”的建筑手法,让室内南北通透,采光更丰富,居住更舒适。同时,曼城设置局部架空层更强化了小区的通透性、景观的融合性。', '2009-11-14', '1.18元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BKTW', '330100', '120.204424,30.340261;120.202923,30.340239;120.202844,30.340348;120.202861,30.341104;120.20302,30.341212;120.204311,30.341225;120.204412,30.341107;120.204424,30.340261', '怡乐银座', '杭州市下城区华丰路178号', '杭州市', '0103000020E610000001000000080000001FA16648150D5E40B11A4B581B573E40CC26C0B0FC0C5E40E1D231E719573E40268C6665FB0C5E404E42E90B21573E409128B4ACFB0C5E40E8887C9752573E40C51B9947FE0C5E40B4006DAB59573E40A3CD716E130D5E40DE9387855A573E403DBA1116150D5E40CA6FD1C952573E401FA16648150D5E40B11A4B581B573E40', '13625.210119', '120.203637,30.340729', '商务住宅;住宅区;住宅小区', '', '2.5', '25463平方米', '9073', '怡乐银座位于下城区华中路和华丰路交汇处,下城科技经济园区内。该项目使用年限50年,有完全的产权,属于商业办公用房性质。', '', '2.40元/月/平方米');
