INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQ45', '330100', '120.286629,30.165688;120.286476,30.164925;120.285774,30.165036;120.286006,30.166097;120.286025,30.166139;120.286176,30.16615;120.286631,30.166099;120.286629,30.165688', '柠檬公寓(通惠中路)', '杭州市萧山区通惠中路58号', '杭州市', '0103000020E610000001000000080000007445292158125E40F3565D876A2A3E40B0C56E9F55125E40F54A5986382A3E400403081F4A125E40A4A99ECC3F2A3E406D1D1CEC4D125E40B6F63E55852A3E40A835CD3B4E125E401497E315882A3E409B3924B550125E40FB3A70CE882A3E4044C18C2958125E40F7E5CC76852A3E407445292158125E40F3565D876A2A3E40', '7300.445438', '120.286239,30.165542', '商务住宅;住宅区;住宅小区', '1.3', '4.5', '35000平方米', '14751', '柠檬公寓是由浙江金帝集团投资(浙江金帝集团在萧山开发的项目有金色钱塘、高新科技广场、文源广场等),由杭州金泰房地产开发有限公司开发的高层单体公寓项目,地处通惠路与萧绍路交汇处,西面有乐购超市,北面靠商检局,东面有成熟居住社区,萧山大型商业城就在项目附近,生活非常之便利。 整个项目总建筑面积约4万方,由单体公寓和商场组成。柠檬公寓建筑是由两梯六户组合而成,户户均南北朝向,围合屋顶中心绿化广场是项目一大亮点,实现生态小区概念。', '2008-02-29', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQ6I', '330100', '120.169738,30.214758;120.170262,30.215389;120.171038,30.216274;120.171112,30.216336;120.171236,30.216291;120.171543,30.216634;120.172167,30.216213;120.17089,30.214841;120.170372,30.214352;120.169738,30.214758', '复兴东苑', '杭州市上城区复兴路北口', '杭州市', '', '19099.853646', '120.170938,30.2155', '商务住宅;住宅区;住宅小区', '', 'None', '', '36365', '小区环境佳,是居住的最佳选择择。', '', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQAM', '330100', '120.202392,30.333236;120.201607,30.33318;120.201526,30.334046;120.201571,30.334645;120.202419,30.334654;120.202392,30.333236', '海辰·水岸晶座', '杭州市下城区康宁街136号', '杭州市', '0103000020E61000000100000006000000363E93FDF30C5E4090D959F44E553E4042E90B21E70C5E4068AED3484B553E40CCD24ECDE50C5E40105CE50984553E409C340D8AE60C5E4019C5724BAB553E40B345D26EF40C5E40C07971E2AB553E40363E93FDF30C5E4090D959F44E553E40', '11111.383266', '120.20198,30.333939', '商务住宅;住宅区;住宅小区', '地上13个，地下110个', '2', '23896平方米', '16928', '海辰·水岸晶座位于下城区华丰板块,华丰板块早在上个世纪中后期就开始启动城市化进程,是“杭州老的新区”;在极富计划性和前瞻性的规划下,未来配套日臻完善,成为“杭州成熟的新区”指日可待。华丰板块是杭州城东北板块中接轨杭州主城为紧密的区块,有机衔接运河板块与丁桥板块,这些新兴居住区与华丰板块呈现出联动发展态势。海辰·水岸晶座总建筑面积为23896平方米,其中商务公馆面积15400平方米,商铺面积3000平方米, 由三幢九层的商业办公楼和商业裙房组成。其中主楼三至九层为精装商务公馆,一至二层及裙房为商业用房,局部架空。单身商务公馆总户数261户;一楼商铺16间;二楼为大开间。其中一层层高为4.95m,二层层高为4.95m,标准层层高为4.79m,主力户型为50多㎡和70多㎡户型。注重神形兼备,将人性特征与美学感受融入建筑空间海辰·水岸晶座对建筑外立面进行了精心设计,使得建筑有较强的韵律感。且在建筑横向上设置了丰富的线脚角,这样有效改变了建筑立面的单调无趣,克服了给人视觉带来的不舒适感。通过在建筑山墙面设计构架和在建筑屋顶设计格栅活泼建筑的性格,使建筑具有很强的个性和可识别性。虚实对比、变化中求统一。采用现代设计手法处理诸多细节问题,如每层梁位置颜色处理,玻璃窗上的分隔,里面材质的分隔线条。通过这些表达了大楼典雅、宁静、现代的特殊气质。别人从入手,我们从生活感受着力住宅的本质,不是追求表面,而应是对主人生活的真心关照。好的设计,一定不会忽略居住者的内在感受。海辰·水岸晶座的室内设计上,想要营造的,不是大量国际的简单堆砌,而是更注重整体的视觉感受和居住品质,体现居住者的生活价值:楼层的科学高度,户型设计等细节的关怀,让房子尽可能地符合人们的生活习惯和行为方式,从而更好地提供一种称心的生活方式。海辰·水岸晶座,却从建筑、户型到精装修,产品全程打造,力争在建筑、户型、配套等方面都达到超越其地段价值的程度。', '2010-05-01', '3.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BQTT', '330100', '120.119007,30.366983;120.119228,30.366953;120.119511,30.366876;120.120601,30.366752;120.120632,30.365995;120.12071,30.365536;120.120913,30.364669;120.120907,30.364398;120.118759,30.364395;120.118582,30.364451;120.118441,30.364599;120.118429,30.366912;120.118758,30.366976;120.119007,30.366983', '赞成美树', '杭州市余杭区良渚镇运河村金恒路174号', '杭州市', '', '51591.864007', '120.119571,30.365612', '商务住宅;住宅区;住宅小区', '约800个', '2.4', '128835平方米', '20857', '赞成美树位于杭州城北上塘路高架巨州路下桥口西侧,尽享桥西配套、运河繁华。美树花园交通极为便捷,经上塘高架,5分钟就可达大关欧尚超市,15分钟即可到武林广场。项目东临巨州路,南达拱墅区桥西生活圈,规划中的北城广场商贸综合体提供了生活配套。北达杭州市农副产品物流中心,家居生活近在咫尺。项目西侧规划有金恒德幼儿园,南面有文澜中学、卖鱼桥小学分校和杭州市第二人民医院等教育医疗设施。赞成美树总用地面积5万多平方米,容积率2.4,总建筑面积约13万平方米,总居住户数近1200户。项目规划为7幢12到16层的景观小高层、3幢31到32层的舒适高层公寓。赞成美树力求户型设计新典范,在90方、120方、130方等多种选择的同时,也创造性地为购房者设计了超值而舒适的家园。1号楼、2号楼的90方三房两厅一厨一卫小户性,三房全部朝南,且最大面宽近9米,充分保证了阳光的充足。4号楼130方五房两厅一厨三卫超值公寓空中“别墅”,每户设计了上下两层,且两层总层高达到5米多,客厅层高为4米。在美树户型设计中,每个户型都有不计入建筑面积的露台或飘窗赠送,提高了住宅的使用率。', '2010-09-30', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BRAO', '330100', '120.046922,30.374744;120.047223,30.376597;120.047258,30.376663;120.047322,30.376703;120.047404,30.3767;120.04864,30.376548;120.048337,30.37471;120.047689,30.374736;120.046977,30.374683;120.046922,30.374744', '书林苑', '杭州市余杭区良渚镇东西大道', '杭州市', '', '24799.496052', '120.047773,30.375674', '商务住宅;住宅区;住宅小区', '', '1.6', '29000平方米', '', '小区环境好配套齐全', '2006-12-12', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BS50', '330100', '120.083207,30.309958;120.083457,30.308592;120.084473,30.308758;120.084428,30.308985;120.08414,30.30893;120.083969,30.309809;120.084256,30.30986;120.084208,30.310092;120.083207,30.309958', '丹阳', '杭州市西湖区迪臣中路与迪臣路交叉口东北100米', '杭州市', '', '10375.172231', '120.083752,30.309337', '商务住宅;住宅区;宿舍', '', '', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSGL', '330100', '120.134188,30.328743;120.136846,30.328945;120.136736,30.329222;120.136656,30.329493;120.136557,30.32985;120.136436,30.330091;120.136359,30.330314;120.136303,30.330454;120.13627,30.330602;120.136256,30.330616;120.136223,30.33062;120.134145,30.330327;120.134188,30.328743', '西岸花园', '杭州市拱墅区昼锦街12号', '杭州市', '', '36147.172734', '120.135383,30.329632', '商务住宅;住宅区;住宅小区', '640个(1：0.7)', '2.3', '130000平方米', '40375', '南北.西岸比邻拱宸桥,连接市中心的交通非常便捷,是老城区桥西板块中具有一线运河河景的高档楼盘,拥有运河、红旗河双水岸,运河公园、石祥公园双公园等优美的景观资源。项目总总建筑面积逾13万平方米,物业类型有排屋、小高层、高层,总户数998户。项目呈半岛状,两河从东北两方向尊贵拱护。充分体现运河文化,利用地面河道景观,融运河人文环境与自然生态于一体。两幢18层的单元式高层住宅沿北侧布置,中心区域为四幢点式高层,沿运河为排屋和小高层。南低北高,东低西高,点板结合;使小区成为一个疏密相间的住宅小区。东面京杭大运河及北面红旗河与建筑之间的开阔河流景观带,构筑了南北.西岸独有的黄金双水岸线。270度沿河视野为.西岸增添了一个不凡的亮点。南北.西岸南临公交中心站(规划中)、农贸市场(规划中),出行、生活极为方便。周边还有LOFT公园、北星公园、运河博物馆、运河文化广场、世纪联华超市、72班航母型九年制学校、文澜中学、市二医院和运河码头公园(规划中)等成熟配套,入则宁静、出则繁华。南北.西岸的高层、小高层公寓以80-90平方米的“小三房”为主力户型,精致紧凑,适合三口之家;城市排屋紧邻运河公园和京杭大运河,基于运河的深厚历史文化底蕴和人文景观,是老城区极为罕见珍惜的高档物业。在建筑上,西岸追求传统与现代风格相结合,充分体现运河文化,小区的建筑成为运河景观的有机部分。建筑立面追求光影效果,有机分段处理,整体形象简洁而又不失细部。中国式简洁的白墙、青砖和涂料-----简练到极致的建筑元素,将浪漫情怀、人居理想通通融入西岸的空间模式之中。以一种超越居住、生活自身的审美意趣,创造一个身与心均闲适悠然的所在。在内部空间上,西岸户型空间层次错落,将“生态、健康、舒适”等现代观念融入社区的建设之中,每一处户型皆体验了通透舒畅的设计理念。整体气质现代、简洁。布局设计精巧,内部空间灵活,赋予变化,可使人有迤俪不尽之感,景外有景,壶中田地自是变宽了。设计大师倾情打造79-140平米感性空间,大开间、小进深的标准的设计,空间方正实用,布局合理,通风对流。“四明”空间设计,采光充裕、户户有景,并强调内部空间设计的参与性,您可根据需要灵活分隔空间。与运河相伴,与公园为邻。南北-西岸整体规划秉承千年运河文脉,现代人居风格融合运河风景,致力打造运河边珍藏版人文社区。', '2010-05-09', '1.44元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSO7', '330100', '120.205121,30.337668;120.205128,30.337028;120.202863,30.337056;120.202864,30.337671;120.205121,30.337668', '华润·翠庭', '杭州市下城区太公街112号', '杭州市', '0103000020E6100000010000000500000043AED4B3200D5E40DEE7F86871563E409CDF30D1200D5E4017D68D7747563E4061A417B5FB0C5E40ABEB504D49563E404A6249B9FB0C5E40C0CE4D9B71563E4043AED4B3200D5E40DEE7F86871563E40', '12912.097828', '120.204001,30.337356', '商务住宅;住宅区;住宅小区', '一层8万元/位，二层12万元/位。只售不租。', '2', '50000平方米', '29012', '华润翠庭地处杭州下城区华丰板块,总建筑面积约5万㎡,由7幢小高层组成,最高为9层。华润翠庭依靠贯穿南北的上塘中河高架、秋石高架快速路、留石高架快速路、石大快速路构建起井字交通线,同时以规划中的地铁三号线和即将通车的快速公交B3线深入繁华腹地,无缝对接城市生活,另有多路公交车均可快速融入城市中心。高架快速路、地铁、10余条公交线路、快速公交B3线等共同围合成华润翠庭的立体交通网,20分钟即可直达武林广场。在户型设计上,华润翠庭有89-130㎡的不同户型,充分保证各层次的多样性选择。', '2010-06-05', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BSO9', '330100', '120.202885,30.334876;120.202816,30.334949;120.20279,30.335063;120.202807,30.336672;120.202824,30.336777;120.202864,30.336845;120.202925,30.336894;120.203022,30.3369;120.204559,30.336892;120.204508,30.334969;120.202982,30.334873;120.202885,30.334876', '万泰·风华新语', '杭州市下城区华中路79号', '杭州市', '', '31124.674835', '120.203661,30.335908', '商务住宅;住宅区;住宅小区', '609个地下，其中：地下559 地面50', '2', '97258.85平方米', '28728', '万泰·新语位于杭州传统主城区东北部的华丰板块,距武林广场约10公里,项目以回归学院情怀为整体营造思想,总建筑面积约10万㎡,共10幢围合式高层公寓,同时拥有10000㎡学院派中庭景观,15个主题情境园林,超大规模的景观群落重现心灵放飞的年代,整体风格清新而古典。    万泰·新语周边拥有学校、医院、公交总站、规划中的大型超市、现代娱乐基地等众多公建设施,规划地铁3号线近在咫尺,1500米范围内拥有多个城市综合体,生活的舒适性和成熟度早已构筑,十五分钟国际化的精雅生活配套,重塑学院醇熟理性生活理想。    增长板块——凝聚城市光辉,华丰板块潜力无限    华丰,下城区唯一的权重板块,早在上个世纪中后期就启动了工业化、城市化进程,新型居住区和现代金融、商业正逐步取代工业,生态居住、绿色消费已成为现实,华丰板块正在迅速地融入“一核三圈三带四街区六组团”的政府规划。区域交通便利、配套成熟、生活氛围浓厚。德胜、秋石、留石、中河、上塘四条快速路构成井字路网。地铁、快速公交,多维立体交通快速融入市中心。届时,从万泰·新语到武林广场仅需20分钟。    成熟配套——15分钟国际配套圈,毫无缺撼的完美    万泰·新语周边生活、娱乐休闲配套十分丰富,600米范围内,农贸市场、超市、公交首末站、银行、酒店、医院一应俱全。1500米范围内,还有即将开业的大润发超市、21万方华丰城市综合体、现代文娱基地,及规划建设中百万方都市综合体——杭州创新创业新天地。再加上城北体育公园、城北森林公园,居住的舒适度与成熟度已然构筑。    项目周边教育配套完善,下城北区域内初步建设的,包括知名的安吉路幼儿园桦枫居分园、青蓝小学青华校区、风帆中学华丰校区等优质教育资源在内的,2所幼儿园、2所小学和1所中学,已陆续建成,其中风帆中学华丰校区即在项目隔壁。    完美建筑——新学院意向建筑,交融理智与情感    万泰·新语小区采用新学院派建筑特色,以简洁直线条勾勒出极富艺术特质的建筑立面。10幢高层建筑围合万余方中庭花园,形成开放邻里尺度,共享社区空间。建筑单体充分吸收学院建筑精髓,通过面砖色彩的自然搭配和露台、飘窗所形成的立面变化,使得建筑外观更加层次分明,丰富多彩,具有温和的建筑特性和浓重的文化气息。    小区整体采用围合式布局方式,商业街的开放要求和小区内部的私密性均得到满足,严格把握“城市-建筑-生活”之间的合理尺度。围合形成的超大中庭花园,也将中国传统建筑的院落文化得以实现,体现高档社区的私密感和空间感,同时实现了高层建筑间的最大化视线。小区南北最大楼间距达到了160米,实现社区内部充足的光照面,打造惬意的阳光社区空间。    精致园林——10000㎡学院情境园林,多色彩交融雪月风花    万泰·新语,传承艺术庭院设计精髓,万余平方米中庭景观以文化典故为创作源头,通过动、静双方面需求进行功能布局,打造多层次立体景观,使之成为一个充满艺术感、自然感、健康感的现代园区,“人-景观-建筑-城市”完美交融。社区内多景点的主题文化广场烘托出浓郁的文化氛围和艺术气息,学院气质在眼底晕染。    树木掩映中的林荫大道、树影斑驳中的幽雅小径、各式经典雕塑……校园里曾经随处可见的经典元素都将在万泰&#8226;新语中呈现。小区沿景观带建筑均采用局部架空处理,以文化典故作为创思源泉,以雕塑、文化墙、景观小品的表现,并通过木栈道、文化石、沙池、廊架等,精心营造兼具文化和休闲功能的公共邻里空间。在园林布局中,通过下沉式庭院等多层次空间的塑造,引入音乐书吧、健身、运动、保健、教育等功能区间,以及阅读角、音乐隅、篮球场、漫步跑道等校园生活特色的生活场景,精心构筑健康、文化、亲子三主题休闲天地,让您走出私人居所,依然享受生活的乐趣。    信步在树林的小径,在架空层或下沉式庭院中悠闲地品味着自制的咖啡,享受着阳光下的那一份惬意、舒坦,属于万泰&#8226;新语建筑的智慧,创造着让你意想不到的惊喜。', '2013-08-31', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BTN7', '330100', '120.10582,30.262878;120.105348,30.262627;120.104424,30.263304;120.105385,30.264429;120.106486,30.263505;120.106582,30.263267;120.106307,30.263231;120.10582,30.262878', '华元·天鹅堡', '杭州市西湖区西溪路539号', '杭州市', '0103000020E61000000100000008000000D0D03FC1C5065E4080D6FCF84B433E40BDAC8905BE065E40ED0BE8853B433E40B83A00E2AE065E40EFE714E467433E404B1FBAA0BE065E402E1D739EB1433E40D7DEA7AAD0065E401D554D1075433E40E8154F3DD2065E40B41D537765433E407F15E0BBCD065E401B4B581B63433E40D0D03FC1C5065E4080D6FCF84B433E40', '18094.116309', '120.105473,30.263466', '商务住宅;住宅区;住宅小区', '批准车位总数量300个、其中地下车位273个、', '1.7', '53362平方米', '24564', '项目介绍:华元天鹅堡位于人文景关优越的西湖区,南侧隔老和山与西湖为邻,北至西溪路,西侧是拥有中国湿地第一园美誉的西溪湿地景区,周边市政配套设施成熟完善,华元天鹅堡以新加坡raffles hotel为蓝图,占地面积18485平方米,总建筑面积约为31000平方米,以法式兼职和法式皇家景观园林为特色的精装修法派SOHO。<br />', '2010-07-24', '7元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BTVD', '330100', '120.157495,30.184951;120.156733,30.184834;120.156536,30.184806;120.155968,30.184683;120.155889,30.184925;120.155677,30.185723;120.156158,30.185811;120.157038,30.185946;120.158135,30.186132;120.158916,30.186305;120.159005,30.18519;120.157495,30.184951', '钱塘景苑', '杭州市滨江区伟业路399号', '杭州市', '', '30969.481855', '120.157396,30.18548', '商务住宅;住宅区;住宅小区', '', 'None', '', '28431', '钱塘景苑位于滨江区滨盛路与伟业路交叉路口,小区对面是彩虹城,前面是联庄,周边有动漫之都、元天科技、信雅达、创新大厦、龙禧、华荣、诺基亚、西门子、恒生、三维通信等等众多软件和电子通信单位。居住环境安静,交通方便快捷,生活配套一应俱全,方便居民的日常生活。创造具有城市文化和精神自由的、开放的、生态的、恬静的生活空间。体现“自然、和谐、舒适”的主题。', '', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BU7R', '330100', '120.067948,30.254549;120.068275,30.253991;120.067593,30.2537;120.067179,30.254188;120.066417,30.253835;120.06603,30.254533;120.066414,30.254709;120.066122,30.255331;120.068364,30.256434;120.069171,30.255191;120.067948,30.254549', '留庄', '杭州市西湖区天目山路389号', '杭州市', '', '42745.768567', '120.067543,30.255039', '商务住宅;住宅区;住宅小区', '', '1.17', '78000平方米', '24780', '留庄作为高级公寓的建筑类型开发,以丰富的建筑形态和空间形态、极具差异性的户型设计、完备的功能空间来营造官邸式的家居生活。生活与大自然紧密结合,完全融入到这西溪湿地公园的生态环境当中。建筑单体:与自然美景相得益彰的沉稳华美留庄的建筑单体造型沉稳华美,浅米色石材外墙、坡屋顶构造、正南正北的朝向、廊与柱的结合、私家花园的设计、高级VIP式会所的设置将留庄以官邸为蓝本的设计意图表现。每个户型,无论候客厅、起居室、餐厅、书房还是走廊都宽敞气派而又相对私密,满足主人生活、社交需要的同时,恰如其分地表达出主人的身份尊宠感。室内设计:深具古典美的新帕拉蒂奥风格为更好地吻合目标客户的审美取向,留庄在引入市场上罕见的帕拉蒂奥风格的同时,又融入东方元素的设计与现代工艺,力求使之呈现出中西合璧、优雅瑰丽的设计效果。', '2007-09-30', '8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BUJJ', '330100', '120.196415,30.180999;120.196555,30.178363;120.193443,30.178507;120.193378,30.181295;120.196383,30.181366;120.196415,30.180999', '南岸晶都花园', '杭州市滨江区平安路72号', '杭州市', '0103000020E61000000100000006000000685C3810920C5E40D49B51F3552E3E4061376C5B940C5E4003D19332A92D3E40F8A8BF5E610C5E40691B7FA2B22D3E4004711E4E600C5E40A6ED5F59692E3E40629F008A910C5E40399B8E006E2E3E40685C3810920C5E40D49B51F3552E3E40', '80709.519185', '120.194962,30.179875', '商务住宅;住宅区;住宅小区', '1000', '2.4', '27平方米', '29005', '华业南岸晶都座落于杭州市滨江区滨康路和长河路交叉口,总建筑面积约27万方,由20幢高层和小高层、沿街商铺等组成。项目位居滨江区中心区位,东西滨江区行政中心和高新区公建中心的高尚规划配套均在其服务半径内,南面紧邻滨江区长河街道的成熟配套疔就近享受银行、邮局、农贸市场、医院等众多生活配套,尤其是省重点中学——杭州长河高级中学、杭州长河中学、长河中心小学、博文小学、长河街道幼儿园,等众多教育配套簇拥环伺,让孩子赢在起跑线上。  华业南岸晶都社区以“亲睦人文社区”为主题,拥有三大亲睦景观,多个温情庭院,多项亲子设施,曲曲蜿蜒的景观水系、30米宽城市公共景观绿化带,还有社区服务型商街,以适用但不失舒适的尺度全力为您和您的家人打造一片欢快、健康、舒适的居住新天地。  华业南岸晶都特聘浙江绿城物业管理有限公司担任项目的物业管理,为业主营造五星级品质现代社区。    华业南岸晶都座落于杭州市滨江区滨康路和长河路交叉口,总建筑面积约27万方,由20幢高层和小高层、沿街商铺等组成。项目位居滨江区中心区位,东西滨江区行政中心和高新区公建中心的高尚规划配套均在其服务半径内,南面紧邻滨江区长河街道的成熟配套疔就近享受银行、邮局、农贸市场、医院等众多生活配套,尤其是省重点中学——杭州长河高级中学、杭州长河中学、长河中心小学、博文小学、长河街道幼儿园,等众多教育配套簇拥环伺,让孩子赢在起跑线上。  华业南岸晶都社区以“亲睦人文社区”为主题,拥有三大亲睦景观,多个温情庭院,多项亲子设施,曲曲蜿蜒的景观水系、30米宽城市公共景观绿化带,还有社区服务型商街,以适用但不失舒适的尺度全力为您和您的家人打造一片欢快、健康、舒适的居住新天地。  华业南岸晶都特聘浙江绿城物业管理有限公司担任项目的物业管理,为业主营造五星级品质现代社区。', '2005-06-07', '1.58元/月/平方米');
