INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXWQ', '330100', '120.201274,30.335001;120.200379,30.33498;120.200317,30.337116;120.198544,30.337104;120.198534,30.336153;120.198462,30.336118;120.197656,30.336134;120.197593,30.336165;120.197585,30.336277;120.197585,30.33705;120.197615,30.338219;120.197651,30.339334;120.197675,30.339951;120.201108,30.339937;120.201274,30.335001', '华丰南苑', '杭州市下城区华丰路', '杭州市', '', '116710.800324', '120.199499,30.338013', '商务住宅;住宅区;住宅小区', '', '1.7', '', '', '华丰南苑位于下城区石桥街道,紧邻杭州装饰城和省五金市场。附近有天堂工业园区,省肿瘤医院,杭钢股份集团等知名企业。交通便利。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXX0', '330100', '120.096273,30.269824;120.096146,30.2699;120.096107,30.270073;120.095993,30.271173;120.096228,30.271204;120.096591,30.271287;120.098652,30.272246;120.10003,30.272874;120.100062,30.272882;120.100094,30.272878;120.100122,30.272876;120.10015,30.272863;120.100303,30.270629;120.096273,30.269824', '嘉绿景苑东西苑', '杭州市西湖区文新莲花街264号', '杭州市', '', '68680.830003', '120.098346,30.271166', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '嘉绿景苑是城西新的一个居住社区,总户数达到7000多户,分为东园、西园、南园三个区块,全部是从龙井、杨公堤等景区拆迁回迁的安置房,周边配套齐便。项目位于西湖区古墩路与莲花街交叉口,63路、179路、290路、310路、900路公交可达,交通便利。小区建成于2007年,建筑面积380000平方米,占地面积10000平方米,总户数7800户,绿化率30%,容积率3.20。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXYX', '330100', '120.046107,30.37012;120.047982,30.370187;120.048011,30.369201;120.046177,30.369095;120.046107,30.37012', '良渚十六街区', '杭州市余杭区良渚,东临东西大道(新104国道)紧邻二号干道', '杭州市', '0103000020E610000001000000050000007847C66AF3025E4074982F2FC05E3E40FD32182312035E4084674293C45E3E404AB6BA9C12035E4087A6ECF4835E3E40F4346090F4025E40FC1D8A027D5E3E407847C66AF3025E4074982F2FC05E3E40', '17009.899669', '120.047063,30.369652', '商务住宅;住宅区;住宅小区', '地上停车位76个、地下停车位64个', '2', '240000平方米', '', '良渚.十六街区位于“良渚文化”发祥地——良渚的商贸区中心地段。东临东西大道(新104国道),紧邻二号干道,北依独具休闲特色的良渚中心文化广场,西向即为规划中的综合医院。良渚·十六街区由12幢富具文化内涵的小高层、多层组成,总建筑面积约48000平方米。底层及商铺地下室空间将引进休闲娱乐设施和各类品牌店,全力打造良渚的商业中心;40年产权商品房为积极创造生活的人们倾心构建纯生活自主新地。良渚.十六街区融合商业服务与生活休闲于一体,配套齐全,满足各类人群的生活需求,全方位打造新良渚休闲生活街区。商业区为沿街空间,良渚.十六街区延续良渚文化广场中心轴线,通过连接中心广场的下沉广场将人流自然的引入半地下室的大型超市及品牌店,而地面通过各种不同的台阶、踏步、坡道引导人流。不同空间的围合将商业与居住空间巧妙分离,让商业空间热闹欢庆,一片繁荣景象。而居住空间则幽静休闲,更添古典情致。', '2006-07-02', '2.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXZG', '330100', '120.197572,30.173357;120.19849,30.173311;120.198581,30.17321;120.19859,30.172236;120.198251,30.172188;120.198063,30.172315;120.197681,30.172734;120.197613,30.172975;120.197523,30.173112;120.197489,30.173298;120.197572,30.173357', '朗庭', '杭州市滨江区滨文路115号', '杭州市', '', '8587.008168', '120.19813,30.172845', '商务住宅;住宅区;住宅小区', '', 'None', '', '11024', '朗庭位于联盟西路与友谊大街交叉口西行(水上公园西北角),阳光板式高层、咖啡色时尚立面、现代简约流线设计、易商易住SOHO空间、畅想40万平米水上公园、质感景观户型。', '', '1元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BXZM', '330100', '120.112546,30.337993;120.112543,30.338092;120.112592,30.338175;120.112667,30.338229;120.112879,30.338279;120.113888,30.338349;120.113947,30.337755;120.112623,30.337679;120.112546,30.337993', '香槟之约', '杭州市拱墅区祥运路8号', '杭州市', '', '7122.804446', '120.113256,30.338006', '商务住宅;住宅区;住宅小区', '0.5', '2.5', '45000平方米', '12649', '景园香槟之约位于拱墅区祥符镇祥园路,毗邻杭州汽车城,位于欧尚、欧倍德、建设中的南北商务港物流金三角辐射区,依托一园三点(祥符园区、康桥园区和上塘园区)的拱墅科技经济园区,集合“汽车拱墅、物流拱墅、居住拱墅、文化拱墅”的品牌亮点,属杭城城市总体规划中“北秀”之核心区块,交通便利,汽车北站近在咫尺。景园香槟之约总建筑面积约43000余平方米,以“居住+商务”的综合设计,容纳“财富街区”与“MINI空间”两种物业形态。财富街区由两座5层楼宇组成,一二层为大开间商铺,三四五层为综合办公楼,主要针对拱墅科技经济园区一些对办公有特殊需求的企业。MINI空间由两幢11层点式、一幢13层板式公寓组合而成,户型面积从30多平方米到200多平方米不等,能满足不同层面购房者的需求。', '2006-01-03', '0.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY1T', '330100', '120.191887,30.257417;120.191924,30.257086;120.191957,30.256673;120.192704,30.256688;120.192684,30.256208;120.191415,30.256168;120.191365,30.256613;120.190764,30.256604;120.190731,30.257037;120.190716,30.257443;120.191887,30.257417', '建电新村', '杭州市江干区庆春东路111-139号', '杭州市', '', '14377.56206', '120.191606,30.256791', '商务住宅;住宅区;住宅小区', '', '2', '123456平方米', '40148', '小区环境好,阳光充足,学区房,周边配套齐全。', '', '0.50元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY26', '330100', '120.200611,30.234115;120.200588,30.234041;120.200403,30.234045;120.200313,30.233964;120.19891,30.235258;120.1996,30.235833;120.200909,30.234707;120.20093,30.234524;120.201022,30.23422;120.201068,30.234097;120.200611,30.234115', '耀江福村', '杭州市上城区衢江路与富春路交叉口钱丰酒店后面', '杭州市', '', '16995.838376', '120.200023,30.234861', '商务住宅;住宅区;住宅小区', '', 'None', '112000平方米', '37993', '耀江福村由杭州城建开发有限公司 开发,2000年竣工,耀江福村物业类型是多层住宅,小区开盘时间在1998年, 就在钱塘江边上,属于钱江新城的房子 耀江福村位于富春路与衢江路交叉口。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY2P', '330100', '120.136341,30.326083;120.136242,30.32608;120.135541,30.326076;120.135384,30.326763;120.135334,30.326919;120.135263,30.326998;120.135132,30.327064;120.134132,30.327043;120.134149,30.327797;120.13595,30.327904;120.136103,30.32727;120.136226,30.326656;120.136368,30.326099;120.136341,30.326083', '信步闲庭', '杭州市拱墅区小河路697号', '杭州市', '', '21315.15335', '120.135367,30.327142', '商务住宅;住宅区;住宅小区', '0.8', '2.7', '54447平方米', '39569', '信步闲庭,城北桥西首发楼盘,她既拥有老城的古朴又具有新城的妩媚,她秉承城北的历史文明,又蓄势待发开创桥西的美好未来。信步闲庭位于拱墅区拱宸桥和京杭大运河西畔,东临小河路和规划中运河客运码头,周边环境优美,交通便利。信步闲庭由1幢小高层、6幢高层和部分商业配套围合而成,建筑和绿化园林相呼应,形成人景互动、情味交融的社区环境,筑就了精致、闲适、悠然的双景观休闲社区。信步闲庭在户型设计上遵循人性化设计理念,合理使用空间结构,创造出精致多样的各种户型,并根据每幢楼的不同特点,对不同户型进行特定的取景设计,使每户均有良好的采光通风和景观视野。其主力户型在90——130方之间,户型经济舒适,适合市场的需求。把居室、餐厅、厨房的功能发挥到极致,追求在有限的空间里创造完美的居住空间。让每一个空间都散发着家的芳香,让您感受到的是深入骨髓的幸福。', '2006-12-31', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY49', '330100', '120.205629,30.254305;120.206785,30.254871;120.206297,30.25541;120.205935,30.255831;120.205872,30.255917;120.205784,30.256057;120.205993,30.256254;120.206242,30.256506;120.206582,30.256828;120.206941,30.257171;120.207522,30.256717;120.207591,30.256047;120.207609,30.255224;120.207527,30.25503;120.207272,30.254809;120.20705,30.254683;120.207247,30.254458;120.206953,30.254369;120.205977,30.253951;120.205629,30.254305', '采荷人家', '杭州市江干区杭海路265-267号', '杭州市', '', '31601.257079', '120.20679,30.255628', '商务住宅;住宅区;住宅小区', '', 'None', '', '43441', '采荷人家,地处杭州采荷生活圈,北靠庆春路、江干区人民政府、东临钱江新城,为采荷生活圈中之大型项目。总用地近6.4万平方米,总建筑面积12.7万平方米,总绿地面积约15000平方米,绿地率30%以上。一期为24层商住楼,于2004年交付;二期由五幢高层和三幢小高层住宅组成;三期为即将开发的大型商场、写字楼项目。物业类型:住宅,公寓建筑类别:板塔结合所在区域:江干采荷楼盘地址:江干区杭海路265-267[地图]容积率:2.10[容积率]绿化率:30%[绿化率]建筑年代:2004-01-01楼层状况:多层、小高层、高层物业费:1.35元/平米·月车位信息:约300个车位物业公司:宋都物业开发商:杭州宋都房地产集团有限公司占地面积:暂无资料建筑面积:暂无资料公交:21路、32路、858路、525路、518路、818路、k202路地铁:富春路站(1号线)', '2004-04-30', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY4J', '330100', '120.221999,30.257432;120.221498,30.256821;120.220908,30.256209;120.220531,30.256535;120.220311,30.256727;120.220113,30.256919;120.219405,30.257264;120.219347,30.25733;120.219288,30.257325;120.218826,30.25682;120.218398,30.257118;120.217056,30.258061;120.217005,30.258123;120.217118,30.258241;120.217766,30.258645;120.218755,30.259275;120.219423,30.259725;120.219497,30.259683;120.221662,30.257724;120.221999,30.257432', '金基晓庐', '杭州市江干区钱潮路68号', '杭州市', '', '76153.287365', '120.219595,30.257964', '商务住宅;住宅区;住宅小区', '1500个', '3', '78234平方米', '52216', '金基晓庐位于杭州CBD钱江新城的核心地段,临近钱塘江与京杭大运河交会口,地处钱江路以南,椒江路以东,富春江路以北,和江干文体中心隔路相望。户型主力面积在110-170平方米之间,140平方米以下的户型约占80%。晓庐的户型设计引入空中花园、错阳台、双主卧、小复式、底层Townhouse、顶层空中别墅等创新元素或户型。', '2007-10-31', '1.94元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0BY58', '330100', '120.123363,30.27653;120.122605,30.276495;120.122523,30.276647;120.122439,30.276797;120.122364,30.276942;120.122329,30.277075;120.12224,30.278115;120.12232,30.278151;120.122686,30.278132;120.122902,30.277982;120.122955,30.277915;120.123012,30.277837;120.123203,30.277343;120.123356,30.276796;120.123387,30.276607;120.123363,30.27653', '天苑花园', '杭州市西湖区文3路498号', '杭州市', '', '12249.792763', '120.122767,30.277276', '商务住宅;住宅区;住宅小区', '', 'None', '', '28155', '天苑花园建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.7元/月/平方米');
