INSERT INTO "public"."gaode_residential_region" VALUES ('B023B0I07F', '330100', '120.237162,30.357989;120.237083,30.357924;120.236704,30.358016;120.236514,30.358038;120.234986,30.358624;120.235492,30.359865;120.235716,30.359997;120.237301,30.359503;120.237628,30.359375;120.237939,30.359226;120.238146,30.359064;120.237839,30.358673;120.237162,30.357989', '天阳·观筑', '杭州市江干区丁桥勤丰路(勤丰路与环丁支路交汇处)', '杭州市', '', '36051.756173', '120.236487,30.358946', '商务住宅;住宅区;住宅小区', '512个，配比1：0.55', '2.2', '120000平方米', '25957', '丁桥将建设2所中学、4所小学、7所幼儿园、和1所市级医院,规划建设净菜超市三座,垃圾中转站,公交首末站、公交中心各一座,文化、商场、公园等基础设施也将同步建设,水、电、污水、燃气、通信等市政管线配套设施,以及居住配套中心部分都将建成并投入运营。', '2010-05-03', '1.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13FUJ', '330100', '120.089474,30.326077;120.089444,30.32611;120.089005,30.325968;120.088806,30.326379;120.089473,30.326592;120.089658,30.326145;120.089474,30.326077', '美都公寓', '杭州市西湖区三墩灯彩街25号', '杭州市', '0103000020E61000000100000007000000E8F527F1B9055E4051FA42C879533E40B3B45373B9055E4008E6E8F17B533E408D0B0742B2055E40E38A8BA372533E40126C5CFFAE055E40E719FB928D533E400038F6ECB9055E409F2287889B533E40C974E8F4BC055E4001C11C3D7E533E40E8F527F1B9055E4051FA42C879533E40', '2886.200814', '120.089239,30.326276', '商务住宅;住宅区;住宅小区', '', 'None', '5455平方米', '', '美都公寓项目位于西湖区三墩镇古墩路与环镇北路交叉口,紧邻新世纪花苑,小区周边生活条件成熟、配套设施齐全、交通便利。  美都公寓提供83—89平方米中小套型的小高层电梯公寓60多套,户型设计以人为本,处处从客户角度出发,融入现代设计理念,户型结构合理紧凑,在积极响应“国六条”政策的同时,满足了普通消费者的需求。', '2006-11-28', '0.9元/月/平方米');
