INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13KGG', '330100', '120.193323,30.178013;120.193277,30.177725;120.193331,30.177735;120.193435,30.177742;120.193437,30.177474;120.19338,30.177473;120.193359,30.177096;120.191303,30.17717;120.191303,30.177547;120.191229,30.177545;120.191164,30.178093;120.190695,30.178009;120.190452,30.17796;120.190302,30.178607;120.19326,30.178452;120.193331,30.178381;120.193336,30.178249;120.193323,30.178013', '长兴苑小区', '杭州市滨江区平安路', '杭州市', '', '30665.830753', '120.192079,30.177888', '商务住宅;住宅区;住宅小区', '1:1', 'None', '20000平方米', '15844', '位于滨江板块,共享巨大的江景资源,远眺钱塘的宏伟气势,别为一样的心情。小区中精致的庭院绿化的设计使人充分的享受着房屋前后的绿色生态的居住环境,是一种工作之余轻松的享受。', '2006-08-14', '');
