INSERT INTO "public"."gaode_residential_region" VALUES ('B023B13ZI0', '330100', '120.170338,30.37972;120.170054,30.379435;120.169365,30.37954;120.168857,30.379662;120.16816,30.379758;120.168186,30.382599;120.169512,30.382631;120.169865,30.382631;120.170786,30.382741;120.171456,30.382843;120.172446,30.383014;120.17255,30.382979;120.172619,30.382763;120.17261,30.382452;120.172394,30.381978;120.17168,30.381236;120.171096,30.380608;120.170338,30.37972', '锦昌年华', '杭州市余杭区崇贤镇向阳村崇杭街(徐家浜站和向阳村站旁边)', '杭州市', '', '97802.23941', '120.170043,30.381371', '商务住宅;住宅区;住宅小区', '约1000余个', '约2.0', '280000平方米', '21219', '锦昌年华,锦昌文华升级版,位于杭州半山新区,绕城北线内,距武林商业中心约15公里。总建筑面积约28万M2,由多层洋房、小高层、高层公寓三种产品构成,典雅的学院派建筑风格,配合屋面保温系统、墙体保温技术、断桥隔热双层中空玻璃门窗,构成3维节能体系。园区东依天然清水岸,园内由中央水景花园、宅间庭院、下沉广场构成精致的庭院化景观体系,并将室外游泳池、健康步道、早锻炼场所等户外休闲场所融合于园景中,成就非凡品质。其户型运用入户花园、奇偶层错开挑高露台及大面积落地凸窗等不计面积部分,实现高得房率、高性价比、高弹性家居空间的设计,使之成为绕城内超高性价比楼盘,亦被都市快报所评为“2008十大期待楼盘”之一;其舒适实用的户型设计,还被中国房地产协会评为“2008中国最佳经典户型楼盘”。', '2012-08-11', '1.2元/月/平方米');
