INSERT INTO "public"."gaode_residential_region" VALUES ('B023B145NE', '330100', '120.160968,30.363991;120.159691,30.364345;120.158654,30.36464;120.158567,30.364344;120.158565,30.364109;120.158537,30.363874;120.158496,30.363706;120.158417,30.363562;120.158104,30.363623;120.158051,30.363456;120.158858,30.363238;120.158925,30.363418;120.15914,30.363376;120.160009,30.363135;120.160086,30.363162;120.160154,30.36328;120.160203,30.363394;120.16037,30.363864;120.16086,30.363728;120.160775,30.363498;120.161368,30.363364;120.161364,30.363158;120.163544,30.363001;120.163588,30.363227;120.162499,30.363298;120.161372,30.363371;120.160784,30.363503;120.160968,30.363991', '吴家墩南苑', '杭州市拱墅区康桥路27号', '杭州市', '', '25027.675785', '120.159973,30.363727', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1468P', '330100', '120.339749,30.194559;120.339148,30.192125;120.339105,30.191893;120.339153,30.191819;120.339234,30.191781;120.341454,30.191652;120.342627,30.191591;120.344292,30.191499;120.344335,30.191612;120.344676,30.192739;120.34499,30.193794;120.345054,30.194021;120.345046,30.194037;120.343158,30.194241;120.342023,30.194359;120.341803,30.194376;120.339749,30.194559', '东南花城名苑', '杭州市萧山区新街镇(机场路旁)', '杭州市', '', '130644.71724', '120.342013,30.192985', '商务住宅;住宅区;住宅小区', '1026个', '1.25', '180000平方米', '15259', '花城名苑,位于有花木之乡美誉的杭州萧山区新街镇,紧邻中国最大的花木培育基地浙江(中国)花木城,近千亩的奇花异草蔚为壮观,成为花城名苑永久的景观资源和宝贵的绿色财富,天天与绿色相伴,全日供应充沛新鲜的绿氧,让您尽可以大口呼吸。  花城名苑拥有的这片不可复制的绿色宝地,是繁华与宁静之间那个优美的连接符,更是生活与工作之间的黄金分割线。  如果说寸土寸金的市中心是黄金,那么这里就有如一块温润的绿宝石,同样的稀有罕见,却不带一丝浮躁,更适合居家和生活.  小区的整体规划确立“以人为本”的规划设计指导思想,把人与自然和谐放在首位。借助现代“生态建筑”的设计手法,结合中国传统园林文化思想,使小区居住与自然的风、水、阳光和绿化完美的结合在一起,实现“人地和谐”、“诗意栖居”的目标,提供一个优美、宁静的世外桃源。  建筑布局最大限度的考虑住户居住特点和健康要求,全部多层阳房,以在日照和公共空间之间取得最佳平衡,创造舒适、宜人、有亲切感、有文化品位的人居环境。  把更多的天空,留给眺望的眼睛;让最明亮的光线,照见心灵。', '2005-04-30', '2.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B149SQ', '330100', '120.092728,30.328582;120.092994,30.328018;120.090942,30.327339;120.090709,30.327309;120.090611,30.327373;120.090521,30.32748;120.090428,30.32771;120.090351,30.327977;120.090339,30.3281;120.090371,30.328271;120.090539,30.32845;120.091078,30.328845;120.091541,30.329058;120.09199,30.329204;120.092474,30.329316;120.092716,30.328652;120.092728,30.328582', '都市水乡水碧苑', '杭州市拱墅区灯彩街和长阳路交汇口', '杭州市', '', '29867.408739', '120.091618,30.328276', '商务住宅;住宅区;住宅小区', '', '2.1', '1368400平方米', '24447', '都市水乡临近三墩镇,位于五里河畔、三墩路北、古墩路东。项目东起丰庆路,南起留祥路,西至环镇东路、通济北路,北至余杭勾庄。小区地段好,交通便利,周边配套成熟完善,都市水乡有餐饮、超市、医院、学校、健身娱乐设施、充分满足一站式生活需求。小区的配套设施齐备,小区内设有幼儿园、小学、中学,超市就在家门口。项目建筑面积1368400平方米,占地面积1068400平方米,绿化率25%,容积率2.10。', '', '0.5-0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B149W5', '330100', '120.126477,30.337192;120.124477,30.337024;120.124432,30.337026;120.124391,30.337033;120.124352,30.337048;120.124318,30.337076;120.124301,30.337113;120.124416,30.337813;120.12461,30.338287;120.124745,30.338594;120.124821,30.338741;120.124834,30.33885;120.124857,30.33887;120.124878,30.338878;120.126707,30.338981;120.126792,30.338971;120.126865,30.338948;120.126942,30.338907;120.126987,30.338841;120.127275,30.337915;120.126541,30.337834;120.126593,30.337193;120.126477,30.337192', '方正·荷塘月色', '杭州市拱墅区祥园路221号', '杭州市', '', '39063.534793', '120.125712,30.338024', '商务住宅;住宅区;住宅小区', '900个（1：1）', '2.6', '137000平方米', '29886', '方正荷塘月色,地处杭州主城区桥西北部软件园、运河新城版块中心交汇点,祥园路与通益路交叉口,毗邻在建的25万方商业航母万达广场、13万方商业广场北城天地、周边有名校配套,距离武林广场仅8公里,更有欧尚超市、公交首末站(在建)、杭州市国际会展中心、运河文化广场近在咫尺,便享成熟生活配套。荷塘月色以艺术理念精心打造高端欧式现代社区。13万方简欧风格建筑,明快简洁的线条勾勒出细节丰富的整体造型,使外立面风格典雅大气;8幢23-25层高层住宅,1幢1500㎡艺术生活会馆,主力户型面积86-141㎡,为更高品位人群提供艺术、格调的居家生活。项目最大楼间距达100米,中央花园面积达1.5万方。万达广场步行圈,交付即享繁华:踞万达广场5分钟步行圈,作为桥西-北软板块最早交付的楼盘,2014年7月底全部完成交付,与万达广场开业时间接近,业主交付便可享受周边繁华配套。四大主题架空层:光“荷”作用:休闲主题架空层;运动天“塘”:运动主题架空层;时光“月”章:音乐主题架空层;七“色”天空:绘画主题架空层', '2012-12-15', '1.75元/月/平方米');
