INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14A0J', '330100', '120.238167,30.352723;120.236521,30.352014;120.235243,30.351525;120.235142,30.35152;120.235077,30.351548;120.235012,30.351636;120.234326,30.353152;120.23432,30.353237;120.234328,30.353291;120.234377,30.353344;120.234474,30.353368;120.237358,30.354359;120.23745,30.354352;120.237521,30.354299;120.238237,30.352897;120.238229,30.352804;120.238167,30.352723', '昆仑天籁', '杭州市江干区丁群路与长虹路交汇处东北角', '杭州市', '', '59776.359722', '120.236257,30.352963', '商务住宅;住宅区;住宅小区', '1287（1:1）', '2.2', '200000平方米', '21610', '昆仑天籁位于杭州丁桥,东至勤丰路,南至规划丁群路,西至长虹路,北至明珠路,宗地面积65824平方米(即98.8亩),呈不规则矩形,东西长南北短,整体南偏东约21度。使用权出让年限为住宅70年,配套商业40年。昆仑天籁项目占地面积65824平方米(即98.8亩),总建筑面积约20万方,容积率是2.2,绿化率30%,建筑密度28%,总户数1234户,抗震为6级。建筑形态是16层的高层为主,及少量低层建筑。层高约2.9米左右。昆仑天籁有2个机动车出入口,1个人行出入口,地下车库的出入口有3个,整个小区机动车位约为1200个左右。车位配比达1:1,可以电梯直达。', '2013-04-20', '2.35元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14A0V', '330100', '120.268606,30.324044;120.268038,30.324212;120.266945,30.325745;120.268397,30.326473;120.269087,30.326759;120.270326,30.324969;120.268606,30.324044', '九润公寓', '杭州市江干区九环路与九福路交叉口', '杭州市', '0103000020E610000001000000070000009A6038D730115E400C772E8CF4523E407505DB8827115E4083F8C08EFF523E402B357BA015115E40E5D5390664533E400C569C6A2D115E40EA060ABC93533E40D731AEB838115E4075AC527AA6533E408B506C054D115E40BD361B2B31533E409A6038D730115E400C772E8CF4523E40', '46993.107016', '120.26865,30.325361', '商务住宅;住宅区;住宅小区', '车位配比1：0.93', '2.2', '160000平方米', '23400', '郡原九润公寓位于杭州市九堡九华路与九福路交界处,西邻和睦港河,毗邻地铁一号线和客运中心有多路公交直达。项目建筑面积近15万平方米由12幢小高层共同组成四个独立的居住院落。郡原九润公寓在保证景观与建筑完整性的同时将建筑围合成为四个组团院落,形成了内外两个层次景观空间序列,有效地将社区内交通和景观元素结合在一起形成更为丰富的居住体验。 郡原九润公寓定位为高品位城市公寓, 将多种形态的城市公寓有机融合,以尊重及满足不同年龄段客户的多元化市场需求。郡原九润公寓户型以90-120平方米精致实用户型及130-160平方米舒适户型为主,同时引入复合式欧美城市公寓设计理念,规划了高附加值的舒适空间尺度。建筑风格以巴黎现代城市公寓为蓝本,赋予建筑立面丰富细腻的性格面设计,力求创造一个精致典雅、耐得住时间考验的住宅精品。', '2016-05-30', '2.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14BJY', '330100', '120.205923,30.339288;120.206085,30.33772;120.205232,30.337729;120.20518,30.340002;120.205735,30.340002;120.205864,30.339561;120.205923,30.339288', '亿城雅苑', '杭州市下城区华丰路145号', '杭州市', '0103000020E61000000100000007000000A19FA9D72D0D5E40DDEC0F94DB563E408ECC237F300D5E40833463D174563E40EE056685220D5E4029E9616875563E40C5724BAB210D5E401893FE5E0A573E40202922C32A0D5E401893FE5E0A573E401FDB32E02C0D5E403FFF3D78ED563E40A19FA9D72D0D5E40DDEC0F94DB563E40', '15441.141821', '120.205584,30.338797', '商务住宅;住宅区;住宅小区', '', '2', '100000平方米', '24781', '“亿城雅苑”位于下城区华丰村,紧邻润和R26;亿城嘉园项目,东至朱家河,南至下城区公安分局石桥派出所,西至规划道路,北至华丰路。项目周边属于华丰区块的中心地带,项目得益于北景园大型居住社区以及多个目前正在开发的楼盘,各项生活配套设施基本齐全;随着农改居以及道路建设的完善,连接主城区的道路具有较好的通行能力,交通条件得到进一步改善。 楼盘总用地面积17316平方米,总建筑面积45802.69平方米,绿化率在30%以上。该楼盘属于一次性开发。', '', '1.4元/月/平方米');
