INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FUH', '330100', '120.067113,30.328856;120.068459,30.330023;120.069565,30.32887;120.069607,30.328731;120.069457,30.328564;120.068411,30.327745;120.068245,30.327731;120.067113,30.328856', '丰盛九玺', '杭州市西湖区榨河巷与池华街交汇处', '杭州市', '0103000020E61000000100000008000000BC0853944B045E40E71725E82F543E407B87DBA161045E4085ED27637C543E408FFCC1C073045E40B1A206D330543E40A724EB7074045E406F2EFEB627543E409CDEC5FB71045E4098A432C51C543E40F2EB87D860045E40726DA818E7533E4065C746205E045E40A8E2C62DE6533E40BC0853944B045E40E71725E82F543E40', '27517.675801', '120.068391,30.328832', '商务住宅;住宅区;住宅小区', '停车位:规划有停车位301个 停车位售价暂时没有', '3.5', '105852平方米', '17300', '丰盛九玺位于三墩新城大型高档生活区核心,由85万方高端大盘之金地自在城三面围合,南邻40万方协安紫郡,12万方中海紫藤苑等高端社区,以九玺为中心的15分钟步行圈内集中了十余个高端社区。项目总建筑面积约25万方,拥有22000方超大双公园景观,是一个集合了420方奢华大平层、精装酒店式物业、高星级酒店、5A级写字楼、多业态稀缺性商业空间的大型高端物业,周边配套完善,商业氛围浓郁,交通出行便捷:外享185万方五里塘商务中心、日本永旺“吉之岛”购物中心、三墩新天地、沃尔玛超市、城西银泰等大型商业配套以及重点名校文三街教育集团;内拥项目内部沿街名品商业、高星级酒店配套;距规划中的地铁2号线金渡北路站西侧站点仅约800米,距金渡北路快速公交总站仅约200米,零距离交通配套,双线速享都市繁华。', '2016-05-11', '3.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FUP', '330100', '120.10057,30.330736;120.10366,30.332116;120.103671,30.33231;120.100919,30.335185;120.100726,30.335246;120.099519,30.334361;120.098676,30.333829;120.10057,30.330736', '阳光郡', '杭州市拱墅区莫干山路与广业街交汇处', '杭州市', '0103000020E610000001000000080000005C3D27BD6F065E40209C4F1DAB543E40D1798D5DA2065E40747ADE8D05553E40CBA2B08BA2065E403E22A64412553E40E222F77475065E40191C25AFCE553E40D7F6764B72065E40651D8EAED2553E402995F0845E065E40D00EB8AE98553E409B3924B550065E40D6743DD175553E405C3D27BD6F065E40209C4F1DAB543E40', '107538.241725', '120.101055,30.332948', '商务住宅;住宅区;住宅小区', '2184个', '2.6', '350741平方米', '28000', '阳光郡占地150亩,总建筑体量近36万方,体量恢弘巨大,规模居住效应明显。随着杭州主城区土地价值日益稀缺,大规模、成效应土地出让逐渐稀缺,杭州主城区一次性出让体量25万方以上的住宅项目凤毛麟角,更是体现出阳光郡作为主城区标杆性大盘的重要地位。    阳光郡,雄踞莫干山路杭州大动脉,扼守杭州主城区发展核心格局,东临城市主干道莫干山路直达西湖风景区,北接全线修通的长青路连通申花高档成熟生活区, 与地铁2号线站点仅1公里距离,出则繁华,入则静谧,交通条件十分优越。    阳光郡,多次深入深圳等南方一线优良户型重地,甄选海量户型,因地制宜,结合杭州市民的居住习惯,历经数次修改讨论,研磨出面积、功能、朝向等均好的户型,90方魔幻三房、110—140方舒适三房和华丽三房、160方以上豪华四房,为杭州主流家庭贴身打造。', '2017-09-21', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVH', '330100', '120.190742,30.256578;120.190916,30.25657;120.191254,30.256575;120.191344,30.256549;120.191365,30.256469;120.191406,30.256165;120.191436,30.256138;120.191488,30.25613;120.192617,30.256183;120.192664,30.256171;120.192707,30.256126;120.192767,30.255932;120.192781,30.255318;120.192127,30.255303;120.192117,30.255186;120.190314,30.255142;120.190318,30.255664;120.19028,30.255847;120.190191,30.256203;120.19018,30.256352;120.190152,30.256497;120.190123,30.25658;120.190242,30.256601;120.190742,30.256578', '滨江·凯旋门', '杭州市江干区凯旋路116号(近庆春东路)', '杭州市', '', '26138.363149', '120.191359,30.255802', '商务住宅;住宅区;住宅小区', '912个（地下）', '2.7', '158892平方米', '47217', '滨江凯旋门,北临庆春东路,西邻贴沙河,向东、西各三公里可直达钱塘江与西湖。总建筑面积约18万㎡,由3幢多层、1幢小高层、3幢高层公寓与1幢酒店式公寓围合而成。', '2012-09-26', '4.2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVI', '330100', '120.230376,30.343981;120.230376,30.343896;120.230312,30.343847;120.229344,30.343412;120.229255,30.343392;120.229189,30.343405;120.229133,30.343436;120.227861,30.344709;120.227392,30.345124;120.226568,30.345733;120.226526,30.345813;120.226515,30.345885;120.226559,30.346027;120.22707,30.34694;120.227124,30.347011;120.227152,30.347042;120.227269,30.347027;120.227575,30.34701;120.227932,30.346983;120.228518,30.346928;120.228593,30.346889;120.228653,30.346822;120.229063,30.346177;120.229741,30.345546;120.229973,30.345136;120.230376,30.343981', '玺之湾', '杭州市江干区笕丁路与华丰路交汇处', '杭州市', '', '69093.849745', '120.228506,30.345335', '商务住宅;住宅区;住宅小区', '1439个车位（1:0.9配比；地上100个，地下1339个）', '2.3', '176000平方米', '24975', '玺之湾规划20幢房源,分别是10幢高层和10幢小高层,形成区域内产品独特优势。内围建筑偏东30度规划,采光景观面更佳。最大楼间距达到70余米,社区通透感更强。简约新古典建筑气质,超越现有区域楼盘。外水内坡自然形成台地筑品,增加亲和力。四大邻里空间,九大集中院落,围合静谧生活。高得房率,基本上维持在82%-88%。内围小高层层高3米左右,主力户型是89方-140方。', '2015-04-11', '1.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FVJ', '330100', '120.105484,30.264507;120.105775,30.264823;120.106027,30.265062;120.106164,30.265141;120.107026,30.265535;120.107344,30.265049;120.107503,30.264891;120.108386,30.26499;120.108381,30.264651;120.107428,30.264534;120.107304,30.264358;120.107562,30.263924;120.108063,30.263628;120.108796,30.263076;120.108697,30.262881;120.108554,30.262741;120.108296,30.262797;120.107753,30.262986;120.107063,30.263291;120.106588,30.263268;120.106504,30.263481;120.1066,30.263549;120.105962,30.264035;120.105484,30.264507', '钱江西溪和景', '杭州市西湖区西溪路537号', '杭州市', '', '37245.901174', '120.107075,30.264161', '商务住宅;住宅区;住宅小区', '457个（1:1）', '1.4', '93451平方米', '29000', '钱江西溪和景,南靠老和山,北接西溪路,东临浙大科技园,项目距离黄龙商圈、武林商圈都比较近。钱江西溪和景总用地面积约4万余平米,总建筑面积约9.3万平米。由15幢多层、低层新古典主义建筑的名仕馆、商务大公馆和企业独联体组成。', '2017-10-08', '4.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FW1', '330100', '120.234408,30.34519;120.234356,30.345114;120.232854,30.344698;120.231336,30.344296;120.230678,30.345313;120.231614,30.345681;120.232426,30.34596;120.233193,30.34628;120.233913,30.346512;120.234451,30.345282;120.234408,30.34519', '北城铭苑(华丰路)', '杭州市江干区华丰中路434号', '杭州市', '', '40896.180775', '120.232662,30.34535', '商务住宅;住宅区;住宅小区', '', 'None', '', '22090', '北城铭苑经济适用房项目总建筑面积约为11万余平方米,其中地上总建筑面积约8万余平方米,由13幢主体建筑组成,其中包括11幢小高层建筑(14-17层)、2幢多层建筑(7层)及配套公建。户型为约63㎡、83㎡的经济适用房和50㎡的廉租房,共有住宅1200多套。 产品设计现代、适用、经济,为居住者的切身需求考量,从居住环境的舒适性、美观性、人文性出发,打造一个幸福的成熟生活住区。    北城铭苑项目位于丁桥镇,东邻惠兰雅路、南接华丰路、西至丁群路、北临规划中小学,占据丁桥大型居住区的核心地段,交通便利,周边配套齐全。   醇熟生活区:新城广场已建成使用,广场内物美超市、苏宁电器均已开业运营,农贸市场、医院、文体中心等生活配套逐步完善中,完美品质生活从容拥有。    高质教育圈:规划中的中学、小学、幼儿园等大部均已建成,部分已投入使用。丰富的教育资源,一体化的教育配套,让您的孩子赢在起跑线上。    便捷交通线:居住区内公交中心站已建成并投入使用,多路公交均已开通;石大线、秋石高架等城市快速路与五条城市主干道路网纵横;更有地铁3号线让您的生活无比便捷。    人性化配置:小区内按规划设计要求设置了地上、地下车位,社区服务设施、商业设施等,一应俱全。', '', '0.8-1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14FWL', '330100', '120.232246,30.350217;120.231465,30.351457;120.233843,30.352565;120.234591,30.351208;120.232246,30.350217', '冠宇隽园', '杭州市江干区蕙兰雅路358号', '杭州市', '0103000020E610000001000000050000001EA8531EDD0E5E40D48041D2A7593E40CB4A9352D00E5E4045F30016F9593E408159A148F70E5E40D8B628B3415A3E40E63BF889030F5E40F4177AC4E8593E401EA8531EDD0E5E40D48041D2A7593E40', '35210.117301', '120.233046,30.351371', '商务住宅;住宅区;住宅小区', '540个(1：0.6)', '2.3', '120000平方米', '26031', '冠宇隽园地处丁桥板块核心地段,由11栋高低错落的高层建筑群构筑仅10万平方米建筑面积的家园,主力户型86-115平方米三房两厅精细化全明设计,四大庭院落环抱约5000平方米中央水景花园,10万平方米建筑规模大小适度的社区,将由近千户志趣相投的人家共享,形成非常和谐宜居的氛围。11栋高层建筑群高低错落、疏密有致,构成优美的天际线,极具标识性。楼盘自身商业配套达5600方,轻松解决生活中的所有麻烦。园区散点设置幼儿娱乐天地、青年活动场地、老年活动场所等,“泛会所”服务渗透生活的每个神经末梢。借助周边健康运动配套(学校、新城广场、金融中心等)操场、篮球场、羽毛球、足球、跑道等开启健康韵动生活。', '2011-01-03', '1.5元/月/平方米');
