INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14IHD', '330100', '120.237357,30.362169;120.237279,30.362134;120.237152,30.362154;120.233487,30.363439;120.233241,30.363573;120.233026,30.363732;120.232775,30.363992;120.232616,30.364271;120.232548,30.364417;120.233583,30.36445;120.236227,30.364691;120.237398,30.36225;120.237357,30.362169', '中兴·久睦苑', '杭州市江干区临丁路', '杭州市', '', '58135.816475', '120.235204,30.363626', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '中兴·久睦苑经济适用房项目由中兴房地产开发有限公司下属中兴·景灿房地产开发有限公司开发建设。项目总建筑面积约为177217平方米,其中廉租房约13103平方米,经济适用房约119476平方米,配套用房月14667平方米。项目由十三幢板式高层组成,其中9和10号楼为廉租房,其余为经济适用房。本项目的住宅立面采用现代简洁风格,品质感与实用性俱佳。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14JB6', '330100', '120.103149,30.325321;120.103069,30.325385;120.101859,30.325038;120.10139,30.324862;120.101309,30.3248;120.101342,30.324624;120.10146,30.324307;120.10157,30.324073;120.101728,30.323681;120.103434,30.32411;120.103552,30.32414;120.103149,30.325321', '丽晶湾', '杭州市拱墅区祥符南路和莫干山路交叉口往西200米', '杭州市', '', '22434.7553', '120.102425,30.324523', '商务住宅;住宅区;住宅小区', '600个地下车位', '2.5', '100000平方米', '32618', '丽晶湾毗邻五里塘河,风景优美,距武林广场直线距离约6.5㎞,交通便捷,是用地日益稀缺的主城区项目之一。凭借超过300亿元的投资及200余万平方米的综合体群落,申花CBD,正在日益成为影响杭州这座魅力之城的国际化时尚生活源泉。丽晶湾凭借地利之优势,与建设中的100万平米蓝孔雀综合体隔石祥路相伴,与20余万平米的央企大盘蓝翔综合体毗邻而居。于世界级综合体双子星的围合中,步行五分钟之内,畅享国际级大型城市综合体的超级配套。丽晶湾采用世界建筑的精华——法国新古典主义建筑形态,园区规划6幢21-23层的高层建筑,外立面大部分饰以高档石材,庄重俊朗,高贵典雅。以中央法式景观大道为东西轴线,建筑围绕近万平米的中央花园围合布局,形成超宽的楼间距,整体布局层次分明,大气庄重,户户见景。丽晶湾全面融入建工地产“以超五星级酒店的手笔营建公寓”的综合体人居设计思想,实现产品各个界面的全方位、系统化升级。丽晶湾主力户型配置有89-130平米多款经典户型,每款户型均配备典雅的入户花园及可增长的空间系统,为都市新贵带来奢适的居住新体验。丽晶湾,堪称续世贸丽晶城、欧美中心(EAC)之后,建工地产又一超越之作。', '2013-01-12', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14KJ7', '330100', '120.075076,30.33455;120.075377,30.333365;120.077161,30.334769;120.077174,30.33482;120.077049,30.334969;120.076977,30.335021;120.076906,30.335027;120.075076,30.33455', '金地自在城', '杭州市西湖区金渡北路通济路交汇处西北方向', '杭州市', '0103000020E61000000100000008000000BA2D910BCE045E4076E09C11A5553E40B8770DFAD2045E408CA19C6857553E40B5E1B034F0045E40F2B6D26BB3553E407F86376BF0045E40F60B76C3B6553E4021CCED5EEE045E40802C4487C0553E40D462F030ED045E402579AEEFC3553E406FB72407EC045E40E9465854C4553E40BA2D910BCE045E4076E09C11A5553E40', '14398.467425', '120.07598,30.334339', '商务住宅;住宅区;住宅小区', '纯地下车位配比1：0.7 只售不租', '住宅:1.8', '850000平方米', '36193', '金地地产坚守“科学筑家”的使命,在“做中国最有价值的国际化地产企业”的愿景指引下,不断开拓新里程。作为连续八年跻身中国地产上市公司十强的金地地产将杭州作为企业下一步发展的战略要地,并将推出继格林系、未来系、国际系作品之后的新一代创新作品——自在城。金地•自在城项目位于杭州市西湖区三墩镇,东至通济路,南至金渡北路,项目占地面积546亩,总建筑面积约85万㎡,地块内金家汇河、董家桥河、池华港河、三墩港河四条天然河道环绕。建筑类型包括杭城稀有的大规模城市别墅组团、花园洋房、精装修高层景观公寓、时尚SOHO等,是目前杭州三墩板块规模最大、起点最高的综合性住宅项目,也是金地地产进驻杭州的首个重量级大盘。在未来将成为区域高端住宅标杆。依托杭州城西成熟生活配套及自身的科学规划,金地.自在城必将成为功能齐备、生活便利、环境宜人、邻里和谐的新城市生活范本。', '2013-08-03', '2元/月/平方米');
