INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14PTF', '330100', '120.22777,30.355699;120.225843,30.355317;120.225203,30.356685;120.228033,30.357593;120.228131,30.357318;120.228391,30.356658;120.228334,30.356554;120.227574,30.356302;120.227864,30.355721;120.22777,30.355699', '广宇·上东领地', '杭州市江干区丁桥镇紫丁香街236号', '杭州市', '', '38598.984283', '120.226822,30.356422', '商务住宅;住宅区;住宅小区', '', 'None', '', '25392', '上东领地位于江干丁桥板块,建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14QYM', '330100', '120.239713,30.355337;120.238325,30.354838;120.23773,30.35623;120.239294,30.356792;120.239863,30.355593;120.239803,30.355376;120.239713,30.355337', '农港苑', '杭州市江干区丁桥镇环丁路825号', '杭州市', '0103000020E6100000010000000700000044DB3175570F5E400A0F9A5DF75A3E406E3480B7400F5E40C860C5A9D65A3E40CCD1E3F7360F5E40A5DAA7E3315B3E404208C897500F5E40747973B8565B3E404F2157EA590F5E40C0AF9124085B3E40E49EAEEE580F5E4086C8E9EBF95A3E4044DB3175570F5E400A0F9A5DF75A3E40', '23129.701676', '120.238819,30.355818', '商务住宅;住宅区;住宅小区', '', 'None', '', '22486', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14QZL', '330100', '120.230775,30.358274;120.231351,30.356842;120.228903,30.356013;120.228393,30.357163;120.228358,30.357508;120.228391,30.358034;120.228814,30.358945;120.230775,30.358274', '上东臻品', '杭州市江干区蕙兰雅路666号', '杭州市', '0103000020E61000000100000008000000006F8104C50E5E40D20149D8B75B3E4067B96C74CE0E5E40D8D64FFF595B3E4034BDC458A60E5E406BF3FFAA235B3E40A968ACFD9D0E5E405C57CC086F5B3E40EB71DF6A9D0E5E40F10EF0A4855B3E40D9EC48F59D0E5E4027DBC01DA85B3E407CB779E3A40E5E400E10CCD1E35B3E40006F8104C50E5E40D20149D8B75B3E40', '52176.918426', '120.229661,30.357465', '商务住宅;住宅区;住宅小区', '', 'None', '', '25372', '上东臻品是2011年底刚交付次新房,小区内部人车分流,绿树成荫,同时配有游泳池及小孩活动中心,使整个小区具有很高的档次与品位。小区环境舒适,闹中取静,绿化率高,生活配套成熟,餐饮、超市、银行、学校、医院、公交站点近在咫尺,生活非常方便,非常宜居。  小区建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区内居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14R2X', '330100', '120.199758,30.345228;120.199785,30.344155;120.199809,30.343479;120.199775,30.343296;120.199772,30.342695;120.198335,30.342741;120.197681,30.342757;120.197652,30.342858;120.197664,30.343436;120.197656,30.344068;120.197692,30.345231;120.199758,30.345228', '洄龙湖邸', '杭州市下城区永华街198号', '杭州市', '', '48130.251453', '120.198728,30.343974', '商务住宅;住宅区;住宅小区', '车位总数:393车位数:地上199个;地下194个', '1', '57605平方米', '', '泰地·洄龙湖邸,地处下城区都市经济新区偏北中心位置(嘉里·华枫居右侧),占地面积57605㎡,建筑密度28.8%,内拥近万方自然湖,规划稀缺城市独栋官邸、LOFT商务公馆及大平层写字楼3大建筑形态,商住一体化设计,实现商务与生活的完美融合,开启主城区首席私岸生活.项目坐享四条高架快车道(秋石、上塘、留石、德胜)构成的“井”字交通线,距武林广场约十分钟车程,规划地铁三号线近在咫尺,交通非常便利.项目与半山公园相望,毗邻百万方创新创业新天地,600亩城北体育公园生态休闲圈,紧依大型LOFT创意产业园区、CBD办公商贸圈,西邻丁桥大型居住区,周边众多中高端楼盘快速开发和建设,形成成熟、便捷的大型商住圈.', '2011-11-30', '0.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14VOA', '330100', '120.196691,30.176976;120.193615,30.177093;120.193521,30.177108;120.193466,30.177157;120.19346,30.177236;120.193463,30.177764;120.193398,30.178257;120.193435,30.178378;120.193495,30.178426;120.196575,30.178265;120.196669,30.178233;120.196716,30.178154;120.196761,30.177088;120.196744,30.177002;120.196691,30.176976', '铂金名筑', '杭州市滨江区长河街道平安路38号', '杭州市', '', '39044.458762', '120.195081,30.17769', '商务住宅;住宅区;住宅小区', '553个', '2.2', '111907.09平方米', '36361', '铂金名筑是由金迅达集团-杭州金潮房地产开发有限公司开发建设,项目位于杭州市滨江区,长河路以西,纵二路以东,平安路以南,南环路以北,总占地面积为39631平方米。有十幢高层小高层合围而成,总建筑面积111907.09平方米,总户数815户。于2011年3月开工,预计2014年12月交付使用。铂金名筑项目是金迅达集团在杭开发继铂金时代后又一标杆性工程。项目秉承集团公司的“用心开发、创建精品、关爱业主、回报社会”的企业理念和“追求卓越,造福万家”企业宗旨。  铂金名筑楼盘地处滨江核心区,市政生活设施配套完备,近邻长河街道幼儿园、博文小学、长河中学、长河高级中学、长河镇政府、邮局、银行和长河水产市场(农贸市场)等,距中河高架仅五分钟路程,距武林商业圈30分钟车程。地处星光大道商业圈辐射范围,彩虹快速路预计2012年底通车。  医院:杭州滨江医院三级甲等综合医院、滨江区妇幼保健医院,武警医院。  文化休闲:临近白马湖创意园,湘湖休闲度假区。  酒店:喜来登、华美达、歌山品悦等。  铂金名筑方案设计定位“简约、理性、经济、时尚、运动”', '2013-12-18', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B14VQ5', '330100', '120.23119,30.358521;120.231128,30.358467;120.231033,30.35846;120.229093,30.359124;120.228186,30.359526;120.22729,30.360058;120.227187,30.3602;120.227223,30.360343;120.229001,30.361061;120.229878,30.361427;120.23119,30.358521', '广宇·东承府', '杭州市江干区惠兰雅路与勤丰路交汇处', '杭州市', '', '51721.632897', '120.22934,30.359955', '商务住宅;住宅区;住宅小区', '777个（1:0.93配比）', '2', '151654平方米', '25145', '广宇东承府规划有多层公寓、高层公寓、单身公寓等产品,传承城市高端大宅的“依水而居,方为大宅”、“有山有水,有私家花园”、“独门独户、有天有地”、“家庭成员生活空间相对独立”等传统,是杭州主城区为数不多的高品质城市山水大宅。  广宇东承府位于丁桥CBD中央区,北眺皋亭山风景区,近揽丁兰公园、勤丰港公园;坐拥52万方品牌大盘上东城成熟社区,上市房企广宇集团鼎立钜制。  多层:220-250平方米、高层:50-130平方米', '2013-09-14', '2.5元/月/平方米');
