INSERT INTO "public"."gaode_residential_region" VALUES ('B023B18JQ2', '330100', '120.283945,30.192195;120.284863,30.192177;120.284954,30.192193;120.285018,30.192237;120.285064,30.193004;120.284997,30.193086;120.284943,30.193111;120.283971,30.193163;120.283984,30.192742;120.283928,30.192617;120.283914,30.192588;120.283883,30.192275;120.283905,30.19222;120.283945,30.192195', '天海阳光地带', '杭州市萧山区开发区、建设一路和通惠路交叉口', '杭州市', '', '9450.171284', '120.284483,30.192655', '商务住宅;住宅区;住宅小区', '', 'None', '', '12456', '开发区、建设一路和通惠路交叉口位置,小区主要是以多层为主,周边配套设施齐备。交通比较方便。房子相对比较旧。', '', '');
