INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1A1NS', '330100', '120.270946,30.327488;120.271095,30.327195;120.271466,30.32642;120.271794,30.325716;120.2704,30.325002;120.269644,30.326094;120.269219,30.326715;120.270946,30.327488', '罗兰春天', '杭州市江干区九环路60号', '杭州市', '0103000020E61000000100000008000000D93EE42D57115E401BD5E940D6533E40FCC6D79E59115E402B6A300DC3533E4076FEEDB25F115E40A4C2D84290533E40F04FA91265115E40B0C8AF1F62533E40A835CD3B4E115E407522C15433533E400264E8D841115E40FD6B79E57A533E408F1D54E23A115E40D61C2098A3533E40D93EE42D57115E401BD5E940D6533E40', '31739.5128', '120.27057,30.326255', '商务住宅;住宅区;住宅小区', '配比1：0.8', '2.2', '117280平方米', '27047', '华鸿罗兰春天位于江干区九堡CBD核心,与中国服装航母四季青交易中心隔路对望;紧邻地铁一号线九堡东站;罗兰春天占地37098平方米,建筑面积11万方,规划有10幢高层公寓,共912套高层住宅,项目主力面积60-110方可变魔方户型,可实现高厅空中别墅亦可打造温馨4口之家、四方住品。。华鸿罗兰春天项目位于江干区九堡CBD核心,紧邻地铁一号线,未来有着良好的发展空间,有着较大的升值空间。项目户型最大可赠面积20-30平米,较为划算。。罗兰春天占地37098平方米,建筑面积11万方,规划有10幢高层公寓,共912套高层住宅,——户户南北通透,户户阳台+露台,两房朝南,延伸式飘窗,采光极佳,并享受双层浪漫高度。罗兰春天魔方可变户型既可实现高厅空中别墅体验,亦可以打造温馨四口之家三房、四房住品。。华鸿罗兰春天位于江干区九堡CBD核心,与中国服装航母四季青交易中心隔路对望;紧邻地铁一号线九堡东站;快速公交、近10条公交线路、德胜快速路、杭海路构筑市区快速交通网络,充分享受便捷都市生活;临近沪杭甬金温高速枢纽。目前可在九堡附近换乘十余条公交线路,K205、309、K325、K509、K842、K210、K320、J15、K223等;但都不可直达项目地点,还需徒步到达项目所在地。项目附近有多个公共自行车租赁点,周围交通环境也较宜自行车出行。。华鸿罗兰春天位于江干区九堡CBD核心,与中国服装航母四季青交易中心隔路对望;紧邻地铁一号线九堡东站;快速公交、近10条公交线路、德胜快速路、杭海路构筑市区快速交通网络,充分享受便捷都市生活;临近沪杭甬金温高速枢纽。罗兰春天占地37098平方米,建筑面积11万方,规划有10幢高层公寓,共912套高层住宅,——户户南北通透,户户阳台+露台,两房朝南,延伸式飘窗,采光极佳,并享受双层浪漫高度。罗兰春天魔方可变户型既可实现高厅空中别墅体验,亦可以打造温馨四口之家三房、四房住品。近100%的超高得房率更是提升了整个空间利用率和舒适的空间尺度,充分演绎了自由主张魔方住品的生活方式。罗兰春天外立面采用香槟色与岩石灰为主基调,底部两层采用干挂高档石材。项目教育、生活、商业配套丰富,周边围绕着九堡幼儿园、九堡中心小学、九堡社区医院、大型世纪联华超市、KFC、各银行分支处,九堡农贸市场等配套,日常生活尽可高枕无忧。。华鸿罗兰春天位于江干区九堡CBD核心,与中国服装航母四季青交易中心隔路对望;紧邻地铁一号线九堡东站;快速公交、近10条公交线路、德胜快速路、杭海路构筑市区快速交通网络,充分享受便捷都市生活;临近沪杭甬金温高速枢纽。。', '2013-04-01', '1.85元/月/平方米');
