INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1AHI2', '330100', '120.122851,30.332031;120.122327,30.331876;120.121481,30.331699;120.121241,30.332187;120.120617,30.332116;120.120127,30.333208;120.122218,30.33351;120.122851,30.332031', '德信·晓宸', '杭州市拱墅区祥符街道祥富路', '杭州市', '0103000020E61000000100000008000000FAD170CADC075E401842CEFBFF543E40BD1AA034D4075E40CA5356D3F5543E4077853E58C6075E40AC1DC539EA543E40CC7B9C69C2075E4007280D350A553E40DD955D30B8075E40747ADE8D05553E4076172829B0075E40FCC3961E4D553E40E23E726BD2075E4093E34EE960553E40FAD170CADC075E401842CEFBFF543E40', '28471.163379', '120.121551,30.332646', '商务住宅;住宅区;住宅小区', '配比1:0.9', '2.3', '100000平方米', '35313', '德信晓宸是由德信集团深耕桥西板块7年后倾心打造的全新力作。位于大桥西板块杭州拱墅区祥富路和东吴路交界处,德信北海公园的西南侧,东至十字港河沿河绿化景观带,北至祥富路,西至上祥路,西南为规划市政公园,距离武林广场直线距离约7.5公里,交通便捷,经上塘高架、留石快速路、莫干山路、石祥路、杭行路等城市主干道路与市中心及周边区域紧密相连。德信晓宸南侧紧邻35万方的大型城市商业综合体——万达广场(预计2014年年底正式营业)和欧尚超市石祥路店,正北侧一路之隔便是卖鱼桥重点小学(在建),西侧为在建的幼儿园,东侧为拱墅区的景观河道十字港河及沿河绿化公园,东北侧有已经开园的市属甲级幼儿园——大关苑实验幼儿园。项目周边奥特莱斯(即将入驻)运河新城、运河天地、运河广场、百万方蓝孔雀综合体(规划中)等大型近身商业配套也近在咫尺,可以说商业、生活、教育等各类配套一应俱全。德信晓宸总建筑面积约10万平方米,由10幢18-23层高层及1幢11层小高层组成。项目在设计上全面的考虑了客户在居住的安全、休闲、教育、健康等方面需求,打造了更为人性化的“亲子主题社区”。同时,在户型设计上继承了德信地产一贯的户型设计优势,主力户型德信的王牌产品优悦90方舒适三房和127方卓越四房,在户型设计上将“可生长空间”理念融入主力户型90方创新三房设计:融合飘窗、通高阳台、可拓空间、增加贮藏功能,拥有更高得房率。建筑采用经典的新古典主义风格,整体依托十字港河及市政公园有序排列,简洁、大气的建筑立面与周边环境完美的融合,建立人与自然、人与环境的和谐友好关系,体现现代典雅、健康品质住区要求。德信晓宸项目在设计上全面的考虑了客户在居住的安全、休闲、教育、健康等方面需求,提倡亲情、关爱下一代成长,建立人与自然、人与环境、人与人的和谐友好关系。在社区规划理念在杭州市场上推陈出新,在建筑空间的设计、园区环境的打造、环保建材的使用、人性化的物业服务上等多个方面进行精心的考量,全方位打造人性化住区的示范标准。首次提出以“亲教育、亲玩乐、亲安全、亲服务、亲邻里、亲空间”等“6大亲子生活体系”为基础,打造“杭州首个亲子主题社区”。体现德信地产专注建筑品质、关注居住氛围、实现人文关爱的未来地产模式全面探索,秉承了德信地产“远见R26;你的生活”的企业经营理念。', '2014-08-10', '2.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B023B1BHYR', '330100', '120.192622,30.242475;120.193113,30.242249;120.193226,30.242375;120.1933,30.242495;120.193474,30.242383;120.193479,30.242374;120.193473,30.242348;120.193533,30.242307;120.193222,30.241862;120.193728,30.241507;120.193403,30.241139;120.192762,30.241419;120.192289,30.241625;120.192069,30.241733;120.191846,30.241843;120.191774,30.241913;120.191963,30.242236;120.192043,30.242201;120.192301,30.242633;120.192622,30.242475', '近江新村', '杭州市上城区甘王路与秋涛路交界口', '杭州市', '', '13715.161434', '120.192775,30.241901', '商务住宅;住宅区;住宅区', '', '1.3', '', '22750', '近江新村位于秋涛路与甘王路交界口。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '10元/月/平方米');
