INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF00825', '330100', '120.170579,30.235656;120.170446,30.235321;120.168384,30.235629;120.168242,30.235669;120.168221,30.235837;120.168608,30.236217;120.169012,30.236562;120.169567,30.236959;120.169731,30.237044;120.170245,30.237281;120.170319,30.237146;120.169611,30.236794;120.169799,30.236614;120.170181,30.236502;120.170739,30.236371;120.170687,30.236108;120.170579,30.235656', '十五奎巷社区', '杭州市上城区上城中河南路紫阳街道十五奎巷65号', '杭州市', '', '23204.936415', '120.169597,30.236073', '商务住宅;住宅区;住宅小区', '', '2.5', '', '31670', '十五奎巷在鼓楼附近,建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。    十五奎巷在鼓楼附近,建筑以板楼、多层为主,得房率较佳,套内建筑利用率高。小区环境舒适,闹中取静,绿化率高,生活配套齐全,超市、银行、学校、医院、公交站点近在咫尺,生活非常便利,多条主干道相拥环抱,出行便利,非常宜居。小区居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '0.50元/月/平方米');
