INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF00QHF', '330100', '120.33843,30.198054;120.338482,30.197912;120.337742,30.195199;120.337655,30.195126;120.337541,30.195114;120.334166,30.195736;120.334077,30.195801;120.334031,30.19592;120.334784,30.198543;120.334871,30.198615;120.33499,30.198633;120.338309,30.198163;120.33843,30.198054', '郡望府', '杭州市萧山区建设四路东与枫香路交汇处', '杭州市', '', '104762.660959', '120.336277,30.196903', '商务住宅;住宅区;住宅小区', '2705个，车位比1:1', '2.5', '383800平方米', '20876', '郡望府,地处萧山建设四路东与枫香路交界处,是由兴惠化纤集团下属的杭州惠力房产、浙江得力房产联合精工打造的40万方景观大盘。其中浙江得力房产,作为区域品牌房企,已成功开发了名门世家,半岛花园等知名楼盘,广受业内好评。    郡望府项目所在区块规划为萧山主城区域,为重点发展板块,前景广阔。周边交通便捷,规划地铁7号线盛东站点即为项目所在地,堪称地铁上盖物业,其独特优势将开启美好生活的全盛时代。项目西侧规划为大型商业中心,将建设商业综合体和高档酒店等综合配套设施。周边生活配套齐全,尤其是教育资源充裕,新街一小、四小(在建),新东幼儿园、新街初中等均在家门口,能让您的孩子健康快乐的成长。    项目总占地面积约178亩,总建筑面积约40万方,由14幢27层的高层建筑及部分商业裙房组成。    园区内最大楼间距可达134米,内部规划设计了南北两个规模超过5万方的公园,为每幢建筑、每户住户均创造了良好的景观视觉空间。    超高得房率及高性价比特征是项目的又一大闪光点,传奇90方实现了媲美120平米大户型才能享受的居住空间,舒适三房和四房两厅两卫的神奇设计,让小户型可以三代同堂,悦享天伦。    此外,项目内部还规划了游泳池、羽毛球场、托老所、商业街等各种配套,服务中心内也设置了咖啡吧、健身房、乒乓球室、棋牌室等设施,业主足不出户就能享受幸福的阳光生活。', '2014-01-09', '2.00元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF01IKA', '330100', '120.281381,30.164221;120.281296,30.163262;120.280487,30.163318;120.280203,30.163343;120.280167,30.162623;120.280112,30.16199;120.279582,30.161946;120.279561,30.163442;120.279541,30.164219;120.279545,30.164476;120.279554,30.164659;120.279582,30.164691;120.279642,30.16471;120.281376,30.16448;120.281376,30.164397;120.281381,30.164221', '高运·学林尚苑', '杭州市萧山区育才路318-5号', '杭州市', '', '28438.699541', '120.280286,30.163631', '商务住宅;住宅区;住宅小区', '476个停车位', '2.5', '100000平方米', '', '近10万㎡中央美宅,传承独一无二的地理气质。高运&#8226;学林尚苑东近回澜路,北依萧绍路,西倚育才路,南邻文化路,占据萧山老城区的核心位置。高运&#8226;学林尚苑由稀缺多层、精品高层及沿街旺铺组合而成,总建筑面积近10万㎡中央美宅,是集萧山千年城脉厚祉、浑厚人文底蕴和一流品质于一身的稀缺城市中心高端物业。以产品的唯一性与优越性鹤立于此,成就了一个阶层对地段、对产品、对身份的多重需求,仿佛上天恩宠,赐予的无上福祉。    新古典主义集郡,新萧山人文精粹。高运&#8226;学林尚苑由杭州江南建筑设计院规划设计,以中国传统的景观庭院布局手法,融合萧山千年文化精粹,创造现代城市中央建筑与艺术、景观与居室之尊贵品位。建筑整体南低北高,错落有致,视觉通透,营造出完美城市天际线,形象大气奔放,立面精致,在窗、檐口等采用现代元素和符号,线条装饰简洁流畅,完美细节品质呈现,共享尊容礼遇。    立体美学景观,优享传世人生。高运&#8226;学林尚苑景观设计由国际精英团队——日本设景机构倾力打造,绿化率高达35%以上,将绿化与水景相融合,营造步移景换、情景交融的立体美学空间,倍添愉悦精神享受。整体舒朗开阔,令您虽地处繁华,亦拥安逸与宁静,优享传世人生。    二房变五房  空中叠墅好过LOFT。高运&#8226;学林尚苑主力户型约为90-160平米,以“创新、可变”为基调,首创X型可变空间布局,“得房率”超乎想象, 使空间利用率达至顶点,带给您至臻附加值享受。进行二次装修时,用多维角度对空间进行分割,原户型中的露台等赠送部分可演变为居室,从而使得户型数量呈梯度增长:90方的跃层可变户型通过二次装修,可以改造成“五房”,总面积可以达到“140”方以上。透过90-160平米的室内来活化生活氛围中的空间元素,演绎着高尚生活中空间“舒适”之韵律,压抑和烦躁不会在此滋生,有的只是空灵与宽阔的心灵世界,有的只是自由飘飞、心旷神怡的体验。以空间还原对人性的尊重,让主人的个性、创意、习惯得以最完美的保留和发挥。', '2013-05-01', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF01IKY', '330100', '120.120653,30.341331;120.120676,30.340086;120.120764,30.338841;120.120715,30.338751;120.120575,30.338725;120.118809,30.338705;120.118716,30.338735;120.118672,30.338848;120.118559,30.339979;120.118458,30.341361;120.118476,30.341446;120.118576,30.341486;120.120516,30.341448;120.12061,30.341412;120.120653,30.341331', '滨江·万家名城', '杭州市余杭区上园路与东吴路交叉口', '杭州市', '', '53297.535155', '120.119621,30.340103', '商务住宅;住宅区;住宅小区', '1010个，车位比1:1', '2.5', '156643平方米', '29466', '滨江万家名城近通运路与通益路交叉口,对望万达广场,位于城北新城的核心区域,坐拥城市中轴繁华。周边名校云集,丰富的商业配套为万家名城的生活提供便利性。35万方的滨江5A精工品质打造区域产品新标杆,以A+建筑、A+园林、A+精装、A+户型、A+服务,让客户清晰直观的理解到项目的与众不同与产品优势!', '2016-01-07', '2.1元/月/平方米');
