INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF09PPQ', '330100', '120.226629,30.360166;120.226569,30.360138;120.224289,30.359119;120.224208,30.359105;120.224154,30.35915;120.223678,30.360182;120.223429,30.360797;120.223433,30.360851;120.223461,30.36088;120.223506,30.360897;120.225608,30.361628;120.2257,30.361644;120.225767,30.361638;120.225844,30.361609;120.226667,30.360295;120.226671,30.360253;120.226669,30.36021;120.226629,30.360166', '广宇·上东名筑', '杭州市江干区环丁路1560号', '杭州市', '', '44390.056941', '120.225002,30.360432', '商务住宅;住宅区;住宅小区', '', 'None', '', '26760', '小区环境舒适,闹中取静,绿化率高,生活配套成熟,餐饮、超市、银行、学校、医院、公交站点近在咫尺,生活非常方便,多条主干道相拥环抱,出行便利,非常宜居。  小区建筑以板楼、多层\高层为主,得房率较佳,套内建筑利用率高。小区内居住氛围浓厚,社会风气良好,健康向上,邻里关系和谐,安全无虑。', '', '1.75元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0BTZT', '330100', '120.04172,30.29351;120.043631,30.293706;120.04367,30.293565;120.04376,30.291685;120.042418,30.291559;120.042173,30.292499;120.04196,30.292588;120.04172,30.29351', '盛奥西溪铭座', '杭州市余杭区文昌路与荆长大道交叉口东150米', '杭州市', '0103000020E61000000100000008000000B4E55C8AAB025E40890CAB78234B3E40E085ADD9CA025E4094A30051304B3E403F74417DCB025E4010406A13274B3E40DF37BEF6CC025E40D8BB3FDEAB4A3E40C0B0FCF9B6025E40BEDA519CA34A3E408DF161F6B2025E40DA1CE736E14A3E405FEFFE78AF025E40B933130CE74A3E40B4E55C8AAB025E40890CAB78234B3E40', '30266.526459', '120.042875,30.292685', '商务住宅;住宅区;住宅小区', '1461个', '2.81', '135880平方米', '14118', '', '2015-01-02', '3.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0BUMG', '330100', '120.292644,30.33468;120.29273,30.334749;120.292847,30.334758;120.293813,30.334529;120.293853,30.334498;120.293861,30.334442;120.293499,30.333252;120.293035,30.331884;120.291922,30.332254;120.291855,30.332333;120.291815,30.332423;120.291799,30.332553;120.291833,30.332747;120.291938,30.333326;120.292201,30.333902;120.292644,30.33468', '佳兆业·君汇上品', '杭州市余杭区乔司街道石塘路北侧', '杭州市', '', '34113.873477', '120.292796,30.333362', '商务住宅;住宅区;住宅小区', '约660个', '2', '73190平方米', '22591', '佳兆业乔司项目是在2013年2月1日,经过101轮鏖战,以总价46600万元的价格拿下余政储出【2012】75号地块,楼面价为6367元/平方米,溢价率高达77%,接近板块的“地王价”国翔地块。    佳兆业君汇上品位于乔司西石塘路北侧,在杭州国际商贸城范围之内,建筑面积36595平米,容积率1.5~2.0,是佳兆业集团在杭州继位于之江的佳兆业玖陇山之后的第二个项目。', '2016-09-13', '2.18元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0E4BW', '330100', '120.048614,30.369304;120.048504,30.370906;120.048558,30.370968;120.050405,30.371026;120.050489,30.370989;120.050518,30.370927;120.050575,30.369418;120.05054,30.369307;120.050443,30.369272;120.04871,30.369203;120.048614,30.369304', '玉都枫景', '杭州市余杭区玉都枫景名苑1-1', '杭州市', '', '31736.281888', '120.049551,30.370123', '商务住宅;住宅区;住宅小区', '共262个车位，车位配比率为1：0.9', '2', '99333平方米', '19815', '玉都枫景大环境、大配套、交通便捷,吸引众多置业人青睐。小区内高低错落的建筑和自然地形地貌融为一体。附近商业网点遍布,酒楼食肆、综合市场、医院等生活配套一应俱全。交通便捷,购物方便,风景优美。', '2012-05-12', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0E5C5', '330100', '120.061025,30.361093;120.061021,30.36188;120.061069,30.362074;120.060932,30.362838;120.06085,30.363242;120.060843,30.363337;120.06088,30.363387;120.060966,30.363423;120.062108,30.363613;120.062215,30.363601;120.062247,30.36352;120.062279,30.361098;120.061025,30.361093', '严村里北区', '杭州市余杭区祥章线附近', '杭州市', '', '28349.817612', '120.061629,30.362334', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0E5HG', '330100', '120.246772,30.194218;120.24901,30.194163;120.249125,30.194109;120.249187,30.194023;120.249207,30.193112;120.249226,30.192204;120.246602,30.19225;120.24661,30.194075;120.246772,30.194218', '中国铁建.青秀城', '杭州市萧山区建设一路', '杭州市', '', '46245.797117', '120.247905,30.193202', '商务住宅;住宅区;住宅小区', '1367个（地上164个，地下1203个）', '2.2', '164851平方米', '35921', '中国铁建青秀城位于建设一路和明星路的交叉口,总用地面积51640平米,总建筑面积164851平米(包括计容建筑面积113608平米,地下室面积49630平米及架空层面积1613平米)。项目总规划户数1115户,由12幢18层的高层组成。车位1367个,户型面积范围从69-128平米不等。    青秀城,坐落于萧山新城中心,衔接滨江与钱江世纪城,是萧山与杭州主城重要的“桥头堡”。青秀城北至建设一路,东临明星路,西南两面,五甲河与北塘河两大天然水系环伺左右,生态景观资源优越。项目近邻地铁1号线滨康站、2号线(在建),交通网络四通八达。项目距离萧山区政府仅约1km,距离钱江世纪城约3km,距离钱江新城约6km,距离西湖约12km,坐落于众多核心商圈汇集处,配套齐全。    “青秀城”是继“山语城”、“国际城”之后代表中国铁建高端住宅形态的又一产品系,在北京与成都成功推出。2013年,中国铁建地产携“青秀城”强势进驻杭州萧山,实现了以高端产品系立足长三角的重大战略布局。承袭“低密度高端产品”的品牌形象,中国铁建将以央企责任树城市经典,以“青秀城”引领萧山高端人居新进程。', '2015-02-28', '2.45元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0E644', '330100', '120.048525,30.371157;120.048471,30.371241;120.048455,30.371349;120.048541,30.372575;120.048581,30.372665;120.048643,30.3727;120.050429,30.372796;120.050479,30.37276;120.050496,30.372701;120.050534,30.371263;120.050402,30.371159;120.048613,30.37112;120.048525,30.371157', '望城(祥周线)', '杭州市余杭区余杭良渚镇良平路(东西大道与良平路的交界处)', '杭州市', '', '29345.216032', '120.049513,30.371936', '商务住宅;住宅区;住宅小区', '', '2', '62592平方米', '', '望城位于良渚核心东西大道与勾良路交界处,东西大道与良平路的交界处,紧邻2号线,距良渚博物馆约1.5公里。总建筑面积6万余平方米,由8幢9-12层小高层超价值公寓与6幢城市排屋构成。周边交通网络成熟,紧靠104国道、古墩路延伸段和绕城高速良渚出口;出行便利。小区地理位置佳,紧邻周边的有良渚镇商业中心(次门步行仅五分钟)、良渚镇中心小学(仅隔一条小河)、良渚中学、华元十六街区20000方的休闲广场(仅隔东西大道)、红星美凯龙家居广场(亿丰家居),生活便利,配套完善。良渚望城总建筑面积62592㎡,由6幢排屋和8幢9至12层的小高层组成。建筑设计采用了厚重的欧陆风格与现代建筑的有机结合,简洁明快而不失大气。小高层户型范围70-140平米,80-90平米为主力户型。望城的户型特点:成熟、精致、实用。城市别墅200-300平方米,附赠阳光半地下室、户户自备车库入室、多层次景观露台、部分更带私家内院。', '2012-04-01', '1.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0EA71', '330100', '120.050652,30.367414;120.050648,30.367174;120.050616,30.367105;120.050557,30.367058;120.050476,30.36702;120.048866,30.367004;120.048741,30.367157;120.048626,30.368881;120.050475,30.368941;120.050631,30.368847;120.050662,30.367999;120.050652,30.367414', '九衡公寓', '杭州市余杭区余杭良渚镇良周路(良渚镇商贸区块核心)', '杭州市', '', '33726.8603', '120.049671,30.367974', '商务住宅;住宅区;住宅小区', '1:1；700余个', '2', '110000平方米', '20069', '郡原九衡公寓位于杭州余杭区良渚镇商贸区块核心,东西大道与良周路交汇处,紧邻规划地铁二号线,通过莫干山路和古墩路延伸段与主城区紧密相连。良渚镇商贸区北侧为中国文化——良渚遗址,西北侧有建筑大师David Chipperfield担纲设计的良渚博物院,人文气息浓郁。在良渚镇商贸区规划中,该区块将建设成布局合理、交通便捷、环境优美、功能完善的现代化新镇区。随着古墩路延伸段的顺利通车,该商贸区与大城西融为一体,共享三墩成熟配套。郡原九衡公寓是郡原地产继成功开发公元大厦、九树公寓两个高端房产品之后,将高端房产品的基因植入城市主流公寓的精心尝试之一,同时也是小户型公寓从现代主义建筑风格向新古典主义建筑风格延伸的一次尝试。郡原地产将以精巧户型、精彩立面、精美园林为九衡公寓内涵,将其打造成杭州城北新一代精致公寓的标杆。', '2012-02-13', '1.8元/月/平方米');
