INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF0FOY0', '330100', '120.220776,30.354765;120.22139,30.353756;120.221492,30.353719;120.221659,30.353738;120.223542,30.354571;120.223595,30.354682;120.22359,30.354807;120.223171,30.355668;120.22308,30.355719;120.222962,30.355719;120.220883,30.354902;120.220795,30.354839;120.220776,30.354765', '天阳晴朗(丁兰路)', '杭州市江干区广发路', '杭州市', '', '29884.546223', '120.222224,30.354724', '商务住宅;住宅区;住宅小区', '500多个（地下）1:1配比', '1.9', '90000平方米', '28612', '天阳·晴朗,坐落杭州大城东同协路板块核心区,是天阳置业于2014年在杭州主城区打造的又一全新力作。整体规划以青年群体的置业需求为导向,将打造成一个纯90方年轻精英社区。    2014年4月,天阳·晴朗正式签约杭州知名重点小学——采荷二小丁荷校区,一路之隔即享完善的教育体系,凭此跻身杭州一线学区房,让孩子的未来更晴朗,向杭城精英阶层呈献理想的品质生活。    天阳&#8226;晴朗周边配套极为完善,通过同协路,10分钟即可到达东站枢纽(CTD),约20分钟即可到达钱江新城(CBD),繁华与自然从容切换。项目周边约百米内可享规划约17万方的中央水景公园,生活诗意而悠然;近享区域内唯一三甲医院——杭州市中医院分院;近拥总建筑面积近15000方的体育中心和占地20亩的文化中心;一路之隔即享规划幼儿园、知名小学、初中、重点高中等教育资源;500米内近享新城广场物美超市、苏宁电器等大型卖场,丁兰广场电影院等娱乐生活设施;同时被银泰百货、新天地等12大商业综合体簇拥,聚揽繁华。距离规划地铁3号线站点仅约200米,并坐拥快速公交B3和多条公交线路等,从容接轨繁华生活。    作为天阳90方大成之作,在户型设计上,天阳·晴朗,再次开创杭州90方的历史时刻。在创新式“三”房二卫全明户型的基础上,精量室内的空间尺度,使之更开朗舒阔,更创造性的设置独立储藏室和主卧套房衣帽间,创享双层挑高阳台,90方中间套户户客厅步入,重新定义生活的卓越。    天阳·晴朗在园区内部打造约14000㎡景观庭院,约50%造房子,50%是风景,楼间距阔达约73米;户型设计采用类一梯两户,同步设计精装架空层、创新风雨通廊,完全人车分流,为品质生活喝彩!', '2016-05-31', '2.75元/月/平方米');
