INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF3LRQN', '330100', '120.170877,30.378948;120.171992,30.380199;120.174562,30.378414;120.172452,30.377481;120.170877,30.378948', '赞成杭家', '杭州市余杭区崇贤街道崇文街与洋湾路交叉口东北侧', '杭州市', '0103000020E61000000100000005000000DFA815A6EF0A5E4076E272BC02613E401DCBBBEA010B5E40CFF8BEB854613E40F54718062C0B5E403A596ABDDF603E404F081D74090B5E4083DC4598A2603E40DFA815A6EF0A5E4076E272BC02613E40', '44460.03121', '120.172549,30.378764', '商务住宅;住宅区;住宅小区', '1179个', '2.5', '174065平方米', '13830', '赞成杭家,处于城北板块,西湖直线距离13.6公里、离武林门直线距离11.8公里,是余杭区与杭州主城区接壤最近、处于绕城内最后的价值洼地。项目总体占地面积约78亩,总建筑面积近18万㎡的大盘,经上塘高架20分钟直达武林门、经秋石高架15分钟直达城东新城、高架在建工程完工后20分钟直达钱江新城,1.5公里范围内,幼儿园、小学、中学等校园林立,更有闻名杭城的十四中咫尺相伺,教育优势明显,超市、医院等配套也一应俱全。不出绕城、离市中心很近,随着城市化进程的发展,大器晚成的城北日益受到市民的关注。翻开大杭州的版图,在主城北面绕城公路以内,你会发现一个房产开发的空白点,那就是运河新城的政府刚确立打造的城北新城的交汇处。近年来,杭州房产开发浪潮向外围突进直到绕城以外,杭州东西南北都满是开发项目,特别是西部,开发商的足迹已远达五常、闲林甚至老余杭,然而运河新城和城北新城双城交汇处却似一个被人遗忘的角落,它的位置比下沙闲林都近,却罕有开发商进驻。眼下,在政府、开发商及相关方面的努力下,正兴起一场开发热潮。作为本土20年的知名开发公司之一的赞成房产,就是在这种情况下,历经30余轮激烈的竞拍,收入赞成杭家地块。', '2016-09-12', '2元/月/平方米');
