INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF541EF', '330100', '120.205376,30.21058;120.206135,30.210967;120.205212,30.212319;120.204708,30.212106;120.204601,30.211825;120.205376,30.21058', '杭州印', '杭州市滨江区闻涛路与江晖路交叉口向东300米处', '杭州市', '0103000020E6100000010000000600000088D860E1240D5E4012312592E8353E40E7E3DA50310D5E400589EDEE01363E40CB2F8331220D5E40C651B9895A363E40B14E95EF190D5E400E492D944C363E40A6EECA2E180D5E40A779C7293A363E4088D860E1240D5E4012312592E8353E40', '12039.683383', '120.20532,30.211448', '商务住宅;住宅区;住宅小区', '911个', '10.5', '10418平方米', '23398', '杭州印,尊踞滨江CBD绝版地段,地处钱江南岸三桥、四桥之间的黄金分割点上,直面钱塘江一线江景核心区,坐拥射潮广场、杭州低碳科技馆、喜来登酒店、星光大道等城市配套,一桥、四桥、三桥、凤凰山及主城区优美城市轮廓线尽收眼底,更可高空远眺西湖,是杭州唯一拥有180°江景及可观赏西湖的高尚物业。双地铁零换乘,距地铁1号线、规划6号线江陵路站800米,距萧山国际机场、武林广场约25分钟车程,现距西湖长桥公园、火车城站约10分钟车程,滨江区政府、文化中心更咫尺可达。而连接吴山广场的望江路隧道不日开工,作为南岸桥头堡的本项目更是万众瞩目。    杭州印总建筑面积约16万平方米,以高端物业集群升级城市价值,缔造滨江CBD划时代的标杆力作,涵盖国际品牌公馆、国际名品广场、国际化甲级写字楼、鼎级私人会所等高端物业,筑造比肩纽约洛克菲勒中心、香港IFC、上海WFC的国际一流城市综合体。    据了解,杭州印由世界500强企业集团倾力打造,并邀请国际顶尖设计机构加拿大B+H建筑师事务所担纲设计,项目以国际顶级城市综合体为规划标准,将杭州城市生态、肌理与成熟配套完美地结合,并汲取西湖与钱塘文化灵感,塑造140米高堪称“雕塑美学”的独特形态。建筑体态形似月影、肌似波光,代表杭州向世界发声,诠释世界地标建筑新方向。', '2014-09-20', '5.6元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF541NG', '330100', '120.279149,30.34688;120.279653,30.346163;120.280007,30.345533;120.280238,30.345246;120.280576,30.345006;120.281016,30.344839;120.282062,30.3447;120.282716,30.34464;120.282877,30.344765;120.282603,30.34733;120.282421,30.34732;120.282394,30.347438;120.279363,30.347149;120.279385,30.346945;120.279149,30.34688', '朗诗花漫里', '杭州市余杭区博卡路', '杭州市', '', '68000.613855', '120.281283,30.346116', '商务住宅;住宅区;住宅小区', '1:1.1', '1.5', '122858平方米', '22524', '2014年,朗诗绿色地产在大城东地铁口的升级大成之作。    项目位于杭州大城东主轴线上,紧挨杭州唯一的5万方宜家国际家居城,距离地铁一号线乔司站仅300米,是地铁1号线旁唯一的低密度多层花园洋房社区,25分钟畅达武林商圈。    同时项目处于规划中的800万方九乔国际商贸城核心位置,35万方地铁上盖大型综合体近在咫尺,自身带有7000方的一站式服务商业街,让生活享受触手可及的国际都会繁华    项目总建筑面积18万方(其中商业配套面积7千方),容积率1.5,产品面积段包括80㎡--110㎡的三房、四房,其中一楼底跃设计,带私家花园,且赠送阳光地下室,即买一层送一层;顶楼为奢华跃层设计,赠送超大观景露台。    更近城市中心,更丰富城市配套,2014年,期遇80-110㎡大美纯洋房社区', '2016-05-16', '1.80元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF5N3XF', '330100', '120.154388,30.177298;120.158226,30.177217;120.159464,30.177108;120.160696,30.177081;120.160763,30.177015;120.160725,30.176936;120.160644,30.17691;120.160537,30.176898;120.159975,30.176859;120.159341,30.176898;120.159249,30.176541;120.158684,30.176356;120.157956,30.1762;120.157305,30.176175;120.156854,30.176231;120.156567,30.176276;120.155821,30.176325;120.154497,30.176195;120.154388,30.177298', '江畔云庐', '杭州市滨江区滨文路与明德路交汇处(浙江艺校北侧)', '杭州市', '', '45202.931597', '120.156955,30.176772', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '小区位于滨江区省艺校北侧,步行5分钟即可到达滨文路与明德路交叉口,公交有115路、119路、354路、706路、B支3路、107路、901路、K194路,225路(夜间线),交通十分便利。周边学校众多,业态成熟,人文气息浓厚,小区及周边医疗、商业等设施配套成熟完善,可满足多样化需求。', '', '');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF5N5Y5', '330100', '120.140469,30.372507;120.140418,30.370465;120.137663,30.370555;120.137719,30.372618;120.140469,30.372507', '大家运河之星', '杭州市拱墅区康兴路和郁世门街交汇处', '杭州市', '0103000020E610000001000000050000008446B071FD085E40F487669E5C5F3E404371C79BFC085E40095053CBD65E3E40A2B77878CF085E40895E46B1DC5E3E406C425A63D0085E40A3E6ABE4635F3E408446B071FD085E40F487669E5C5F3E40', '51465.994964', '120.139065,30.371536', '商务住宅;住宅区;住宅小区', '1218个（0.84:1）', '2.5', '182067平方米', '20720', '大家房产依循杭州城市版图而延伸,见证杭州城市的荣耀变迁史。运河之星项目是大家房产首次落子杭州城北,也是运河新城范围内首个高品质住区。项目位踞运河新城核心腹地,与贯穿杭州南北的上塘高架咫尺之遥,距市中心武林商圈也仅20分钟车程。教育配套方面,项目周边拥有杭州新城实验小学、新城幼儿园、杭十四中康桥校区等优质教育资源,形成全龄段优质教育。同时项目东南面将建设2.4万方的大型文体中心,配有大型农贸市场、卫生医疗服务中心、文体娱乐设施等。区域内配套资源丰富,规划引进1所市级以上三甲医院、3个文化活动中心和3个大型商业中心。项目总建筑面积约18万㎡,采用南低北高的中轴对称布局,南面为5栋11层小高层公寓、北面为10栋21-29层高层公寓。住宅主力户型为80-90㎡三房/四房居所,另有部分118㎡四房户型,能满足不同家庭的需求。建筑采用现代典雅风格,结合“交互式景观园林”,园区内设有丰富的运动健身设施:2个健身活动区,1个室外羽毛球场,1条约480m环形塑胶跑道,将健康理念与休闲生活融为一体。以打造“武林府”的原班团队,以醇熟的产品设计能力、卓越的住宅营造力,再次为大家献上精工优质住宅。伴随着运河新城的迅速崛起与发展,大家R26;运河之星将成为拱墅区运河畔最具成长潜力的品质住区。杭州市城建开发集团创建于1982年,1990年经建设部批准具有一级城市综合开发资质,1999年经国家工商局注册创立“大家房产”品牌。集团主要从事房地产开发与经营、大中型市政公用设施建设、保障房建设等业务。集团在上海、杭州、富阳、安吉、长兴、黄山等城市,已建设住宅小区近70个,建筑面积近750万平方米。近年来,集团在杭开发了市中心顶级豪宅标杆武林府、城东地铁大盘多立方、山水系精品大宅之江悦等多个重要项目,为杭州的品质人居画上了浓墨重彩的一笔。', '2016-10-22', '2.25元/月/平方米');
