INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF5U04L', '330100', '120.281949,30.164755;120.282034,30.165553;120.281359,30.165835;120.281133,30.165913;120.280587,30.166075;120.280592,30.166283;120.281481,30.166374;120.281534,30.166428;120.281528,30.166497;120.281278,30.168167;120.280634,30.168144;120.280611,30.168429;120.281834,30.168485;120.281894,30.168468;120.281928,30.168418;120.282042,30.167201;120.282077,30.167174;120.282133,30.167174;120.28274,30.167236;120.282812,30.167224;120.282853,30.167174;120.282872,30.167077;120.282882,30.167057;120.282907,30.167046;120.283142,30.167074;120.283163,30.16707;120.283179,30.16705;120.283276,30.166457;120.28369,30.166506;120.283776,30.166493;120.283827,30.16646;120.283867,30.16639;120.283872,30.164549;120.283833,30.164445;120.283692,30.164414;120.282098,30.164658;120.282003,30.164687;120.281949,30.164755', '尚美名府', '杭州市萧山区萧绍路', '杭州市', '', '60369.623388', '120.282449,30.166185', '商务住宅;住宅区;住宅小区', '688个', '3.82', '141975平方米', '17000', '尚美名府项目坐落于乐购超市西侧,南邻萧绍路,北依育才东苑,属于老城区中心地段,交通便利,环境优美。项目总用地面积25055㎡,总建筑面积141975㎡。项目规划为5栋26-28层住宅楼,总建筑面积141975㎡,地上建筑面积96769㎡(其中开发住宅建筑面积84210㎡,地下停车库建筑面积45216㎡,总居住用户为460户。项目容积率为3.82,总停车位688辆,建筑密度20.4%,绿地率32%。小区于2009年10月破土动工,2014年12月完成全部开发,项目的建成将极大满足老城区住户的购买力,尤其是改善型客户的尊崇需求。    小区环境:绿地率35%,极大提高了小区环境品质。园内绿化设计以休闲为主题,环境的空间和人们交流的场所。园林设计和植物配植,体现四季的变换,因时因势造景,达到“四季皆有,时时韵不同”的境界。小区设计篮球场、儿童游乐场,中心景观广场,健身院,沿河休闲景观带等。', '2012-12-09', '2元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF5YOCE', '330100', '120.1148,30.378413;120.114852,30.378489;120.114926,30.378536;120.117635,30.378639;120.1177,30.378591;120.117745,30.378516;120.117759,30.375539;120.115926,30.37554;120.11579,30.375624;120.11523,30.376861;120.115017,30.377356;120.1148,30.378413', '上亿彩虹郡', '杭州市余杭区博园路7号', '杭州市', '', '70463.724494', '120.11647,30.377169', '商务住宅;住宅区;住宅小区', '约1100个', '3.35', '435000平方米', '', '有人说,翻过彩虹桥的对岸就是理想中的幸福家园。现如今,彩虹郡即将到来……    上亿彩虹郡,亿丰集团继蔚蓝郡之后又一扛鼎力作。项目为杭州北部新城农副产品物流中心核心商业综合体“上亿北城广场”中规划的住宅部分。    彩虹郡规划建筑面积12万方,由7幢百米高层沿彩虹河景观带错落分布。外立面采用artdeco设计风格,附加经典的古典元素的浮雕和柱式,追求尊贵典雅的贵族气质,小区内部的生态园林景观与彩虹河融为一体,形成独有的水景住区。    便捷的交通路网,20分钟通达武林。    彩虹郡周边交通资源丰富,路网布局合理先进,项目紧邻上塘高架,与武林核心商圈直线距离仅17公里,地铁2号线,10号线规划经过,与杭州绕城高速与杭宁高速均可无缝对接。    家门口的五星级酒店和一站式购物SHOPPINGMALL.    上亿彩虹郡最大的优势在于项目丰富的生活配套,五星级酒店,高档写字楼,会展中心,3D动感影院,KTV,大型超市,这里涵盖了繁华商住区的所有元素,与地标性建筑为邻,配合5万方一站式购物中心。    商业资源:万达广场、欧尚超市、西田成购物中心,果蔬、水产等八大市场环绕。    教育资源: 勾庄幼儿园、良渚第二小学', '2015-06-19', '1.3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF689AS', '330100', '120.063896,30.362186;120.063875,30.35926;120.065634,30.35927;120.065645,30.36219;120.063896,30.362186', '上亿SOHO', '杭州市余杭区古墩路延伸段(上亿最家空间旁)', '杭州市', '0103000020E6100000010000000500000018963FDF16045E40AE11C138B85C3E400C022B8716045E40CEC29E76F85B3E405DE0F25833045E40156F641EF95B3E405709168733045E4030F0DC7BB85C3E4018963FDF16045E40AE11C138B85C3E40', '46660.100123', '120.064762,30.360725', '商务住宅;住宅区;住宅小区', '747', '2.45', '40000平方米', '', '上亿SOHO,位居良渚上亿中心80万方城市商业综合体之上。4万方青春公寓,40—60㎡精致小居,全能户型,上下灵动双层空间,可居家可办公,不限购不限贷,经典都市繁华私密寓所。临近地铁二号线新良路站,令您出行畅通无阻。体验80万方城市综合体带来的精彩生活,享受上亿SOHO前所未有的生活情调。上亿SOHO,4万方青春点燃城市激情梦想!', '2014-11-15', '3.8元/月/平方米');
