INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF6W4DG', '330100', '120.200112,30.237507;120.200121,30.237633;120.20017,30.237677;120.200316,30.23773;120.20041,30.23775;120.200829,30.237741;120.201038,30.237739;120.201133,30.237839;120.201425,30.23766;120.200884,30.237104;120.200825,30.23705;120.200771,30.236979;120.200729,30.236884;120.200718,30.236832;120.200709,30.236751;120.200765,30.23604;120.199658,30.235966;120.199597,30.236828;120.200234,30.237427;120.200112,30.237507', '华龙坊', '杭州市上城区近江北路41-63号', '杭州市', '', '17251.344342', '120.200365,30.236874', '商务住宅;住宅区;住宅小区', '', 'None', '', '', '华龙坊处于钱江新城核心地段,距离市民中心步行只有10的左右的路,靠近钱塘江畔,休闲运动十分方便,距离四季青和华东家具市场也是十分的近的步行大概在10—15。附近房子有98年的一批,03年左右一批,以及07年以后的次新房!年代都是比较新!华龙坊位于耀江福村世纪坊近江家园边。通过小区道路的合理组织,休闲设施的精心安排,提供自然、舒适的居住环境。社区主流健康向上,社区风气良好,邻里关系和谐。项目以实用、舒适、分区合理为整体规划原则,户型选择丰富,居住实用率高。', '', '');
