INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFF6Y5GZ', '330100', '120.113947,30.332358;120.11481,30.332525;120.116151,30.332785;120.116635,30.332883;120.116687,30.332885;120.116721,30.332877;120.116768,30.33285;120.116804,30.332809;120.116839,30.332734;120.116927,30.332396;120.116116,30.332194;120.116335,30.331525;120.116257,30.331512;120.115956,30.331452;120.115586,30.331376;120.115536,30.331364;120.115518,30.33134;120.115511,30.331307;120.11553,30.331243;120.115679,30.330774;120.11579,30.330433;120.115796,30.330383;120.115748,30.330366;120.115443,30.33031;120.114675,30.330131;120.114627,30.330135;120.114558,30.330233;120.114481,30.330415;120.114295,30.330785;120.11418,30.33107;120.11409,30.331398;120.114022,30.331722;120.114003,30.331871;120.113978,30.331948;120.113903,30.332257;120.113895,30.33229;120.113913,30.332326;120.113929,30.332342;120.113947,30.332358', '华盛达·阅城', '杭州市拱墅区祥茂路100号', '杭州市', '', '41317.678248', '120.1152,30.331643', '商务住宅;住宅区;住宅小区', '1000多个', '2.2(住)、2.7（商）', '180000平方米', '36900', '具有前景的升值版块    华盛达阅城项目位于杭州主城区桥西板块,拱墅辖区内,东至杭行路,西至祥茂路,北至祥富路。近享京杭运河如画风景、桥西醇熟配套,周边交通畅达,通过上塘高架、留石快速路、莫干山路、石祥路、杭行路等城市主干道路与杭州城市中心及周边区域紧密相连。    阅城不仅拥有一流的规划、美观的建筑、宜人的景致,而且还拥有完善的配套,从健身到娱乐、从生活到休闲,一一齐备,都将为你带来与国际一流住区品质接轨的美好未来。    丰富的规划建筑形态    项目占地面积为54198平方米,总建筑面积18万余平方米,规划有住宅与商业配套。住宅用地区块,总建筑面积约13万余平方米,由法式电梯庭院洋房、园景小高层公寓、宽景高层公寓组成,总计700余套房源,三类创新型舒适产品,满足城市不同人群对于舒适生活的美好愿望。    阅城的建筑形态沿袭法式新古典主义建筑的人文基调,借鉴了巴黎当地杰出建筑物充满人性关怀的经典建筑形态,并在此基础上添加了一些新的现代元素。建筑整体依照经典美学标准设计,通过色彩、尺度、全石材干挂等材质的灵活运用,散发出历史气息与人文魅力。    多类型的私密空间    25-26层宽景高层公寓,户型面积区间为89-130平方米,由平层户型和跃层户型组成。其中独创的89平方米平层户型南北通透,同时配备双卫设施,并带有外跃式空间延伸,可随业主的个性化理念变化户型的设计,两房改造成三房,是真正意义上的空中平层大宅生活;跃层户型的客厅挑空设计等创新元素不仅增加了立体空间的趣味性,而且使空间的对外延展性大大增强,其中107平方米的跃层户型通过巧妙改造,可以实现四房二厅二卫的空间格局,相当于获得130多平方米的空间体验。    11层园景小高层公寓户型面积区间为130-140平方米,提供亲地的舒适生活,更设计有空中露台,空中花园,在客厅内可近享绿化景观,体验真正品质的空中别墅,在欣赏园区内精致景观的同时,家中也拥有一片自然的美好。    法式电梯庭院洋房户型面积区间136-280平方米,纯正法式的外立面,更配备尊贵的多层电梯,下沉式庭院、景观露台、空中花园等都提供了与自然亲密接触的场所。大面积上跃式的奢华户型,相互提升,为业主带来最完美的法式生活。    商业金融用地区块,总建筑面积约5万平方米,由一幢5层多层和一幢20层高层组成,物业形态规划为商业及I-home精致私寓,户型面积区间为37-68平方米,定位于现代精英的私人寓所,根据需求也做到南北通透的设计,真正地实现了个性化的空中私寓概念。    纯粹的法式花园环境    阅城住宅区内更塑造了艺术与生活相结合的法式园林环境,对称围合式景观的园林设计、赋予礼仪感的尊贵园区入口、层次分明的绿色植载与独具特色的景观小品、亲近自然的丰富社区活动空间(文体中心、室外嬉水池、儿童游乐场、小型高尔夫果岭等)、半围合的古典欧式庭院、轻快明亮的水系景观,以及温馨活泼的架空层景观区等等,都将为生活在此处的我们带来最为美妙的浪漫情调与优雅气息,呈现出私家花园般静谧的美好气质。', '2013-07-06', '1.75元/月/平方米');
