INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFA5W7N', '330100', '120.163663,30.382467;120.163714,30.382448;120.163745,30.382411;120.163754,30.382355;120.16356,30.38128;120.163356,30.380371;120.163342,30.380324;120.163291,30.380278;120.163219,30.380265;120.161717,30.38029;120.161748,30.382513;120.163663,30.382467', '上亿中央郡', '杭州市余杭区崇贤街道崇杭路与塘康路交叉口西南角', '杭州市', '', '36917.258286', '120.162651,30.381424', '商务住宅;住宅区;住宅小区', '1238个', '3', '183783平方米', '', '作为临平副城未来发展的一个重要空间,杭州运河新城建设的拓展与延伸,崇贤新城的潜力日渐凸显,随着“1358行动”计划的不断推进,2014年,崇贤新城进入了发展的关键阶段。区域潜力的不断挖掘,吸引了不少知名开发商的入驻,各有亮点,各具优势,上亿集团也于去年将目光投注到崇贤新城,并于今年为崇贤新城增添新盘——上亿中央郡,位居崇贤新城正中心,掌控繁华,颇具领舞崇贤新城之意。依托综合体。上亿中央郡坐落于上亿广场这一大型综合体之中,被誉为建筑在综合体上的住宅,而正是依托综合体这一大优势,让中央郡具备了全面的商业配套——大型Shoppingmall、乐购超市、潮流街区、高档写字楼。上亿广场约7.8万方的商业体量,业态极为丰富,涵盖超市、影城、购物中心等,为其内部住宅上亿中央郡提供了商业配套的同时,也填补了崇贤新城商业配套的空缺。交通三大优势自崇贤新城迈入快速发展期,楼盘相继开发,越来越多的购房者关注到这个区域,普遍反映出“只要解决交通问题,还是很愿意在此置业”的心声。因此,崇贤新城的交通问题受到了很大的关注。崇贤新城紧邻秋石、上塘两条快速路,无缝对接钱江新城、武林广场两大CBD,通过快速路,直达城市中心;规划建设的快速公交7号线将覆盖崇贤新城启动区;另外在杭州地铁规划中,地铁10号线将从黄龙体育中心往北,直达崇贤新城核心区。上亿中央郡位居崇贤新城正中心,充分具备了交通上的这三大优势,因此一经亮相就受到了购房者的广泛热议。四方围合式规划上亿中央郡规划建设四栋住宅,呈四方围合式布局,讲究八面来风,四方汇聚。地处崇贤新城正中心,同时又建在综合体之中,可谓汇聚了一城的繁华,围合式布局将人气、福气、财气聚合,打造人居样本。90方双卫大三房。随着人们对自然的渴求,开发商也更注重环境与景观的打造,上亿中央郡与向阳文体公园相邻,作为一大环境配套与社区内景观相呼应。据悉,项目南面规划建设大型体育公园,西面则有卧龙浜沿河生态公园,实现滨水而居的诗意生活。无论是商业配套还是休闲配套,上亿中央郡都极大的满足了人们的需求,而在户型上也极尽苛求,89-110平方米的户型面积区间,满足了当下购房者多样化的需求,合理科学布局,打造90方双卫大三房,实现三世同堂,安家置业一步到位。', '2014-11-23', '1.7元/月/平方米');
