INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFECA48', '330100', '120.0681,30.354809;120.067467,30.354291;120.067917,30.352874;120.068282,30.352791;120.068239,30.3523;120.069044,30.352162;120.069559,30.352023;120.070728,30.35305;120.069795,30.354152;120.068765,30.355189;120.0681,30.354809', '越秀星汇悦城', '杭州市余杭区古墩路与吴王路交叉口', '杭州市', '', '54602.782567', '120.068977,30.353509', '商务住宅;住宅区;住宅小区', '1456个，车位配比1:1.1', '2.3', '185367.1平方米', '21785', '越秀星汇悦城地处城西主干道古墩路之上,北靠柴家坝港,南至城市规划支路,城北新城、城西商圈于四周形成繁华合围之势。项目总建筑面积约18万㎡,户型面积以85、89、115平方米。建筑采用明快利落的港式简约设计风格。40,000方园林设置七重主题娱乐空间,中央水景区、运动休闲区、宠物恋爱区、儿童乐园、农夫小果园、阅读空间、派对乐园……全线对味轻生活,旨在于城西繁华之上构筑一个低碳、生态、充满活力的鲜活领地,成为新轻年专属的“轻生活住区”。    星汇悦城毗邻亲亲家园商业街,世纪联华、两岸咖啡、知味观、新华书店等众多商业品牌应有尽有,繁华丰盛近在眼前。周边更有西田城、香港城、麦德龙、永旺梦乐城环伺,吃喝玩乐购都可举步直达。同时,悦城内部前瞻规划有6,000方商业配套,让业者在家门口看即可悠闲满足日常的生活所需。    依托古墩路的便利出行,城西商圈、武林商圈、庆春商圈、万象城……杭城繁华尽可一路通达,未来从悦城出发步行260米,即达地铁2号线新月路站,畅行无阻的轻轨生活近在眼前。', '2016-02-29', '2.5元/月/平方米');
