INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFLIMBQ', '330100', '120.08434,30.329353;120.084291,30.329301;120.083034,30.329023;120.082925,30.329066;120.082755,30.329825;120.082787,30.329904;120.082859,30.329946;120.084047,30.330218;120.084113,30.330194;120.08434,30.329353', '紫金港湾', '杭州市西湖区董家路和通济路交叉口', '杭州市', '', '12146.571957', '120.083536,30.329615', '商务住宅;住宅区;住宅小区', '197', '2.4', '', '29863', '紫金港湾,新城西繁华核心三墩镇中心,通济路和董家路交叉口,近邻浙江大学紫金港校区、西溪风景旅游园区,为“大城西示范核心区”中心位置。 紫金港湾项目总建筑面积约4.2万平方米,依托浙大紫金港深厚历史人文底蕴,导入艺术生活理念,以艺术的思想和笔触在园区布置4幢18层短板建筑及少量住宅底商,95-125平方米精致户型,打造新城西具艺术文化气息的精致生活家园。', '2008-04-24', '1.4元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFLIV9Z', '330100', '120.18243,30.334264;120.182088,30.334242;120.181381,30.334329;120.181806,30.33616;120.182647,30.336093;120.183405,30.33602;120.183987,30.335966;120.183952,30.335228;120.183834,30.33428;120.18243,30.334264', '荷风苑', '杭州市下城区永清路41号', '杭州市', '', '39876.420785', '120.182733,30.335155', '商务住宅;住宅区;住宅小区', '', '2.3', '45500平方米', '24979', '绿化好空气清新配套设施齐全', '', '0.8元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFPA4HA', '330100', '120.101955,30.323008;120.101721,30.323652;120.102766,30.323917;120.103576,30.324116;120.103725,30.323768;120.10378,30.323335;120.103785,30.323231;120.10376,30.3232;120.102089,30.322727;120.101988,30.323015;120.101955,30.323008', '祥符佳苑', '杭州市拱墅区丽晶湾路99号', '杭州市', '', '16439.484465', '120.102796,30.323435', '商务住宅;住宅区;住宅小区', '', 'None', '', '23696', '丽晶湾总建筑面积近7万㎡,位于杭州未来商业中心申花CBD。项目毗邻五里塘河,风景优美,距武林广场直线距离约6.5㎞,交通便捷,是用地日益稀缺的主城区项目之一。 目前板块内商业配套逐渐成熟,包括在建的40万㎡银泰购物中心、已开业的沃尔玛,同时项目周边拱墅区政府将联袂启动六大综合体项目,形成杭州主城的区域商业中心。此外,丽晶湾项目更将零距离享受建设中的百万平米蓝孔雀综合体、央企拟入驻开发的蓝翔综合体等大型城市综合体的超级配套。 发展商建工地产集团作为杭州国际化生活的缔造者,已成功开发世贸丽晶城、欧美中心(EAC)等杭州市中心国际化标杆力作,秉承国际精品人居理念,将丽晶湾项目打造为杭州首家“法国艺术精工住区”', '', '1.05元/月/平方米');
