INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFFVSL9L', '330100', '120.12091,30.341461;120.123646,30.341368;120.123394,30.340678;120.123442,30.340132;120.123882,30.338886;120.121077,30.338743;120.120883,30.33984;120.12091,30.341461', '越秀·星汇尚城', '杭州市余杭区东吴路与通运口交叉口', '杭州市', '0103000020E6100000010000000800000099F04BFDBC075E4005DCF3FC69573E40FF91E9D0E9075E40A3E6ABE463573E4073A1F2AFE5075E40797764AC36573E40FB3C4679E6075E40B55208E412573E4009A4C4AEED075E407F129F3BC1563E400FD3BEB9BF075E40BABF7ADCB7563E401DE90C8CBC075E4065DF15C1FF563E4099F04BFDBC075E4005DCF3FC69573E40', '62761.744979', '120.122234,30.340096', '商务住宅;住宅区;住宅小区', '1513个，车位比0.91　', '2.5', '167000平方米', '26119', '越秀星汇尚城位于通运路与东吴路的交叉口,由广州开发商越秀地产开发。越秀地产成立于1983年,至今已有32年的历史,开发经验丰富。项目东临冯家浜路,南临祥园北路,西临锦江路,北临上园路,总占地6.7万方左右,总建筑面积约17.6万方,容积率仅2.5,绿地率30%以上,规划14幢18-25层现代古典风格的高层建筑。建筑群利用点式和板式的合理搭配,让每户都能拥有良好的采光和通风,并在东西北面共设约10000㎡的底商风情商业街。', '2017-03-24', '2.8元/月/平方米');
