INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGAQYN2', '330100', '120.036721,30.283732;120.037075,30.282773;120.038705,30.283462;120.0388,30.283628;120.038454,30.284209;120.036721,30.283732', '大华西溪风情澄宫', '杭州市余杭区文一西路833号,淘宝城东侧', '杭州市', '0103000020E61000000100000006000000E48409A359025E4024D40CA9A2483E40F31FD26F5F025E401A31B3CF63483E40444C89247A025E40A4A833F790483E406DC5FEB27B025E40DA3A38D89B483E40A019C40776025E40973AC8EBC1483E40E48409A359025E4024D40CA9A2483E40', '15171.565461', '120.037734,30.28354', '商务住宅;住宅区;别墅', '地上130个 总数：130个 比例：0:130 地下车位：130个', 'None', '35000平方米', '', '大华西溪风情澄宫有17万平米西溪原生水域与1500亩原生湿地地貌,3万多平米中央生态景观湖与3500米西溪天然河道。项目位于西城广场以西4.5公里,文一、文二西路可直达,绕城公路五常出口即达,交通便捷,周边西溪印象城、阿里巴巴淘宝城、海创园等环绕。澄宫位于西溪风情排屋大盘内的半岛双水岸格局,主力户型面积在200-300㎡,在低密规制的产品中首创性引入平面排屋的全新理念,3.2米层高、8.6米宽景阳台、4.8米面宽主卧以及五进豪厅设计。', '2012-10-13', '3.5元/月/平方米');
