INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGPVC5U', '330100', '120.201759,30.229901;120.200638,30.22987;120.200586,30.231236;120.202186,30.231261;120.202184,30.230114;120.202129,30.23001;120.202048,30.229953;120.201923,30.229921;120.201759,30.229901', '近江三园', '杭州市上城区珊园弄13号', '杭州市', '', '19261.540304', '120.20139,30.230579', '商务住宅;住宅区;住宅小区', '', 'None', '', '45709', '近江三园位于富春路和衢江路交汇处,房屋性质部分为经济适用房、部分为回迁房,整个小区属多层、小高层、高层建筑,内部绿化较好。', '', '');
