INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGQVR6I', '330100', '120.125309,30.353582;120.125435,30.352939;120.125709,30.352821;120.125856,30.352805;120.126138,30.352777;120.12635,30.352767;120.12664,30.352747;120.126701,30.352742;120.126798,30.3528;120.126645,30.353615;120.125309,30.353582', '瑞麒时代', '杭州市余杭区通益路', '杭州市', '', '9778.577541', '120.126078,30.353196', '商务住宅;住宅区;住宅小区', '259个', '2.49', '39000平方米', '', '瑞麒时代位于杭州运河新城商贸核心区。地理位置异常优越,北拥杭城最大的菜篮子工程杭州农副产品物流中心,南临创业乐土北部软件园,东坐风景如画的京杭运河、与地铁四号线运河新城站一路之隔,西接前景广阔的北部新城核心区。经上塘高架,15分钟可到武林广场,30分钟即到临平。瑞麒时代项目占地面积9499平方米,总建筑面积约39000平方米。整个项目由两幢17层滨水景观住宅,一幢13层精品写字楼以及三层商业裙房围合而成一个小型复合综合体。两幢住宅整体采用底层架空设计,增强业主居住舒适性,提供便捷健身、娱乐场地。在户型上,着力实用、坚持创新,84方边套做到三房两厅,紧凑实用。中间套84、87方,两室两厅,做到三房朝南,保证了阳光充足的同时,做到每个户型都有错开式阳台赠送,赠送面积实用。精品写字楼,以精致、大气为核心理念,注重细节,以大块面石墙与低反射透明玻璃界面相结合的方式表现内在的商业氛围,以竖向线条布置形成挺拔效果。写字楼共计13层,每层建筑面积可达700余方,既可做开放式办公场所,也可分割成小型办公单元,多元化的选择,满足不同业主的需求。在写字楼的配套上,我们在一楼大厅开辟近百平方米的休闲吧,在办公楼12层规划一间一百多平方米的精装修会议室,可以提供给业主使用。在项目配套上,我们规划近7000方的地铁商业,为了更好的为业主提供完善的商业服务,公司将自持有经营4000方商业,计划引进大型品牌卖场,不仅解决业主的生活日常需求,也推动了整个商业的成熟。', '2014-04-30', '1.32元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGTNAFX', '330100', '120.217086,30.340392;120.220589,30.340702;120.220702,30.340632;120.220712,30.34054;120.220004,30.339257;120.219259,30.338165;120.218282,30.338341;120.216456,30.338331;120.217086,30.340392', '龙湖武林九里', '杭州市江干区华丰路与同协路交叉口东南角', '杭州市', '', '67098.911878', '120.218507,30.339468', '商务住宅;住宅区;住宅小区', '停车位1960个', '2.3', '180000平方米', '', '龙湖武林九里,地处杭州武林门板块九公里区域,紧邻城市新中轴秋石快速路,位于德胜北高端居住区,是主城花园洋房大盘。周边有中大银泰城、物美等大型购物商场,外有半山国家森林公园生态大境,内被十里桃花、水景公园2大公园簇拥,享墅区所享。 INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGXE0VS', '330100', '120.114719,30.351486;120.114709,30.350505;120.115309,30.350408;120.115899,30.350389;120.116216,30.350421;120.116774,30.350533;120.117198,30.350533;120.117654,30.35044;120.118356,30.350236;120.118313,30.3515;120.114719,30.351486', '万科杭宸', '杭州市余杭区杭行路好运路交叉口', '杭州市', '', '34806.867654', '120.116544,30.350961', '商务住宅;住宅区;住宅小区', '906个', '2.2', '117041.22平方米', '26000', '万科杭宸是杭州万科2016精研新品。位于上塘高架、杭行路两大城市交通中轴上的杭宸,周边有万达广场、西田城购物中心等完善商业和大型人居集群。INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGXF47I', '330100', '120.213654,30.345237;120.215407,30.345117;120.215696,30.34376;120.215669,30.343672;120.214289,30.343293;120.214251,30.343415;120.212692,30.343049;120.212687,30.343279;120.212738,30.345218;120.213654,30.345237', '龙湖名景台南苑', '杭州市江干区同协路与杭玻街交汇处东', '杭州市', '', '48007.972817', '120.214053,30.344245', '商务住宅;住宅区;住宅小区', '', '', '', '', '', '', '');
