INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGXJMTP', '330100', '120.026015,30.292529;120.026112,30.292626;120.028542,30.293474;120.028681,30.2934;120.029121,30.292538;120.026552,30.291681;120.02631,30.291769;120.026015,30.292529', '富力新线公园', '杭州市余杭区常二路与海曙路交叉口', '杭州市', '0103000020E61000000100000008000000268DD13AAA015E40AF21382EE34A3E401F82AAD1AB015E4094F59B89E94A3E40FF23D3A1D3015E40EF39B01C214B3E401041D5E8D5015E407AA52C431C4B3E401EA8531EDD015E4056D636C5E34A3E402DE92807B3015E4055DD239BAB4A3E40B2632310AF015E4093FC885FB14A3E40268DD13AAA015E40AF21382EE34A3E40', '27075.131896', '120.027543,30.292564', '商务住宅;住宅区;住宅小区', '', '3', '13626平方米', '', '富力新线公园地处以中国“硅谷”为目标打造的未来科技城,是阿里巴巴等数百家企业描绘梦想、创造财富的热土。这里也是生活开始的地方,高层次人才、海归、技术精英等人才云集,吸引着各大配套纷纷进驻。2016年,富力地产继富力十号、富力西溪悦居之后,在未来科技城打造全新住宅——富力新线公园,以时尚、便捷、个性的居住理念,演绎令你动心的一站式生活蓝图。', '2017年04月', '1.5元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGXN2CQ', '330100', '120.299444,30.164777;120.30212,30.165602;120.302182,30.165574;120.302229,30.165522;120.302472,30.163545;120.302456,30.163477;120.302395,30.163433;120.299507,30.163126;120.299444,30.164777', '恒晟御景湾', '杭州市萧山区萧绍路天马加油站南(原杭州柴油机厂)', '杭州市', '', '51047.341604', '120.300983,30.164249', '商务住宅;住宅区;住宅小区', '1：1', '1.8', '138656平方米', '', '御景湾紧邻新杭州火车南站,畅享城市新中心带来的无限价值潜力;目前周边市政配套及生活设施齐全;展望未来,定位为城市南部现代化综合交通枢纽中心,集现代服务、旅游集散和居住职能为一体的杭州南站商圈,更将伴随城市及时代的推进,形成萧山全新的生活中心。    御景湾三面水景环绕,北瞰萧绍古运河,南依内官河,西靠范家河,,闹中取静,风景这边独好,悠享城市岛居生活。总建筑面积13万余平方米,规划6幢点式高层景观公寓及稀缺水景联排,从外立面来看,承袭地中海风格的建筑艺术,赋予项目浓厚的西班牙异域风情,将流动的线形美与凝固的雕塑美和谐统一,装饰典雅温馨,流传新古典主义恒久魅力。', '2013-09-28', '1.8元/月/平方米');
