INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGYP9B1', '330100', '120.039107,30.294545;120.03938,30.295043;120.043522,30.295376;120.043656,30.294014;120.043575,30.293922;120.043511,30.293894;120.043452,30.293871;120.039981,30.293403;120.039107,30.294545', '北大资源·未名府', '杭州市余杭区海曙路与荆长大道交汇处', '杭州市', '', '60229.206141', '120.04147,30.294434', '商务住宅;住宅区;住宅小区', '共1438个机动车位，其中地上138 个，地下1300个，车位配比为1:1.47', '2.1', '60000平方米', '29000', '北大资源未名府,是北大资源继浙商财富中心和海港城项目之后落子杭城的首发住宅巨作。项目择址西溪核心居住区,距离西溪国家湿地公园仅3公里。静栖湿地之畔,在这个雾霾困扰的城市里,尽享弥足珍贵的些许清新。INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGYR819', '330100', '120.13211,30.329971;120.132061,30.328073;120.132099,30.328008;120.132249,30.32792;120.133976,30.327971;120.133998,30.329485;120.133558,30.329467;120.133542,30.329981;120.133537,30.330082;120.13211,30.329971', '金地大运河府', '杭州市拱墅区祥符街道通益路与花园岗街交叉口', '杭州市', '', '33774.782458', '120.132991,30.328934', '商务住宅;住宅区;住宅小区', '共796个停车位，车位配比1:1.3', '2.8', '114919平方米', '40000', '金地大运河府,位于拱宸桥以西,京杭大运河畔,是桥西低密住宅产品形态项目。INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGYR9YE', '330100', '120.161793,30.383183;120.161712,30.385383;120.162935,30.385397;120.163557,30.385381;120.163823,30.385351;120.163893,30.385319;120.163944,30.385161;120.16392,30.383449;120.163882,30.38294;120.163826,30.382875;120.163734,30.382833;120.162737,30.382824;120.161776,30.382838;120.161793,30.383183', '旭辉时代城', '杭州市余杭区崇杭街与塘康路交汇处', '杭州市', '', '50288.687109', '120.162837,30.384121', '商务住宅;住宅区;住宅小区', '1406个', '2.4', '129780平方米', '', '旭辉时代城是旭辉地产2016年在余杭区全新上市的高端住宅项目。项目位于余杭区崇贤新城核心区域,北至石塘路,南临崇杭街,东至塘康路,西达崇康线,包含排屋、高层、临街商铺等多种物业类型。旭辉时代城社区致力打造都市朋友生活圈,满足业主生活、休闲、社交等多方面需求。INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFGZFUDL', '330100', '120.27786,30.164291;120.277851,30.164086;120.27784,30.163907;120.277854,30.163487;120.278479,30.163489;120.278583,30.163491;120.278672,30.163545;120.278814,30.164004;120.27839,30.164027;120.278382,30.164106;120.278379,30.164189;120.278342,30.164261;120.27832