INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFHOJHK8', '330100', '120.281971,30.189762;120.281885,30.187926;120.2846,30.187829;120.284809,30.187894;120.284836,30.188;120.284906,30.189633;120.284782,30.189739;120.281971,30.189762', '融信江南学府', '杭州市萧山区博学路与通惠中路交叉口', '杭州市', '0103000020E61000000100000008000000E8DA17D00B125E400806103E94303E40E90E62670A125E406F1118EB1B303E40431CEBE236125E408A3DB48F15303E40D026874F3A125E40581D39D219303E404D2EC6C03A125E40E3A59BC420303E40CA1B60E63B125E400C3ECDC98B303E40541F48DE39125E4097C62FBC92303E40E8DA17D00B125E400806103E94303E40', '50130.222262', '120.283405,30.188812', '商务住宅;住宅区;住宅小区', '共1307个，地上33个，地下1254个，非机动停车位诶1985个', '3', '190150平方米', '', '融信江南学府,位处区政府板块核心,傲踞人民广场东翼、紧邻金城路,盛享萧山市心醇熟商圈,约2.5公里范围内汇聚大润发、万象汇、银隆百货、旺角城新天地等九大综合体商业配套,轻松畅享都会繁华。项目接壤北塘河公园,约1公里范围内拥揽银河公园、余暨公园、新安公园3大城市公园,以葱郁草木铺就怡然画卷。
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFHONT6L', '330100', '120.161964,30.335167;120.164104,30.333903;120.16286,30.332315;120.16147,30.333135;120.160741,30.333575;120.161964,30.335167', '上塘宸章', '杭州市拱墅区储鑫路', '杭州市', '0103000020E6100000010000000600000047C8409E5D0A5E40CCB22781CD553E40234910AE800A5E404A09C1AA7A553E40E674594C6C0A5E4062F8889812553E403F524486550A5E402827DA5548553E4016889E94490A5E4061C3D32B65553E4047C8409E5D0A5E40CCB22781CD553E40', '45046.118611', '120.162418,30.33374', '商务住宅;住宅区;住宅小区', '共计1059个车位。车位比为1比1.25。', '2.5', '148000平方米', '', '远洋招商上塘宸章作为远洋入杭十年第二个宸章系作品,也是继远洋公馆、大河宸章、远洋商务区后的拱墅区又一力作!项目总占地约为4万方,总建筑面积约14.8万方,规划15幢,其中8幢6-9层多层洋房,7幢25层新古典风格高层建筑,共计842套住宅。不仅从地理位置,案名,产品配置标准上延续大河宸章,建筑风格及景观细节上也将得到高度体现。', '2017-11-25', '3元/月/平方米');
INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFHONVVN', '330100', '120.058837,30.333322;120.058869,30.332215;120.058928,30.331785;120.05926,30.331299;120.058187,30.329896;120.057863,30.32934;120.057753,30.329262;120.057662,30.329258;120.056063,30.329703;120.056428,30.330433;120.056954,30.331238;120.057332,30.331775;120.058434,30.332928;120.058837,30.333322', '万科西雅图', '杭州市西湖区祥余路与莲池路交叉口', '杭州市', '', '55158.262767', '120.057802,30.330952', '商务住宅;住宅区;住宅小区', '', '2.8', '240236平方米', '', '万科西雅图,尊处杭州市西湖区科创高地、地处世界第三朵云——“阿里云”之心。位于城西科创大走廊东起点,更被阿里云谷、紫金众创小镇等全球科创要地环伺,周边拥有世界一流大学浙江大学紫金港校区、“浙江第一、全国唯一”的杭州首个“国际公学”概念的云谷国际公学、更有规划用地面积约41万方的西湖大学。INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFHQ001B', '330100', '120.116217,30.151406;120.112891,30.151406;120.112398,30.150459;120.112183,30.149801;120.112156,30.149003;120.112387,30.146734;120.115434,30.146804;120.115469,30.148043;120.115514,30.148752;120.115573,30.149063;120.11575,30.149866;120.115885,30.150445;120.116217,30.151406', '禹洲·滨之江', '杭州市西湖区枫桦东路梧桐路口', '杭州市', '', '140871.290281', '120.114001,30.149138', '商务住宅;住宅区;住宅小区', '车位比1:1.15', '2', '300000平方米', '34000', '禹洲地产,成立于1994年,砥砺耕耘20余载,秉承“大禹治水,荒漠成洲”的先贤精神,走上“拓荒”之路。在厦门区域多处开疆之后,禹洲逐步进行版图扩张,立足海西,循序布局全国。INSERT INTO "public"."gaode_residential_region" VALUES ('B0FFHS4EGU', '330100', '120.136719,30.180222;120.136758,30.179087;120.134847,30.179069;120.134844,30.179973;120.134895,30.180031;120.134967,30.18008;120.135067,30.180113;120.136719,30.180222', '富汇豪庭', '杭州市滨江区六和路365号2号楼贺田尚城售楼部', '杭州市', '0103000020E610000001000000080000007A6F0C01C0085E400C056C07232E3E40D95DA0A4C0085E40852348A5D82D3E40ADBD4F55A1085E4038BA4A77D72D3E40F583BA48A1085E40BB29E5B5122E3E403659A31EA2085E402444F982162E3E4083C2A04CA3085E40E7A90EB9192E3E4035F10EF0A4085E409E95B4E21B2E3E407A6F0C01C0085E400C056C07232E3E40', '18569.665571', '120.135812,30.179616', '商务住宅;住宅区;住宅区', '', '1.2', '24724平方米', '', '富汇豪庭尊处六和塔南岸,滨江270度江湾前席。生活之余便可独揽一线江景,享“六和听涛”、观五云山脉。项目附近4万方城市公园、沿江千米江景带,更让每个富汇豪庭主人拥有了宝贵的生态财富。周边更有地铁4号线、6号线以及B支3、B支6快速线,107路、113路、116路、194路等公交线,对接每次出行。在富汇豪庭附近,杭二中、杭州国际学校等多所中小学,亦呈现出教育住区品质。同时,富汇豪庭更紧邻沿江地标——银杏汇,优越享受即将建成的四大大型商业配套以及浙二医院(滨江分院)等医疗设施。    在尊贵的土地价值之上,富汇豪庭以醇熟运营理念,精湛建筑技艺,打造出法式联墅、88方微墅、90方小高层三大尊贵产品序列。    精工理念始终贯穿的法式联墅,以精美石材干挂、纯正法式建筑理念,呈现出别具一格的江湾生活情调。建筑内部,大面宽五层空间,超标准的地库层高设置,钜献家族第三厅堂。内外庭院、套房化主卧、地下双车驻区、工人房、洗衣房、spa房、挑空客厅、私家观光电梯等诸多贵族细节,全面烘托出法式生活的典雅细致。    88方微墅以三层功能空间及赠送地下室,创制出难得的“3+2”排屋空间,使得各个楼层功能非常明确。独享“天”“地”的格局,蕴含着公寓产品无法企及的稀缺价值。    法式小高层地处优良方位,以奢华石材干挂,创造比肩排屋的产品品质。良好室内空间规划,呈献市场稀缺的经典两房户型,一层更是独享私家花园;并于荣耀建筑之中,将国际领先技术如:光纤入户、三星可视系统、双层Low-e中空玻璃等完美运用。    移步富汇豪庭园区之内,组团内部和组团之间以庄严的法式景观大道以及公共绿地,形成安全舒适、静谧宜人的环境。道路两旁的大片绿荫,形成一个个相对静态的视觉感受。入园道路与地下车库坡道之间视线以高篱遮挡,高耸的绿化与建筑形成高远的空间形态,将华美的建筑和树林、水、风景转换成一幕幕油画。生活于此,每日皆是醇美、典雅的生活之感。', '', '1.40元/月/平方米');
